797f7127-b30f-44d3-bfc7-7bd999b0508d	Компании наконец озаботились развитием IoT-устройств и их безопасностью	ITSumma; IoT; интернет вещей; Google Cloud Platform; ARM; электроника; микрочипы; роутеры; маршрутизаторы; защита IoT; информационная безопасность; ботнеты; доверие потребителей	Типичное IoT-устройство\r\n\r\nIoT — сегмент рынка крайне молодой, только пробующий делать первые серьезные шаги. Конечно, IP-камеры и прочие датчики существуют уже давно, но полноценно назвать их «умными» язык не поворачивается. При этом одной из проблем рынка является, как ни странно, цикл разработки, потому что он подразумевает не только создание физического девайса, но и написание ПО для него в условиях крайне ограниченных ресурсов. Это 20 лет назад несколько мегабайт памяти под приложение было нормой. Сейчас же, когда оптимизация потребления ресурсов пользователям (да и разработчикам) только снится, а для топовых продуктов нормальны утечки памяти или нереальная прожорливость (привет, Chrome), работа в условиях пары сотен килобайт флеш-памяти на энергоэффективном микроконтроллере кажется наказанием для тех девелоперов, кто плохо себя вел в прошлом году. \r\n\r\nНо это не единственная проблема IoT. Не мне вам рассказывать, насколько беспомощными являются умные устройства в плане информационной безопасности. Истории о ботнетах из IP-камер, холодильников и прочих микроволновок периодически всплывают в медиа, начиная еще с 2015 года. Добавим в это «блюдо» еще и «соус» из всяких умных колонок и ассистентов типа Alexa или Алисы, и мы получим пугающую картину; со времен китайских ноунейм-камер, продукты от Amazon и Яндекса обзавелись еще и возможностью совершать онлайн-заказы по запросу владельца. Собственно, именно эти функции нового поколения IoT-устройств и заставили производителей ПО начать шевелиться, а именно — укреплять рубежи цифровой обороны наших говорящих ящиков и прочих датчиков. \r\n\r\n\r\nВот только, как это обычно и бывает со всякими стандартами в молодом сегменте, единства подхода нет. Ведь безопасность устройства можно обеспечить, как минимум, тремя путями: разверсткой облачной платформы для управления IoT, укреплением безопасности на уровне прошивки устройства и так называемым Gateway-рубежом, то есть защитой сети IoT на уровне маршрутизатора и шлюза внутреннего интранета на стыке с внешним миром. \r\n\r\nМинимум три компании-гиганта из трех различных сегментов IT-рынка прямо сейчас работают в указанных направлениях — пытаются упростить разработку и параллельно укрепить рубежи цифровой обороны. \r\n\r\nSDK от Google и облачные платформы\r\nКак обычно поступает поисковой гигант, когда речь о вхождении на какой-нибудь рынок? Ну, про тактику «купить, скопировать лучшее, закрыть» мы все очень хорошо знаем, но вот в случае IoT-устройств покупать пока особо некого. Тут у нас безлюдно, только компания ARM скалой возвышается над всей этой пустошью. Так что компания Google пошла по второму излюбленному пути — выстраивая платформу с последующим созданием экосистемы вокруг нее.\r\n\r\nGoogle любит замкнутые на самой себе экосистемы. Если опустить вопиющие провалы на стезе социальных сетей, то компания создает экосистемы и выстраивает вокруг них сообщества с завидной стабильностью. А что самое главное — она умеет их поддерживать и развивать. Но пока через умные холодильники и прочие IoT-девайсы нельзя показывать рекламу, то и экосистема для Google в этом направлении интересна лишь в далекой перспективе. Речь идет о платформе Google Cloud IoT для обработки, анализа и хранения данных умных девайсов. Но этого было недостаточно, потому что с устройств эти данные надо как-то снимать. Учитывая отсутствие всеобщего стандарта, сделать это не так и просто. \r\n\r\n\r\n\r\nИменно поэтому поисковой гигант пошел еще и по третьему своему самому любимому пути и анонсировал собственную SDK для разработчиков под IoT-устройства, написанную на Embedded C. Почему это был третий типичный путь для Google? Ну, если поисковой гигант не может «купить и закрыть», или быстро выстроить экосистему, подвязать ее с уже существующими сервисами и платформами компании и крутить рекламу, то он выпускает инструменты для разработчиков. И ждет. Тем более, платформа как инструмент уже есть, почему бы не выпустить SDK?\r\n\r\nПродукт, который получил название Cloud IoT Device SDK, был разработан совместно с ARM, Microchip Technology и NXP Semiconductors. Конечно же, инструмент open source. Цель Cloud IoT Device SDK — помощь в прототипировании и тестировании перед этапом коммерческого внедрения продукта. SDK поддерживает широкий спектр микроконтроллерных устройств. Из преимуществ SDK выделяют то, что разработка применима к устройствам с экстремально малым энергопотреблением и флеш-памятью от 25 кбайт. Вообще, Venturebeat пишет, что разработка получилась сочной: SDK включает совместимость с realtime-OS, такими как Zephyr, ARM Mbed OS, ядро ​​FreeRTOS (и многими другими), совместимость с POSIX-системами, присутствует асинхронный API, который позволяет работать вообще без ОС, а еще есть планировщик событий и прочее.\r\n\r\nИсходники доступны на GitHub.\r\n\r\nЧто это означает для индустрии? В первую очередь, Google озаботилась последовательной работой в этом направлении. Учитывая доминирующее положение Android и перспективы удаленного управления устройствами через смартфоны и планшеты, выпуск специализированной SDK был только вопросом времени. \r\n\r\n\r\n\r\nТо что к работе были привлечены такие производители, как ARM, только добавляет уверенности в том, что мы не получим очередной «хром», жрущий столько ресурсов, сколько ему дают, а реальный работоспособный продукт, который учитывает специфику архитектуры современных IoT. Наличие полноценной платформы и возможность «обкатки на столе» программных решений до их коммерческого внедрения только повысит уровень конечных продуктов и ускорит их выход на рынок.\r\n\r\nИнформационная безопасность умных устройств\r\nСложно говорить о том, чего толком-то и не существует. Как бы ни распинались отдельные персонажи, что IoT-Security реально, мы-то с вами понимаем, что сами по себе IoT-девайсы абсолютно беззащитны и на 100% зависят от сети, к которой подключены. Собственно, из-за наплевательского отношения к security на местах мы и наблюдали стотысячные ботнеты из IP-камер несколько лет назад. Например, можно вспомнить ботнет Mirai.\r\n\r\nНо этот вопрос надо решать. Ранее я упоминал Alexa и Алису — две эти сударыни на полном серьезе претендуют на доступ к кредиткам своих хозяев, чтобы заказывать для них пиццу или очередную безделушку с Amazon, eBay или Яндекс.маркета. \r\n\r\n\r\nЯндекс.станция\r\n\r\nНа стезе борьбы за безопасность опять отметилась компания ARM. \r\n\r\nПроект Platform Security Architecture Certified — это, по своей сути, программа сертификации для IoT-устройств. Способов применения у PSA два: это многоуровневые схемы обеспечения безопасности и наборы тестов API для разработчиков. Для создания PSA компания ARM привлекла несколько независимых исследовательских лабораторий в области информационной безопасности. \r\n\r\nВырос проект просто из набора документации по теме безопасности IoT-девайсов, в которой содержались рекомендации к разработке. Однако теперь в проекте информации намного больше, например, добавились модели кибератак, документация по анализу безопасности, серцификации по архитектуре аппаратной и программной части устройств и другое. \r\n\r\nЕще один заметный проект в области безопасности IoT имеет отечественные корни, занимается им «Лаборатория Касперского». Эта компания пошла по наиболее очевидному для себя пути и обратила внимание на упоминаемую ранее уязвимость интранетов, в которых существуют IoT-устройства. Наиболее эффективный способ защиты сети — оборона «шлюзов с внешним миром», чем и занялись в ЛК. Конкретно сейчас они работают над проектом IoT Gateway, который представляет из себя прошивку для роутеров и маршрутизаторов. Весь проект базируется на KasperskyOS и, по всей видимости, является его подмножеством.\r\n\r\n\r\nМаршрутизатор с KasperskyOS на борту \r\n\r\nСогласно проспектам ЛК в разработке принимают активное участие непосредственные производители роутеров, которые пошли на сознательное сотрудничество с компанией для повышения безопасности своих устройств еще на стадии конвейера. Как минимум, в разработке должна участвовать компания Advantech — крупный производитель оборудования, с которым ранее «Лаборатория» сотрудничала в рамках проекта KICS for Networks по обеспечению информационной безопасности на производстве. \r\n\r\nВместо вывода\r\nПри всем внимании технологических гигантов и прочих компаний к IoT-сегменту наибольшую активность проявляет именно компания ARM — производитель микрочипов, на которых и работают все эти камеры, датчики и прочие энергоэффективные устройства. Сейчас доминирование ARM и желание компании сделать рынок шире играет всем на руку: она охотно сотрудничает с Google, нанимает частные лаборатории под специфические проекты и всячески пытается восстановить доверие широкой публики, которое было изрядно подорвано той же историей с Mirai и другими ботнетами. \r\n\r\nОднако ARM — это не весь IoT. На рынке все еще хватает средних и откровенно неизвестных производителей электроники, которые плевать хотели на SDK от Google, инструменты тестирования и проверки безопасности и прочее и прочее. Серьезную работу делает «Лаборатория Касперского», и, я уверен, не только они движутся в направлении повышения защищенности роутеров и маршутизаторов. Но в наработках ЛК есть одна большая проблема — ее направленность, в первую очередь, на промышленный сегмент, о чем свидетельствуют прочие проекты компании в этом направлении и совместное прошлое с Advantech. Кроме того, подобные коммерческие продукты подразумевают поставку в пакете с остальным ПО компании, которое не всем и нужно.\r\n\r\nСколько мы шли к Micro-USB Type-B как стандарту зарядного разъема? Но не прошло и пары лет тишины и спокойствия, как пришел USB Type-C, а Lightining вообще никуда не исчезал. В плане безопасности и разработки IoT-устройств необходим компромисс, сопоставимый как раз с выбором «стандартного USB». Вот только добиться этого будет почти невозможно, потому что сейчас IoT развивается такими темпами, что любые стандарты устаревают за год-два. Есть надежда, что ARM и Google удастся консолидировать разработчиков вокруг себя и добиться некоего стандарта в разработке и ИБ, но тогда потребитель столкнется с очередной монополией, от которых уже тошно. \r\n\r\nВпрочем, в любом случае, какое-то движение лучше застоя. Потому что IoT — это развитие для множества смежных с ним областей знания, пример, в области распознавания речи, ИИ и прочее. А за этими технологиями будущее.	https://habr.com/ru/company/itsumma/blog/442070/	8363484a-393a-4b59-ba9d-f6f85d884f47
19316678-4078-4a71-8d54-c6d441504d10	Linux Foundation анонсировала open source платформу ELISA для разработки автоматизированных систем	Linux; промышленность; беспилотный транспорт; робототехника	На прошлой неделе, 21 февраля, сообщество Linux Foundation анонсировало старт работ над платформой Enabling Linux in Safety Application (ELISA), цель которой — стандартизировать разработку и повысить надежность автоматизированных систем во всех основных промышленных областях. В их число, в том числе, входит медицина, энергетика и автомобилестроение. \r\n\r\n\r\n\r\nТакже цель платформы — повысить скорость вывода новых продуктов на рынок и параллельно снизить количество критических ошибок и рисков при проектировании систем, которые могут повлечь проблемы в эксплуатации, техногенные аварии и человеческие жертвы. В разработку будут вовлечены британский производитель чипов ARM Holdings, BMW Car IT GmbH, Toyota и немецкая компания KUKA Robotics, сообщается в официальном пресс-релизе.\r\n\r\nПлатформа ELISA является наследником более раннего проекта Linux Foundation — Automotive Grade Linux (AGL) 5.0 — совместного с Toyota open source проекта по разработке программного обеспечения и систем автопилота для транспорта. Также в основу платформы легли наработки по проекту SIL2LinuxMP (урезанное окружение GNU/Linux для RTOS) и Real-Time Linux (PREEMPT_RT).\r\n\r\nОсновная идея ELISA — сделать выпуск новых систем проще, быстрее и при этом надежнее. Современная парадигма проприетарного программного обеспечения на транспорте и в промышленности чрезвычайно замедляет разработку и оставляет шанс для попадания в релизные версии фатальных для пользователей ошибок и багов. Новыми «красками» подобные перспективы начинают играть, когда речь заходит о системах автономного управления транспортом, над которыми сейчас активно работают все ведущие автоконцерны планеты (в первую очередь Volvo, BMW, Toyota). Разработка и развитие ELISA — логичный шаг для промышленности, так как именно в ней unix-системы занимают доминирующее положение. Согласитесь, никто в здравом уме не будет писать софт для роботов под управлением OS Windows. \r\n\r\nВсе основные [промышленные] отрасли, включая энергетику, медицину и автомобилестроение, хотят использовать Linux для приложений, в которых крайне важна безопасность, поскольку это позволяет быстрее выводить продукты на рынок и снижать риск критических ошибок при проектировании. Проблема заключалась в отсутствии четкой документации и инструментов, необходимых для демонстрации того, что система на основе Linux отвечает необходимым требованиям безопасности и сертификации. В прошлых попытках решить эту проблему не хватало критической массы, необходимой для разработки широко обсуждаемой и общепринятой методологии, но с формированием ELISA мы сможем использовать инфраструктуру и поддержку членов сообщества Linux Foundation. \r\n\r\n— Кейт Стюарт, старший директор по стратегическим программам в Linux Foundation.\r\nКроме этого, в пресс-релизе указали побочные цели проекта ELISA:\r\n\r\n\r\nРазработать справочную документацию и варианты использования.\r\nОбучение сообщества разработчиков ПО с открытым исходным кодом передовым методам Разработка техники безопасности и ознакомление сообщества специалистов по информационной безопасности с концепциями открытого ПО.\r\nОбеспечение постоянной обратной связи с сообществом open source разработчиков для улучшения процессов и автоматизации оценки качества.\r\nПоддержка участников open source в мониторинге инцидентов и критических угроз, относящихся к их системам, разработка сценариев реагирования.\r\n\r\nОснователи проекта и заинтересованные стороны надеются, что ELISA привнесет в промышленную разработку общий для всех участников этого рынка стандарт безопасности автоматизированных систем, что значительно упростит работу и снизит нагрузку на профильные подразделения. \r\n\r\nЕще один важный аргумент в пользу ELISA — это единые принципы сертификации ПО для, например, роботов или автопилотов. Фактически, сейчас производители и промышленники совместно с Linux Foundation создают платформу и стандарты, с которыми потом можно идти к правительствам различных государств. Open source обеспечивает прозрачность и всестороннюю экспертизу, а сама платформа — возможность привести к общему знаменателю многочисленные споры о том, как должны выглядеть автоматизированные системы в контексте безопасности. Именно угроза жизни и здоровью пользователей сейчас является основным препятствием для более активного внедрения автоматизированных систем, особенно, если речь идет о дорогах общего пользования для роботизированного транспорта. \r\n\r\n\r\nVolvo Truck\r\n\r\nНапример, компания Volvo минимум с начала этого десятилетия работает над системой автопилота пятого уровня (полная автономность) для большегрузного транспорта, а недавно представила концепт полностью беспилотного тягача без кабины. Однако законодательные препятствия, опасения правительств и прочие трудности все еще сдерживают потенциал этой разработки. Косвенно на создание ELISA, интерес в которой со стороны автоконцернов прослеживается более, чем явно, основателей проекта подтолкнула и постоянная шумиха вокруг продукции Tesla Motors. Но в отличии от компании Маска, такие организации как BMW и Toyota могут позволить себе более «размеренный» цикл разработки с подготовкой сертификационного стандарта в виде полноценной платформы. \r\n\r\nПо мнению основателей платформы и заинтересованных игроков рынка, ELISA не только поможет Linux занять еще более уверенные позиции в промышленности, но и значительно облегчит разработку и создание программного обеспечения для автоматизированных промышленных систем.	https://habr.com/ru/company/itsumma/blog/441636/	8363484a-393a-4b59-ba9d-f6f85d884f47
9d195caf-3981-4054-a902-b5967389d86d	Google держит вас в персональном «поисковом пузыре» даже если выйти из аккаунта	Crossover; поиск; поисковая выдача; Crossover News; Google; DuckDuckGo; альтернативный поиск; новость	Все мы давно знаем, что Google, Яндекс и другие коммерческие поисковые системы анализируют историю посещений и поисковую историю пользователя, на основе которых хитрые алгоритмы пытаются предсказать, что «пригодится» человеку в следующий раз. Когда эта технология только зарождалась, она казалась логичной и понятной, но сейчас этот подход выглядит крайне и крайне пугающе. Потому что раньше представители Google, самой популярной поисковой системы в мире, утверждали, что достаточно выйти из аккаунта, чтобы избавиться от «предвзятости» поисковой выдачи и получить нейтральные результаты при использовании сервиса.\r\n\r\nПарни из DuckDuckGo в своем исследовании утверждают, что даже при выходе из аккаунта и переходе в анонимный режим, Google продолжает подстраивать поисковую выдачу согласно ранее собранной о пользователе информации. То есть компания не оставляет человеку выбора и все равно манипулирует поиском, даже если действия пользователя явно говорят о том, что он хочет получить «нейтральный» результат.\r\n\r\nДаже если учесть то, что DuckDuckGo — тоже поисковик и может быть крайне предвзят к Google и ее алгоритмам, результаты исследования заставляют задуматься. Для того, чтобы проверить работу поиска от Google, команда DuckDuckGo собрала группу из 87 добровольцев и получила выборку из 76 результатов поиска. Эти люди сначала вводили заранее оговоренные и общие для всех запросы в анонимном режиме, который по идее должен обеспечивать выборку, свободную от влияния внешних факторов типа истории поиска, а после — из под своих учетных записей. Поиск производился всеми добровольцами одновременно (эксперимент проводился 24 июня 2018 года в 21:00), сначала в приватном режиме без логина, а после — из под своих учетных записей. В исследовании принимали участие только жители США, чтобы избежать влияния фильтров по «государству». \r\n\r\nПри таких условиях ожидалось, что все пользователи +\\- получат схожую поисковую выдачу, так как запросы производились примерно в одно и тоже время, из одной страны и в определенном порядке. Однако большинство добровольцев получило уникальную поисковую выдачу в приватном режиме + персональные рекламные ссылки (первые 3-4 результата). Конкретнее по цифрам на три используемых запроса:\r\n\r\n\r\n«Gun Control»: 62 ссылки, 52 из 76 участников (68%) получили уникальные результаты.\r\n«immigration»: 57 ссылок, 43 из 76 участников (57%) получили уникальные результаты.\r\n«vaccinations»: 73 ссылки, 70 из 76 участников (92%) получили уникальные результаты.\r\n\r\nПо логике вещей, если такая вариативность поисковой выдачи имеет место быть в «анонимном» режиме без логина, то уникальность поиска при входе в аккаунт должна просто зашкаливать. Однако в случае обычного поиска (с влиянием истории запросов) картина по уникальности выдачи почти не сдвинулась с места:\r\n\r\n«Gun Control»: 58 ссылок, 45 из 76 участников (59%) получили уникальные результаты.\r\n«immigration»: 59 ссылок, 48 из 76 участников (63%) получили уникальные результаты.\r\n«vaccinations»: 73 ссылки, 70 из 76 участников (92%) получили уникальные результаты.\r\n\r\nЧто это значит? Это значит, что заявления Google о том, что компания решила проблему с предвзятостью выдачи еще осенью этого года — не соответствуют действительности. \r\n\r\nПри этом команда DuckDuckGo проанализировала еще и «новостную» выдачу в инфобоксе. Некоторые источники видели все участники экасперимента, но «почему-то» периодически Google подсовывала некоторым людям индивидуальные ссылки, которые видели только они. Несколько человек вообще не видели инфобокса, что тоже «очень странно». Подробные цифры можно посмотреть в оригинальном посте. \r\n\r\nВ идеальном мире анонимного поиска каждый пользователь, который не захотел предоставлять Google свои персональные данные, должен получать один и тот же набор наиболее релевантных ссылок на свой запрос, как и любой другой пользователь из его страны. Однако Google продолжает отслеживать своих пользователей и навязывать им «умную» выдачу для того, чтобы продавать товары и услуги рекламодателей. «Большой Брат» лучше знает, что вам нужно. \r\n\r\n\r\nТут в XLS-файле расположены инструкции, которыми руководствовались добровольцы. С полными результатами исследования можно ознакомиться в этом XLS-файле. Python-код для анализа результатов лежит в репозитории на GitHub.	https://habr.com/ru/company/crossover/blog/432296/	8363484a-393a-4b59-ba9d-f6f85d884f47
a19fdd19-324a-44f1-9602-0f3f115bb2c3	Давайте поговорим о метриках как способе оценки труда программиста	Crossover; метрики; управление проектом; управление персоналом; управление разработкой; менеджмент; как оценивается труд	Метрики — они как фломастеры, каждому по вкусу свои. Без метрик существование прибыльного бизнеса как такового невозможно, они окружают нас постоянно, это неприятная, но аксиома. Для кого-то метрика — план продаж на месяц, кому-то — выполнение заказа до оговоренного дедлайна, а другим — количество отработанных часов. \r\n\r\n\r\nПодходящей «Картинки Для Привлечения Внимания» на эту тему нет, так что держите котика\r\n\r\nПочему-то слово «метрики» в IT-сфере плотно ассоциируются с такими «превосходными» по своей тупости практиками, как подсчет написанных строчек кода или закрытых тасков. С уверенностью можно сказать, что это — самые бесполезные и беззубые в управленческом плане «инструменты» контроля. По сути же, адекватные метрики бывают, весьма условно, но все же, только двух типов: метрики для проекта и/или работ, результат и время исполнения которых ясен и прогнозируем во времени, и напротив, метрики для проекта и/или работ, результат и время исполнения которых спрогнозировать физически невозможно. Для первого типа выставляются метрики результата, а для вторых — дистанции, сиречь отработанного времени.\r\n\r\nПервый тип метрик «по результату»\r\nУниверсального рецепта для выставления метрик любому работнику нет — это всегда ситуационное явление. Метрика работника всегда формируется из одного простого ответа на следующий вопрос: можем ли мы четко предсказать конечный результат и, как следствие, время работ на малой или средней дистанции?\r\n\r\nДавайте рассмотрим ситуацию на фрилансе. Чаще всего заказчики выстраивают взаимоотношения с исполнителями по принципу оплаты за выполненный объем работы. То есть существует бюджет на проект, и под этот бюджет уже в ходе переговоров согласуется редлайн и дедлайн его сдачи. Так работают дизайнеры, верстальщики, ряд разработчиков. Чаще всего бюджет не двигается с места, то есть подвижной частью является «время выполнения». \r\n\r\nНо оно всегда плюс/минус прогнозируемо, то есть заказчик четко понимает, сколько «примерно» времени уйдет на исполнение его заказа. Отталкиваясь от этой цифры выделяется бюджет, после чего ищется подходящий по стоимости исполнитель. \r\n\r\nВообще во фриланс-среде четко проповедуется принцип «нам все равно, сколько времени вы потратите на выполнение заказа, просто сделайте хорошо и в сроки, которые для нас приемлемы». Таким образом снимается масса вопросов по контролю за работой наемного фрилансера или временного сотрудника, снимается необходимость платить ему три, четыре, десять раз «зарплату» и так далее. Есть транш предоплаты, есть закрытие итогового, заранее оговоренного счета.\r\n\r\nПодобный подход просочился и в малый и средний бизнес, где люди работают вроде бы, и на фуллтайм, но компания живет в состоянии жесткой конкуренции и коротких дистанций, когда результат нужен в конкретные сроки. Приложив «безумные усилия» можно нарисовать вот такую грубую-грубую блок-схему, которой руководствуются при принятии решения:\r\n\r\n\r\n\r\nА что насчет почасовых рейтов UpWork и прочих моделей фриланса по времени?\r\nВозможно, этот вопрос родился у тебя, читатель, еще в начале статьи, но пришли к ответу на него мы только сейчас. Точнее, к ответам, потому что их несколько. \r\n\r\nПервый: нанимающая компания привыкла к контролю, потому что почасовая ставка в 50% случаев подразумевает трекер, а в 100% — периодические отчеты с проведением ревизии выполненных работ. То есть заказчик перекладывает часть менеджерских функций на самого исполнителя, который отчитывается сам за себя. \r\n\r\nВторой: компании нужен контроль за ходом разработки, потому что у нее есть только одна попытка. Если проект растягивается более, чем на несколько недель, заказчику нужно понимать, «на каком свете» находится работа. Чаще всего на такие массивные заказы бюджет выделяется один раз и попытка есть только одна. На самом деле на рынке когда-то были и компании, которые не требовали такой периодичной и временами жесткой отчетности от исполнителей на крупных проектах, но с ними случилось тоже самое, что и со слонами с маленькими ушами — они вымерли (слоны от перегрева, а компании — из-за сорванных сроков).\r\n\r\nВторой тип метрик «по времени»\r\nНо все становится намного, намного сложнее, если мы начинаем говорить о крупном проекте, сроки сдачи которого колеблются в диапазоне «от года до трех» и до «это вечная разработка».В случае «вечной разработки» спрогнозировать время получения конечного результата практически невозможно по следующим причинам:\r\n\r\n\r\nнад проектом работает не то что один человек, а даже несколько команд;\r\nкаждая команда «по направлениям» насчитывает от двух-трех, до нескольких десятков сотрудников;\r\nкогда закончится работа над проектом никто не знает.\r\n\r\nВ подобных условиях легко затеряться и околачивать известным предметом известные груши. Но так как бизнес благотворительностью не занимается, приходится переходить от метрик «по результату» к более сложной категории метрик «по времени».\r\n\r\nСамый простой и логичный пример работы «по времени» — это обычный офисный фулл-тайм в компаниях от 30-50 человек в отделе разработки. В этих условиях бизнес «на берегу» договаривается с потенциальным работником, то есть еще на этапе собеседования, не о моменте сдачи проекта, а о стоимости часа работы исходя из 40-часовой рабочей недели согласно ТК. Для нас это выглядит просто как размер заработной платы.\r\n\r\nПри этом надо четко понимать, что бизнес — не дураки. В размер ЗП (точнее в ее сокращение) закладываются личностные кризисы, шатания по офису, перекуры, лишние 20-30 минут на обед (то есть полтора часа, вместо часа) и просто прокрастинация на YouTube. Какие-то компании могут позволить себе эти издержки, так как из бизнес является в данный момент прибыльным и он может позволить себе «легкую» версию контроля через простое выставление краткосрочных задач с размытыми дедлайнами, которыми занимается менеджмент младшего и среднего звена. \r\n\r\nНо если бизнес низкомаржинальный или существует в конкурентной легаси-среде, то все становится еще хуже. И вот тут начинается форменный ад, за который разработчики так не любят слово «метрики».\r\n\r\nРеальная жесткая привязка к отработанному времени не является самостоятельной метрикой эффективности, тут нужны костыли\r\nЕсли человеку платят не за результат, а за количество отработанного времени, то как оценить его эффективность? Этим вопросом постоянно задается бизнес. Тут есть несколько переменных:\r\n\r\n\r\nПривязка результативности команды к метрике «результат» на короткой дистанции.\r\nИспользование более мелких метрик на уровне задач и спринтов.\r\nВыстраивание четкой структуры ответственности, сроков и приоритетов, называйте как хотите, например, «политика разработки». \r\n\r\nПо сути, бизнес сталкивается с ситуацией, когда он перешел, вроде бы, на более чем понятный механизм «покупки времени», но контроль за тем, было ли что-либо получено за оплату этого времени взамен в виде результатов труда все равно нужно. То есть наше понятие «покупки результата» становится вложенной переменной в понятие «покупка времени».\r\n\r\nЧаще всего происходит так, что менеджмент не способен четко проследить потребности бизнеса и работников одновременно, то есть выстроить систему и политику применения метрик, при которой обе стороны были бы довольны происходящим. Что имеется в виду: метрики должны одновременно выполнять интересы бизнеса и быть понятны и выполнимы работниками.\r\n\r\nТут мы сталкиваемся с другой проблемой: если при работе «на заказ» на коротких дистанциях задача, чаще всего, ясна и понятна всем сторонам, то при разработке крупного продукта вся структура находится в постоянном движении. Банально: конкуренты выпустили новый продукт или появился новый инструментарий и все планы, которые были любовно созданы менеджментом, пошли прахом. \r\n\r\nВ этот момент очень много зависит от менеджмента. Тут можно просто описать неадекватный и адекватный подходы к выставлению метрик. \r\n\r\nНеадекватные метрики:\r\n\r\n\r\nколичество строк кода и коммитов;\r\nколичество закрытых тасков без учета сложности;\r\nлишение разработчика права голоса;\r\nигнорирование динамики и потребностей разработки в отчетный период (выполнение метрик превыше здравого смысла);\r\nдлительный процесс пересмотра метрик, отсутствие гибкости, игнорирование мнения разработки.\r\n\r\nВот тут я описал типичную «галеру», когда разработчик превращается из человека в «машину по написанию кода» и всем плевать, как он справляется с краткосрочными задачами/метриками, которые ему спускаются сверху. В этом случае девелопер теряет любую возможность повлиять на разработку, даже если он видит «изнутри» проблемы. При этом сложность задач не учитывается и все сводится к monkey-job. \r\n\r\nАдекватные метрики:\r\n\r\n\r\nУчет сложности задачи;\r\nВозможность пересмотра метрики постфактум при возникновении проблем;\r\nВозможность комментирования задачи;\r\nОтсутствие жесткой привязки к количественным показателям строк кода/количества тасков;\r\nИгнорирование частичного несоблюдения метрик, если в этом была необходимость.\r\n\r\nАдекватные метрики — это те метрики, которые не прибиты гвоздями к полу и которые можно двигать. Если бизнес стремится к максимальной эффективности, то эта эффективность должна быть на всех уровнях. Уже давно понятно, что количество тасков или строк кода, по факту, значат не очень много, так как некоторые задачи могут иметь решающее влияние на продукт и стоят сотни других. \r\n\r\nКроме того, жесткая привязка к соблюдению метрик контр-продуктивна: если девелопер знает, что у него начнутся «проблемы» из-за того, что он закрыл 19 тасков за неделю вместо 20, то качество выполнения задачи уходит на задний план. И минимум последний, 20 таск, будет сделан на «отвали», с костылями и велосипедами вместо того, чтобы по-настоящему раз и навсегда решить поставленную задачу.\r\n\r\nОбратная связь как неотъемлемая часть модели «покупки времени»\r\nФактически, качественно построенная модель разработки, привязанная ко времени работы, намного сложнее, чем может показаться на первый взгляд. Для эффективной работы по этой модели должна быть организована качественная обратная связь между исполнителями и руководителями, которые должны постоянно корректировать «политику партии» на всех уровнях. Ведь неадекватно поставленная задача, то есть сформулированная метрика — это проблема далеко не разработчиков, хотя эту проблему у нас принято спихивать именно на исполнителей. Неадекватно сформулированная метрика — это проблема, как раз менеджмента, который эту задачу поставил перед исполнителями при условии прозрачности работы обоих сторон. \r\n\r\nИменно менеджмент должен организовывать работу так, чтобы время работы расходовалось эффективно, то есть бюджеты не «сжигались», но при этом и разработчики могли бы справиться с поставленными перед ними задачами без тотального выгорания через несколько недель. Потому что людской ресурс хоть и обширен, но не бесконечен, особенно, если речь идет о квалифицированных кадрах. \r\n\r\nИменно наличием обратной связи и ответственностью за принятые решения со стороны менеджмента отличается от компания, которая ведет детальный учет отработанного времени, от явной «галеры», где разработчики попадают в бессмысленную мясорубку. \r\n\r\nИменно обратная связь позволяет бизнесу найти «узкие места» в разработке. Как часто вы сталкивались с ситуацией, когда сотрудники какого-либо отдела задыхались, работая на износ, но так и не получали «подкрепления» в виде пары новых специалистов, которые бы подставили плечо и забрали на себя часть нагрузки? Такие ситуации возникают сплошь и рядом именно из-за отсутствия качественной обратной связи между разработкой и менеджментом. Вместо четкого отслеживания эффективности команды и ее нагрузки, менеджер ковыряется в носу пальцем, а когда кто-то «ломается», не выдерживая такого ритма, все спихивает на оставшихся девелоперов. Не надо так.\r\n\r\nВместо вывода\r\nСамое худшее, что может случиться в процессе организации рабочего процесса — «передергивание» механизмов, присущих одной модели в другую. Например, когда для долгосрочных проектов выставляются жесткие дедлайны без здравой оценки сложности и возможностей команды. Или когда на краткосрочные самодостаточные проекты и задачи надстраиваются такие формы контроля, которые впору применять в области ракетостроения, а речь идет всего-то о заказе на фрилансе. \r\n\r\nЧеткое понимание уместности тех или иных методов работы в различных по структуре и размеру компаниях поможет уберечь огромный кусок здоровья и нервной системы при поиске работы. И чем больше разработчиков, менеджеров и владельцев бизнеса будут понимать эти механизмы — тем лучше будет для всех участников IT-сегмента.	https://habr.com/ru/company/crossover/blog/432138/	8363484a-393a-4b59-ba9d-f6f85d884f47
743db4c2-de3f-4e4c-928c-9bf79d3dfb2d	Хватит кормить издателей. ЕС разрабатывает правила обязательного бесплатного доступа к научным работам	Crossover; наука; научные публикации; научные статьи; открытые данные; прогресс; paywall; sci-hub	Ежегодный объем рынка платного доступа к научным публикациям оценивается в 25 млрд долларов\r\n\r\nПолитика современных научных изданий по закрытию доступа к научным публикациям пейволлом давно является причиной споров в обществе. С одной стороны утверждается, что ограничение доступа к научному знанию — непозволительно в условиях всеобщей свободной циркуляции информации. С другой стороны говорится, что институт публикации, вычитки и рецензирования научных работ профессиональными издателями необходим для того, чтобы отсеивать нерелевантные, подтасованные и просто ненастоящие исследования от реальных научных работ. Доходит до абсурда: частные научные издания получают прибыль от публикации исследований, которые проводятся за деньги налогоплательщиков. \r\n\r\nФактически, сейчас наука (в виде публикаций работ) находится под «сапогом» у издателей профильных журналов, которые являются единственными получателями выгоды в сложившейся ситуации. Проблема закрытых научных публикаций стала настолько острой, что на это обратили внимание даже государственные органы, конкретно — Европейский центр политических стратегий при комиссии Евросоюза. Против сокрытия научных работ от широкой общественности высказывался целый ряд ученых на протяжении последних десятилетий.\r\n\r\nЕврокомиссар Карлос Моидас, представители научного сообщества ЕС и организации Science Europe выработали «Plan S». Суть его крайне проста: все научные исследования, которые будут финансироваться из государственных бюджетов стран ЕС или фондов Евросоюза, должны быть общедоступными уже с 1 января 2020 года. \r\n\r\nЕсли вы попробуете найти самый высокомаржинальный бизнес, которым стоит заняться, то путь вам — в научные издатели по модели paywall. «Подъем» на этом виде деятельности по сравнению с затратами составляет до 40%, то есть выгоднее только торговать людьми или запрещенными веществами (и то не факт, что вы достигнете таких прибылей).\r\n\r\nПри этом «Plan S» — не первая попытка научного сообщества избавиться от кабалы пейволла. Еще в 2003 году была подписана Берлинская декларация, согласно которой в связи с наступлением цифровой эры существующие каналы доставки и распространения научного знания являются неактуальными. Подписанты декларации выступали за свободное бесплатное получение, копирование, создание малых тиражей для точечного использования научных работ и публикаций при условии соблюдения основного авторского права. Фактически, Берлинская декларация пыталась распространить термин «Fair Use» на научные работы. Кроме этого, подписанты Берлинской декларации стремились стимулировать коллег на открытое распространение результатов своих исследований при условии получения правительственных и прочих грантов, поощрять распространителей подобной информации и всячески поддерживать парадигму свободного обмена знанием в цифровом виде (то есть если это не «кровавое легаси»-исследование корпорации, то поделитесь с миром). \r\n\r\nК сожалению, с 2003 года практически ничего не изменилось и современные ученые и студенты максимум имеют доступ к ограниченным пре-принтам публикаций, а бесплатные научные издания не всегда получают на публикацию наиболее интересные и важные работы.\r\n\r\nПроблема рецензирования и противодействие Open Access Science и Plan S\r\nТе, кто знаком с проблемой «платной науки» уж точно слышали аргумент о том, что качественное рецензирование и издательство обходится недешево. Именно поэтому пейволл на научных статьях необходим — он является «знаком качества». \r\n\r\nНа самом деле бесплатного рецензирования в науке сейчас нет. В любом случае рецензенты в составе редакции журнала чаще всего получают гонорар за свою работу — это логично. Рецензенты, фактически, не получают реальных гонораров за свою работу, хотя этот вопрос активно обсуждается в научных кругах не первый год (1, 2). При этом журналы все же формируют строку расходов «peer review cost», в которую скромно записывают внутриредакционные расходы: вычитку текста, верстку, корректуру и рапортуют, что это составляет до 50% стоимости публикации статьи (средний прайс платных журналов на размещение составляет 3000-5000$ против ~600-1000$ в бесплатных). Вопрос в том, сколько в этой цепочке составляет «интерес» издателя. Сейчас бесплатные для читателей издания изыскивают средства на свое существование и оплату работы редакции двумя путями: прямые дотации фондов и правительств или взимание платы с авторов статей за размещение. Последняя модель вызывает максимальное количество споров и ее критика — главный аргумент издателей с моделью пейволла для читателя. Мол, в погоне за прибылью журналы будут брать на публикацию что угодно. Вот только проблема в том, что классическим издателем увеличение числа статей к публикации намного выгоднее, чем дотируемым «бесплатным» изданиям.\r\n\r\nВ разное время различными структурами и даже СМИ проводились вбросы о том, что очередное «мусорное» исследование приняли к публикации в сотне-другой бесплатных научных журналах. Один из последних достаточно крупных «вбросов» произошел в 2013 году, когда противник OA-науки провел исследование "Кто боится рецензирования?" и опубликовал фейковую научную статью в 157 бесплатных научных журналах (еще 97 отклонили материал). \r\n\r\nТогда по этой ситуации отлично прокатились катком товарищи из Киберленинки и в этой публикации на Хабре разложили по полочками пять основных мифов «науки открытого доступа».\r\n\r\nДоступ к релевантным научным знаниям — проблема / Читатель не может получить доступ к любой статье через межбиблиотечные подписки.\r\n\r\nПроблема платного доступа к научным публикациям является нерешаемой даже на государственном уровне и постулат издателей о том, что «кому надо — купит доступ к полному тексту работы» не состоятелен. Чтобы вы понимали, полный PDF одной научной работы в том же Nature стоит 32$:\r\n\r\n\r\n\r\nИздание выступает против инициативы еврокомиссии, нагоняя страх на аудиторию в таких публикациях.\r\n\r\nО том, как научные издания зарабатывают на ученых, не привнося в науку ничего полезного, можно посмотреть в документальном фильме «Paywall: The Business of Scholarship». \r\n\r\n\r\n\r\nЧем ниже уровень спонсирования науки в стране, тем сложнее ее ученым получить доступ к последнему научному знанию. Для России эта проблема стоит особенно остро, так как отечественные ученые не могут получить бесплатный доступ даже к работам, которые велись внутри страны из-за политики основного научного издательства «МАИК Наука/Интерпериодика», которое жестко запрещает самопубликацию. \r\n\r\nЖурналы открытого доступа якобы не рецензируются.\r\nЭтот постулат активно продвигается во всех публикациях против инициатив свободного доступа к научному знанию (например, в той же статье Nature, ссылка на которую приводилась чуть выше). \r\n\r\nИздатели в один голос кричат о том, что несут непомерные расходы на рецензирование работ и поставляют аудитории только качественный и проверенный контент. Проблема в том, что фейковые или подтасованные исследования с завидной регулярностью просачиваются и в рецензируемые платные издания, о чем предпочитают умалчивать. При этом журналы, которые существуют при прямой поддержке некоммерческих организаций и правительств успешно справляются с рецензированием статей. \r\n\r\nС другой стороны, этот аргумент издательств о «качественном контенте» выглядит все более и более вяло, если посмотреть на нашу родную область — Computer Science. Постулаты Open Source, сообщество Linux Foundation, репозитории с исходными кодами на GitHub и возможность их анализа и обсуждения широким кругом специалистов делают программное обеспечение только лучше. Отрицать это смысла нет, потому что даже крупные корпорации активно присоединяются к Open Source-сообществу, например, Microsoft и Facebook. Так почему эти принципы не могут работать в остальном научном мире? Ведь Microsoft не теряют права на свои разработки, публикуя их на GitHub, а делятся наработками с остальным миром. \r\n\r\nНекоторые ученые выступают против Plan S\r\nНаравне с инициативой еврокомиссии в сети появилось открытое письмо от ученых (полный текст), которые считают подобный метод регулирования опасным для европейской науки. На момент написания статьи под ним подписалось более 1400 человек. \r\n\r\nСуть проста: ученые беспокоятся, что новые ограничения в рамках Plan S (если в составе бюджета исследования были правительственные гранты или деньги ЕС, то результаты должны публиковаться в бесплатных для читателей журналах) сократят для многих областей науки выбор площадок для публикации на 80-90%. То есть, текущая система публикации научных работ настолько плотно завязла в модели Paywall, что альтернативных бесплатных журналов просто нет.\r\n\r\nСпоры возникают и вокруг ситуации, когда под директивы Plan S будет подпадать лишь часть команды исследователей. Нужно ли тогда будет соблюдать положения директивы еврокомиссии, или ученые смогут разместить результаты своего исследования в более именитом, но платном для читателя издании? \r\n\r\nВопрос престижа в научной среде стоит чуть ли не острее, чем в шоу-бизнесе, как и личные амбиции многих ученых. Для значительной части из них важнее получить профессиональное признание именитых коллег, чем обеспечить широкий доступ к своей работе. Противники Plan S приводят данные, что в коалицию по бесплатному распространению работ входит всего 11 фондов, поддерживающих бесплатные журналы, а это всего от 3 до 4,1% мирового рынка публикуемых научных работ. То есть силы еврокомиссии и классических научных издателей в плане инфраструктуры категорически неравны. У Plan S есть только одно преимущество — поддержка государственных регуляторов, оспорить решение которых будет практически невозможно, если директива вступит в силу (вспоминаем GDPR). \r\n\r\nТакже команда Plan S ведет активные переговоры со структурами за пределами Евросоюза, в первую очередь — с коллегами из США. Но по мнению научного сообщества переговоров и намерений недостаточно — ученые требуют гарантий того, что их труды не канут в Лету с вступлением в силу Plan S. \r\n\r\nБлокировка Sci-Hub и противодействие научному «пиратству» со стороны издателей в России и мире\r\n\r\n\r\nИздатели добились своего: доверие к свободным журналам на текущий момент серьезно подорвано и ученых заставляют выбирать между «охватом и престижем». Чаще выбирается последнее, что в итоге больно бьет по всему научному сообществу.\r\n\r\nКроме этого издатели очень тонко манипулируют понятием «авторского права» «смежного права» и в судах добиваются блокировок интернет-библиотек, в которых публикуются научные работы, изначально закрытые пейволлом. Фактически, сейчас мы наблюдаем систематическую подмену понятий прав дистрибьютора и прав непосредственного автора. \r\n\r\nРеальным владельцем авторских прав на результаты научной работы являются либо сами ученые (группы ученых), либо учебные заведения, которые проспонсировали проведение исследований. Ни о каком отчуждении реальных прав на научную работу не может быть и речи, потому что журналы получают, фактически, только право на публикацию и продажу доступа к работе другим ученым и институтам. Нарушение реальных авторских прав на работу возможно только в двух случаях: при плагиате в ходе другого исследования, как было, например, в истории с Перельманом и китайскими математиками, либо же незаконное присвоение результатов исследования и использование их в коммерческих целях без согласия авторов. \r\n\r\nВ обоих случаях издатель ни коим боком не может быть причастен к нарушению «авторского права», о котором журналы так любят говорить. Действия таких библиотек, как Sci-Hub, Киберленинка и других ресурсов просто вредят издательскому бизнесу и снижают маржу владельцев журнала. В случае существования глобального института бесплатного доступа к научным результатам не пострадают даже рецензенты, просто стоимость их работы будет закладываться в выделяемые гранты/гаситься некоммерческими организациями, которые поддерживают развитие мировой науки. \r\n\r\nОднако это не мешает судам по всему миру выносить откровенно вредные для всего человечества приговоры и обязывать регуляторов и даже центры сертификации блокировать работу пиратских научных библиотек. Так, на прошлой неделе суд обязал Роскомнадзор заблокировать Sci-Hub и ряд его зеркал из-за публикации трех статей, а ранее объединение научных издателей American Chemical Society (ACS) выиграло у Sci-Hub суд на 4,8$ млн — во столько оценили ущерб от деятельности библиотеки. Кроме этого, американский суд обязал Comodo отозвать сертификаты Sci-Hub.\r\n\r\nВозможно, новой инициативе еврокомиссии удастся переломить эту ситуацию и все желающие смогут получить доступ к научным работам европейцев, которые были оплачены из налогов.	https://habr.com/ru/company/crossover/blog/431110/	8363484a-393a-4b59-ba9d-f6f85d884f47
edc29846-fb61-4801-8f60-b86d78d2ffaa	Как понять, что вам не рады или обсуждаем приемы выдавливания работников из компании	crossover; менеджмент; управление; карьера в IT; грязные приемы; давление	Разработчик — в среднем человек увлеченный, спорить с этим смысла мало. Объективно, из-за того, что обучение программированию с самой юности отнимает много времени и сил, многие разработчики становятся чуть-чуть похожими на медведей. И сейчас объясню почему.\r\n\r\nМедведь — вообще уникальное животное. Одна только система зимней спячки вызывает уважение. Добавить к этому размеры, всеядность и ареал обитания и мы получаем высшего хищника, у которого нет естественных врагов. Любой зоолог скажет вам, что медведь — зверь-одиночка. И как раз в образе жизни в качестве одиночек и кроется основная проблема взаимодействия с медведем: у него практически нет мимической сигнальной системы. Вред медведю в природе может причинить только другой медведь, но они просто расходятся в разные стороны предпочитая тактическое отступление кровавой схватке. То есть уровень эмоциональности этого зверя можно сравнить с эмоциональностью Чака Норриса, посмотрите сами: \r\n\r\n\r\n\r\nСреди разработчиков много вот таких-вот прямолинейных «медведей». Проблема в том, что с такой прямолинейностью «медведь» теряет любые шансы распознавать намеки и полутона, во всяком случае без обширного печального опыта за плечами. Так что в этой публикации мы расскажем про несколько основных «методов», которыми пользуются нехорошие люди для того, чтобы выдавить неугодного им сотрудника из компании.\r\n\r\nМетрики. Много и разные\r\nПервый способ оказать давление на человека — пересмотреть метрики его эффективности в сторону усложнения и увеличения их числа. Как говорится в одной присказке: «Не важно, как голосуют. Главное — как считают». По факту, работы может и на стать больше, просто она будет по-другому считаться. Чем больше метрик и чем они запутаннее — тем больше шансов, что специалист где-то ошибется и неправильно поймет требования руководства.\r\n\r\nЭти ошибки развязывают противнику девелопера руки и он начинает оказывать на него давление. Оно может быть любого характера: от публичных выволочек на утренних митингах/кофе-брейках до депремирования. Суть усложнения метрик одна: вывести человека из состояния профессионального равновесия. \r\n\r\nПри этом тылы надежно прикрыты. Недоброжелатель может подготовить обширную базу в виде прописанного workflow, вести утомительную переписку по почте и привлекать другие приемы «грязного канцелярита и крючкотворства» для того, чтобы усложнить человеку жизнь. Чаще всего жертвами подобных махинаций становятся люди, которые пользуются авторитетом у коллектива, но при этом могут, в перспективе, претендовать на руководящую должность. Фактически, это устранение конкурентов в стиле разборок 90-х. \r\n\r\nКак бороться с этим? В первую очередь абсолютно все метрики не могут быть однозначными. Если менеджер говорит, что на взаимодействие по почте должно отводиться 10% рабочего времени, а вы потратили 12% или 15%, так как вам нужно было контактировать, например, с фронтэндом, это не может стать причиной для разбирательства. Кроме этого, за все выставленные метрики должен отвечать непосредственный руководитель. В Crossover при жестком несовпадении метрик, выставленных руководством, с результатами разработчиков одинаково спрашивают и с менеджмента. Если работа была выполнена и рабочий процесс идет в нужном направлении, то, следовательно, ошибку допустил менеджер, который выставил нереалистичные или неверные метрики. \r\n\r\nК сожалению, в большинстве компаний принцип двухсторонней ответственности за выполнение метрик не соблюдается и у разработчика нет возможности запустить процесс оценки их адекватности, что развязывает руки менеджменту и позволяет ему заниматься подобным «рукоприкладством». Чаще всего неадекватные метрики носят локальный характер; если вы столкнулись со спуском «невыполнимого» с самого верха, то это уже глобальные структурные проблемы, о которых мы говорили в тексте про «эффективных» менеджеров. \r\n\r\nВведение коллективной ответственности для наказаний\r\nО тему коллективной ответственности сломано уже немало копий. Обычно этот инструмент практикуют для так называемого выстраивания доверительных отношений внутри коллектива. Светлый посыл звучит так: «помогайте друг другу, исправляйте и объясняйте ошибки своим коллегам и вы станете прекрасной командой». \r\n\r\n\r\n\r\nВ адекватном исполнении подобный подход позволяет быстро «подтягивать» новичков, исключает необходимость назначения менторов «из-под палки» и все прочие механизмы принуждения. \r\n\r\nПо факту коллективная ответственность чаще всего превращается в репрессивный инструмент для оказания давления на коллектив и отдельных его членов. Постулат о коллективном премировании за успешную работу опускается и любые трудовые подвиги команды обесцениваются с формулировкой «вы и так должны работать на 100%». С другой стороны любые ошибки неугодного руководству человека приводят к коллективным санкциям против всей команды. \r\n\r\nКак итог «виновник» санкций оказывается выдавленным из команды: кому приятно терять бонусы и премии из-за ошибок другого человека? Если в отделе нет достаточного единства, очень быстро неугодный сотрудник становится изгоем, после чего начинает уже сам менять место работы. \r\n\r\nДавление на профессиональную самооценку\r\nЕще один прием, которым могут попытаться выжить человека с его места работы, выражается в оказании давления на профессиональную самооценку сотрудника. Что может быть важнее профессиональной самооценки? У многих работников сферы IT уровень личной самооценки напрямую коррелирует с уровнем профессиональной. Достижения на профессиональном поприще дают нам силы для личностного развития и роста, показывают, что мы способны быть лучше, чем могли рассчитывать. \r\n\r\nКороче говоря, профессиональная самооценка — очень и очень чувствительная точка, на которую не стоит зря давить. Но как именно на нее воздействуют? Есть несколько простейших способов: постановка размытых задач и публичное сомнение в компетентности. Обычно эти «приемы» используются в связке. \r\n\r\nСпециалисту, которого хотят выдавить из компании, дают как можно более размытые задачи, в основном устно, чтобы не оставить следов. Если регламент компании обязывает вести переписку и ставить развернутые таски — не сомневайтесь, для понимания написанного придется воскрешать Тьюринга и всю команду, что работала с дешифровокой сообщений «Энигмы». Если разработчик не пришел за пояснениями — ну и ладно, значит он обязательно все неправильно поймет и ему можно будет устроить выволочку, хотя бы за самодеятельность и неправильный порядок принятия решений.\r\n\r\nЕсли же девелопер посчитает, что с ним играют в какие-то игры и возьмет на вооружение принцип «эффективность и качество выполненных работ напрямую зависит от четкости поставленного ТЗ» и пойдет уточнять задачу, он попадает в следующий капкан в этой цепочке.\r\n\r\n\r\n\r\nГлавное, чтобы в момент постановки вопроса «Что это за фиготень у меня в таске?» вокруг было как можно больше лояльных зрителей. Так вот, когда вопрос озвучен, глаза округляются и как можно громче задается встречный вопрос в стиле Земли Обетованной: «Ну как же такой опытный и скилловый разработчик не может разобраться с простейшим заданием для зеленого джуна?!». Ну, формулировка всклика может быть любой, смысл — публично унизить человека. \r\n\r\nПроблема девелопера в том, что он воспринимает такие вещи как «боже, почему мне приходится работать с идиотами», то есть, зачастую, как должное. По сути же он попадает в ловушку, цель которой — унизить его как профессионала в глазах коллег и нанести удар по собственной самооценке. Потому что если эти ситуации будут повторяться систематически, даже самый «крепкий» человек начнет как минимум задумываться о смене работы, а как максимум — потеряет интерес к проекту, то есть у него возникнут уже реальные, а не надуманные проблемы с производительностью. Что нашим противникам только и нужно. \r\n\r\nКак бороться с подобным террором\r\nЦель у всех манипуляций подобного рода одна — расшатать коллектив и выбить из него потенциально опасных и/или властных людей. Но случается, когда просто «лицом не понравится». Почему так поступают, мы опустим, потому что это уже вопрос для статьи по корпоративной этике и она напрямую пересекается с темой «эффективного» менеджмента. На самом деле мы упомянули лишь несколько самых ярких примеров оказания давления на разработчиков, цель которых — вынудить их уйти. На самом деле существует еще множество «грязных» приемов, начиная от сплетен на офисной кухне и заканчивая прямым саботажем работы.\r\n\r\nПервый путь защиты от подобных действий — взаимодействие в случае спорных ситуаций с руководством ступенью выше. В адекватных компаниях сотрудник всегда может обратиться к «начальнику своего начальника» напрямую. Но тут есть два больших «НО». Первое: если все это происходит с санкции вышестоящих руководителей, то избавиться от давления не выйдет. Второе: руководитель должен быть готов выступить в роли арбитра, что случается не всегда. \r\n\r\nВторой путь лежит через четкое фиксирование каждого шага и задач таск-менеджере, чтобы избежать любых формальных претензий и перетянуть конфликт в практическую плоскость, где у разработчикам есть преимущество. Это уже позиционная война — кто выдержит, а кто сломается. Проблема подобного способа противодействия в том, что тут нельзя допускать ошибок и обороняющаяся сторона находится в заведомо проигрышной позиции, так как «правила войны», то есть задачи, зачастую определяет нападающий. \r\n\r\nЕсть еще мифический третий путь, когда коллектив объединяется вокруг жертвы давления и не позволяет выжить человека с его рабочего места. В этом случае конфликт переходит в затяжную фазу противостояния и, скорее всего, приведет к смене руководства (потому что это проще дешевле, чем выгонять всю команду и набирать новую). Главное условие — эффективность в рабочем плане. \r\n\r\nНо это практически фантастический сценарий, потому что я не зря упомянул «медвежью» эмоциональную природу айтишников. Когда мы замечаем, что коллеге нужна наша помощь, он уже, чаще всего, подписал документы на увольнение «по собственному» и приглашает вас на прощальную посиделку в ближайшем баре.	https://habr.com/ru/company/crossover/blog/430398/	8363484a-393a-4b59-ba9d-f6f85d884f47
b76c52b8-7c25-42ec-8968-d3c841d088e7	Трудоголизм — болезненное состояние, о котором не принято говорить	crossover; работа; труд; ударный труд; карьера; выгорание	Тему профессионального выгорания не пинал на Хабре только ленивый. Были истории и о том, как с этим бороться, и рассказы людей, которые лично столкнулись с этой проблемой, и статьи вида «как избежать выгорания». На самом деле тема важная и нужная. Для многих разработчиков их профессия выливается не только в способ заработка, но и в личные увлечения. Люди получают реальное удовольствие от того, что они делают, а выходя вечером из офиса возвращаются домой и ковыряют собственные pet-projects. \r\n\r\nНо почему-то все либо стыдливо умалчивают, либо не обращают внимания на такую вещь, как зависимость от работы. Люди, только-только заработавшие эту болячку путают ее с мотивацией и повышением продуктивности. Но на самом деле зависимость от работы или (клинический) трудоголизм — это путь к одному из самых жестких неврозов, который не сравнится даже с профессиональным выгоранием. И вот почему.\r\n\r\n\r\n\r\nТрудоголизм принято хвалить, но это монстр\r\nЯ не просто так упомянул профессиональное выгорание. Все мы знаем его основные признаки: отвращение к работе, снижение концентрации, апатия. Короче, человек становится скучным, вялым и ему ничего не надо от жизни. К клавиатуре подходит неохотно и только от очень большой нужды. Говорить о каком-то удовлетворении от своей деятельности вовсе не приходится. И всех это очень и очень сильно пугает, потому что в IT-кругах большинству людей на самом деле нравится то, что они делают. \r\n\r\nВ противовес выгоранию приводят состояние «рабочего тонуса» — когда ты весел, свеж и продуктивен. Только что песни, аки диснеевская принцесса, не поёшь. Труд в нашем обществе тоже принято хвалить, как и стремление к нему. Не знаю, откуда это пошло, может, раньше жизнь была проще (нет) и шалупотничать можно было ежедневно (тоже нет, но мало ли), но болезненная тяга к работе возведена в нашем социуме в ранг достоинств. \r\n\r\nНо что если я скажу, что трудоголизм не такой милый пушистый зайка, каким его рисуют? Ведь правда, матери чуть ли не хвалятся перед подругами, что сыночка-корзиночка (пусть даже сыночке уже под сорок, трое детей и собака) у нее такой трудолюбивый, что она все не нарадуется, и вот-вот да и проскочит фраза «прямо трудоголик он у меня!». Если бы матери четко знали, какие «радости» сулит трудоголизм, они бы не были столь оптимистичны. \r\n\r\nТрудоголизм как он есть\r\nВообще термин «трудоголизм» появился сравнительно недавно и был введен в обиход Уэйном Уотсом в его книге «Исповедь трудоголика» 1971 г. издания. При этом считается, что трудоголизм предшествует именно вышеописанному профессиональному выгоранию, но лично я никак не могу поставить в один ряд физическую зависимость от работы с последующей апатией и отрицанием профессиональной деятельности. Скорее, трудоголизм со временем лишь усугубляется, потому что как и в случае созвучному ему алкоголизму, это — физическая зависимость.\r\n\r\nСейчас я приведу часть перечня признаков трудоголизма, которые любезно собраны в Вики, выбрав самые «жесткие» из них:\r\n\r\n\r\nПосле напряженной работы трудоголику невозможно переключиться на другую деятельность.\r\nБеспокойство о работе мешает ему во время отдыха.\r\nТрудоголик считает, что удовлетворение можно ощутить лишь в работе.\r\nТрудоголик ощущает себя энергичным, уверенным и самодостаточным только работая или думая о работе.\r\nЕсли он не работает, то чувствует неудовлетворенность и раздражение.\r\nТрудоголик органически не понимает смысла отдыха и получения радости от него.\r\nОн панически избегает состояния «ничегонеделания».\r\nДля него характерны слова: «все», «всегда», «я должен».\r\nОбычно трудоголик ставит перед собой цели, которых он не может достичь, и предъявляет к себе завышенные требования.\r\n\r\nА теперь я опишу ряд состояний типичного трудоголика, в которых он существует постоянно.\r\n\r\nТрудоголик может лениться, это вообще нормально для всех живых существ. Вот только в отличие от обычного человека, нашей жертве с каждым часом становится все хуже и хуже в физическом плане. Просто от того, что он не работает. \r\n\r\nОтдых это вообще не про трудоголиков. Нет, они отдыхают, спят, смотрят кино, но если обычные люди во время отдыха отвлекаются и копят силы, то трудоголик заряжается уровнем тревоги. Знаете, как чувство перед грозой или будто бы должно случиться что-то плохое. Избавиться от этого можно только дозой ударного труда. \r\n\r\nОтпуск для трудоголика возможен, если лишить его всякой возможности к труду. Первые 2-3 суток у него будет ломка, после чего наш нервоз уйдет «под кожу» и затаится, чтобы начать «качать» нервную систему трудоголика с удвоенной силой по возвращении домой. \r\n\r\nНе путать трудоголизм и трудолюбие\r\nМногие люди не разделяют трудоголизм и трудолюбие, считая, что оба этих явления — одно и тоже. Очень часто людям, которые просто могут быстро «собраться» приписывают черты трудоголиков. Это не так. \r\n\r\nВ первую очередь нужно осознавать, что трудоголизм — крайне болезненное и, в перспективе, опасное состояние психики человека. Трудоголизм не дает сверхсил, производительности и прочих «стахановских» плюшек, с которыми он ассоциируется. Трудоголик может быть вял, измотан, иметь проблемы с концентрацией внимания. От просто трудолюбивого человека его отличает то, что ему физически плохо без самого процесса работы.\r\n\r\nПри этом результаты труда отходят на второй план: как только трудоголик справляется с возложенной на него задачей, результат мгновенно обесценивается, он больше не важен. Важно лишь получение и выполнение следующей задачи. \r\n\r\nЕще трудоголики не умеют «работать в кредит». Неважно, сколько часов ты отработал вчера, сегодня тоже надо сделать что-то полезное. На нервоз не влияет ни сложность, ни количество поставленных задач. Они все исчезают, будто в черной дыре, а трудоголик отправляется на поиски новой «дозы». Вообще, аналогия с любым видом наркомании наиболее ярко характеризует состояние трудоголика. Та же неудовлетворенность, та же физическая зависимость, тот же поиск новой дозы. Чем дольше трудоголик бездействует по объективным или субъективным причинам, тем большее количество стресса он накапливает. И избавиться от этого состояния практически невозможно. \r\n\r\nГруппы риска и как с этим живут\r\nВ «группу риска» можно записать фрилансеров все цветов и размеров, но на самом деле от этого невроза не защищен никто. Как с ним бороться — тоже не понятно. С одной стороны трудоголизм, вроде как, и полезен. Как минимум прибылен. Кроме этого проблема трудоголиков успешно замалчивается, а бизнесом и вовсе поощряется, потому что такие люди крайне ценны и прибыльны. Сами трудоголики, как заядлые наркоманы — лечиться не хотят и не будут. \r\n\r\nЯ вообще не сталкивался с таким термином, как «борьба с трудоголизмом». Обществом этот нервоз воспринимается на уровне шуточки: «Ой, ну работает, да и ладно. Все работают!» Обычный человек просто не понимает болезненного состояния трудоголика, а по незнанию может ему еще и завидовать. \r\n\r\nЖивут с этим явлением в основном молча, иногда еще и долго. Постоянный стресс от того, что ты не работаешь или работаешь недостаточно много выматывает и сжигает внутренние ресурсы. Казалось бы, логичным исходом такого состояния должно быть выгорание, но это происходит не всегда. При этом трудоголики зачастую четко осознают собственные проблемы, но идут по пути наименьшего сопротивления: поработай и успокоишься на некоторое время. Когда живешь в состоянии «сжатой пружины» много лет подобная губительная тактика кажется наилучшим выходом. Просто поработай, закрой пару задач, а потом еще пару. Завтра будет новый день, новые задачи, потом надо пережить выходные и утро понедельника, и ты снова на коне. \r\n\r\nВот только есть вопрос: а выдержит ли нервная система такой ритм и дотянешь ли ты до старости? \r\n\r\nИ ответа на него нет, потому что трудоголизм — это, якобы, не проблема, и нечего ее обсуждать.	https://habr.com/ru/company/crossover/blog/430122/	8363484a-393a-4b59-ba9d-f6f85d884f47
5dabc2ec-60e4-440c-b0e2-f7832959d818	Почему с ростом компании разработчики, стоявшие у истоков, оказываются «за бортом»	crossover; управление проектами; разработка; карьера в IT; проблемы роста	Несколько недель назад мы подняли тему «эффективного» менеджмента, которая вызвала немало споров в комментариях. Но у любого массового корпоративного явления есть свои первопричины. В нашем случае — это рост компании. \r\n\r\nРост — это почти всегда хорошо. Как бы не относились работники к происходящему внутри компании в дальнейшем, с точки зрения бизнеса рост — индикатор успешности и правильности взятого курса. Найм новых людей, управленцев и даже «эффективных» менеджеров всегда продиктован возросшими потребностями. Без этих новых и, казалось бы, временами не очень нужных людей, бизнес не умеет расти. И вот, одним утром ведущий разработчик, наемный технический директор другой специалист-звезда просыпаются, приезжают в офис и узнают, что теперь они — не властелины своего куска работы. Теперь все изменилось и их должности, фактически, не существует.\r\n\r\n\r\n\r\nВсе это очень сильно бьет по эго и самооценке. Почему это происходит? Как с этим справиться? И надо ли справляться? Давайте разбираться вместе. \r\n\r\nКак это происходит\r\nДавайте представим, что у нас есть сферический ведущий разработчик в вакууме, который стоял у истоков и плюс-минус год назад поднимал продукт нашей быстрорастущей компании с колен. Этот разработчик писал главные фичи, проводил ревью кода, внедрял новые технологии, посещал собеседования новых сотрудников и так далее. \r\n\r\nВ какой-то момент продукт вышел из стадии закрытой альфы и успешно занял свой кусок рынка; выручка растет, клиентская база растет, вес владельца компании тоже сдвинулся с мертвой точки и уже через полгода-год будет расти быстрее, чем предыдущие две метрики вместе взятые. Казалось бы, именно сейчас настал тот момент, когда наш ведущий разработчик может подняться на созданный им трон, поудобнее устроиться и гонять холопов работать в свое удовольствие. \r\n\r\nНо его вызывают на ковер. В кабинете сидит директор компании — его непосредственный руководитель, а также владелец бизнеса, главный из HR и кто-нибудь еще по вкусу. Беседа начинается достаточно спокойно, даже непринужденно, но в какой-то момент звучит слово «реструктуризация». Или «развитие». Или «изменения». Можете выбрать любое подходящее. Слово может быть разным, но смысл всегда один и тот же: "%%USERNAME%%, ты молодец, спортсмен и комсомолец, но компания растет и твоя работа в текущем виде нам больше не нужна". \r\n\r\nВ этот момент у большинства героев подобных сцен (наших ведущих разработчиков или других SuperStar) темнеет в глазах и земля уходит из под ног. «Как это, не нужна? Я что, зря пахал по 70-100 часов в неделю, не видел семью, друзей, частично облысел и, в итоге, стал похож на носферату? Алло! Вы меня решили кинуть?»\r\n\r\nНо никто никого не кидает, у нас тут приличное общество в большинстве своем. На самом деле все достаточно просто. Все, что делал наш SuperStar на протяжении последнего года становления продукта — было важно и нужно. Очень важно и очень нужно. Большинство владельцев бизнеса и прочее руководство прекрасно осознают роль нашего разработчика в их собственном благополучии. \r\n\r\nНо есть одна проблема. Все то, что делал наш разработчик, не масштабируется.\r\n\r\nБизнес — это история про зарабатывание денег\r\nНужно сделать небольшое отступление, чтобы внести однозначность. Любой бизнес, в том числе и разработка ПО — про зарабатывание денег для основателей, а не реализацию амбиций сотрудников. \r\n\r\nНо чаще всего на старте именно амбициозность и стремление к профессиональному самоутверждению и делают вчерашние стартапы успешными компаниями. Первый этап развития и выхода на рынок любого продукта стоит на плечах наших увлеченных товарищей, которые не видят семей, работают по 10-14 часов в сутки и стремительно лысеют от перегрузок, как физических, так и моральных. \r\n\r\nБизнес охотно поддерживает таких людей в их самосожжении на рабочем месте, но только пока ему, бизнесу, это выгодно. Очень быстро компания вырастает из «детских штанишек» бесконечного спринта, нововведений и новаторства, которые привносят отцы-основатели проекта, и переходят в стадию «плато» — размеренного пиления фич, поддержки и пристального наблюдения за существующими и потенциальными конкурентами. Именно на этом этапе наши стахановцы-звезды становятся «лишними», потому что их бесконечный спринт, фичи и «давай по-новой», которое отбрасывает разработку на пару сотен часов назад больше не нужно и вредно для бизнеса, который теперь должен не удивлять, а гарантировать стабильность для клиентов и инвесторов. \r\n\r\nИменно поэтому нашу звезду или просят найти новое место работы, или успокоиться, разобрать свой «трон» из черепов, поправить нервы и смириться с тем, что теперь он будет работать в общей упряжке.\r\n\r\nДальнейшие сценарии развития событий \r\nНа самом деле подобный расклад очень сильно бьет по эго. Вчера ты был центральным, незаменимым специалистом, который вел продукт в светлое будущее, а сегодня — тебя просят снять корону, надеть бейджик, потому что у вас появилась служба безопасности, и прислушиваться к мнению инвесторов или аналитиков рынка. \r\n\r\nВремя безумных спринтов осталось позади, в офисе появляется все больше незнакомых людей, а новые разработчики иногда чертыхаются на костыли в коде или непонятные им фишки. Им-то не объяснишь, что так было надо! Вот начинаются разговоры о рефакторинге и внедрении новых, более стабильных инструментов, а разрыв между владельцем компании и нашим девелопером становится все больше и больше. \r\n\r\nМногие такого не выдерживают и уходят из проекта. Кто-то сильно обиженным, громко хлопая дверью, да так, что штукатурка осыпается с потолка, кто-то тихо, получая благодарственные «отступные» за подорванное здоровье и потерянные волосы (но не всегда). Но что делать, если продукт, в который было вложено столько сил, времени и нервов бросать не хочется?\r\n\r\nНезаменимых быть не должно\r\nПри переходе из стадии создания продукта к коммерческой долгосрочной разработке-поддержке бизнес, клиенты и инвесторы должны быть уверены в том, что структура компании стабильна, а процессы внутри нее масштабируемы. Это банальный здравый смысл: незаменимых людей быть не должно. Не должно быть в процессе разработки коммерческого продукта, которым пользуется N клиентов, человека, на котором бы держалось «все и сразу». Именно поэтому «мутация» компании начинается с реструктуризации, расставания с ранее ключевыми SuperStar-девелоперами и найма большого количества новых сотрудников. \r\n\r\nВ этот момент все зависит от конкретного человека. Если он принимает новые правила игры, видит продукт как товар, чем он и является, и готов делиться властью и ответственностью, то для него всегда найдется высокооплачиваемое «теплое» место. \r\n\r\nНо чтобы правильно «сыграть» в этой ситуации, надо понимать логику бизнеса: любая попытка и дальше «замыкать» процессы на себе и выбивать какие-то особые условия, право вето или другие рычаги давления на разработку будут восприниматься как прямой саботаж. Потому что чаще всего все эти инструменты влияния используются для достижения субъективного, а не объективного результата. \r\n\r\nРазработчики крайне подозрительно относятся к продажникам и прочим аналитикам, которые говорят, что сейчас пользуются спросом. Еще большее отторжение вызывают ситуации, когда эти самые аналитики указывают на то, что какая-либо часть столь тяжело проделанной девелоперами работы нерелевантна текущим потребностям клиента. В этот момент многие срываются, рвут на груди рубаху и начинают кричать: «Да я же столько сил положил! Не позволю!» и так далее. Именно такого поведения опасается бизнес со стороны SuperStar-девелоперов, которые поднимали проект с нуля, именно его они пытаются избежать через увольнения ключевых членов старой команды. \r\n\r\nФактически, все сводится к одной простой истине: если вы не совладелец бизнеса, то и не вам определять, как он будет развиваться. И не важно, как много времени и сил было отдано на первом этапе становления компании. Да, может быть больно, может быть обидно за то, что продукт повернул в болото корпоративного сегмента и перестал обрастать новыми фичами и фишками. Но прямая конфронтация с интересами бизнеса приведет лишь к одному — поиску новой работы. \r\n\r\nИ даже если вы в конкретном случае правы и видите, что новый курс ведет в пропасть, а не к звездам — статистика играет против вас. Потому что на одного понимающего ситуацию девелопера приходится 99 разработчиков-звезд, которые тянули одеяло на себя, не видя всей картины целиком. \r\n\r\nКак часто вы сталкивались с тем, что ведущие разработчики сопротивлялись изменениям и нововведениям, связанным с ростом компании просто потому что им это не нравилось? Именно не нравилось, а не было не правильно. К сожалению, подобные ситуации далеко не редкость. Для того, чтобы остаться на одной волне с текущими потребностями бизнеса нужно принять то, что написанный код — не ваша собственность, а часть коммерческого продукта, цель которого — зарабатывать деньги, а не радовать кого-то из разработчиков.\r\n\r\nКак остаться на «корабле»\r\nСобственно, путь остаться и работать дальше достаточно прост, но лежит в плоскости борьбы с собственными привычками. Многие описываемые нами девелоперы сталкиваются с тем, что новое руководство, владелец компании и даже коллеги начинают мыслить совершенно иными категориями. Собственно, этому учат на MBA — извлечение максимальной прибыли из продукта. Если вы не разделяете подобных взглядов, но хотите остаться на текущем месте, то во внимание следует принять следующие пункты:\r\n\r\n\r\nПродукт делается для клиентов и с оглядкой на клиентов, потому что теперь они у вас есть.\r\nПодход к разработке изменится и это нормально.\r\nМасштабирование неизбежно.\r\nНельзя пытаться замкнуть всю разработку на себе.\r\nВполне вероятно, придется занять руководящую должность, а это нравится не всем.\r\nИнтересных задач и профессиональных «вызовов» будет все меньше и к этому надо быть готовым.\r\nТеперь намного больше людей будет иметь право голоса и влияния на разработку. Таков бизнес.\r\nКонфронтация с новыми людьми и начальниками не приведет ни к чему хорошему для всех сторон. \r\n\r\nВ крупных компаниях такие девелоперы-звезды кочуют между разными отделами и проектами, где могут выложиться на полную и уходить каждый вечер из офиса с чувством выполненного долга. \r\n\r\nНо если продукт только один, то выбор не слишком велик: поддерживать то, что «натворил», переходить в управленцы или искать новый проект. Как это не печально. \r\n\r\nPost Scriptum\r\nОписанное не стоит путать с ситуациями, когда девелопера реально «выжимают» из компании менеджеры-редиски. Об этом мы, возможно, поговорим в другой раз.	https://habr.com/ru/company/crossover/blog/429878/	8363484a-393a-4b59-ba9d-f6f85d884f47
772676a5-dad2-4d80-b08d-a61d7444da52	Blizzard анонсировала выход переиздания WarCraft III в 2019 году. Открыт предзаказ	Warcraft; blizzard; игры	Вчера вечером на игровой выставке BlizzCon компания Blizzard анонсировала выход ремастера своей легендарной RTS WarCraft III. В новую версию игры под названием WarCraft III: Reforged войдут оригинальные кампании двух предыдущих версий игры — Reign of Chaos и Frozen Throne. \r\n\r\nКроме этого в игру «завезут» полностью переработанные модели персонажей, новую анимацию, фиксы кампаний, обновленный редактор карт и поддержку 4K. Еще разработчики обещают внести изменения в баланс игры, так что, вполне возможно, старые тактики и стратегии, которые нарабатывались игроками годами, работать уже не будут. Выход обновленного WarCraft III состоится в 2019 году. Стоит это счастье от 1299 до 3499 RUB по предзаказу. \r\n\r\nWarCraft III ожидаемо повторил судьбу StarCraft, о переиздании которого я сообщал полтора года назад. Blizzard активно перерабатывает свои легендарные проекты. Первым пробным камнем стал StarCraft, после нам анонсировали выпуск ваниллы World Of WarCraft (согласно информации с BlizzCon выход состоится летом 2019 года), а теперь — WarCraft III.\r\n\r\nВступительный ролик\r\n\r\nТрейлер кампании\r\n\r\nПредварительный трейлер геймплея\r\n\r\nКачественное переиздание любимых игр — это всегда приятно, но знающие люди обратили внимание на два факта: новый баланс и новый редактор карт.\r\n\r\nОбъективно, Blizzard который год пытается полноценно вступить в мир киберспорта, но ее постоянно преследуют неудачи. StarCraft из-за своей чудовищной популярности среди корейцев стал их локальной дисциплиной, не получив широкого распространения на западе, Hearthstone — ККИ по вселенной WarCraft давала надежды на доминацию в этом сегменте, но множественные невоздержанные обновления и слишком частые изменения баланса привели к упадку дисциплины. На это указывает минимум то, что большинство киберспортивных организаций отказались от «подписания» профессиональных игроков в HS. «Убийца доты» Heroes of the Storm так и не смог перебороть Dota 2 и LoL, находясь по популярности на твиче где-то рядом со StarCraft с показателем в 3-5 тысяч зрителей. \r\n\r\nНовый WarCraft III с обновленным балансом может стать «золотым билетом» Blizzard на рынок киберспорта. Эта игра была популярна по всему миру, в прошлом профессиональные игроки все еще проводят стримы по игре для самых ярых фанатов и записывают видео геймплея для YouTube. \r\n\r\n\r\n\r\nКроме этого, WarCraft проще для восприятия, нежели StarCraft, хотя бы из-за меньшего количества юнитов. Киберспортивные партии в WarCraft редко переходят в режим «глубокого лейта», то есть количество юнитов на карте заметно ограничено по сравнению с тем же StarCraft. Плюс у игры есть огромная фанатская база в лице игроков в WoW и HS. \r\n\r\nНовый же редактор карт дает надежду на возрождение культуры кастомных карт, которые так полюбились пользователям. Если опустить DotA, то можно вспомнить многочисленные TD (YOU TD, Maffa TD, Element TD, Legion TD), карты-арены (Angel Arena, Life in Arena, Footman Frenzy) и даже карты, которые задумывались изначально как шутка (Петросянщина). Все это — сюжетные приключения, созданные пользователями, масса контента, которая была похоронена под старым движком, не самым удобным редактором карт и особенностями сетевого режима. Часть этого контента сообщество попыталось возродить в кастомных картах Dota 2, но широкой популярности они не получили из-за давления со стороны «титульного» режима. Переиздание WarCraft может вернуть весь этот контент, чего минимум автор статьи очень бы хотел. \r\n\r\nНу и конечно же, мы все еще ждем WarCraft 4.\r\nТак как о покойниках либо хорошо, либо ничего, о Diablo: Immortal на мобильных устройствах, которая была анонсирована там же, на BlizzCon, почитайте сами.	https://habr.com/ru/post/428668/	8363484a-393a-4b59-ba9d-f6f85d884f47
f63e1a4e-3736-492d-8377-5a3aceb80197	Прекратите нанимать «эффективных менеджеров». Они не только бесполезны, но и вредны	Crossover; управление персоналом; управление компанией; менеджмент; эффективные менеджеры; паразиты; HR; найм персонала; хайринг	Каждая компания проходит несколько жизненных циклов от момента своего основания до собственной «крышки гроба». Конец у разных компаний разный: кто-то не выдерживает конкуренции с более молодыми и гибкими командами, продукты которых годами не вылазят из состояния ранней беты, но все же являются более успешными, другие — становятся частью более крупных корпораций. \r\n\r\n\r\n\r\nОднако в цикле жизни любой компании есть период взрывного кадрового роста с поиском путей решения этой проблемы. Все вы знаете этот этап. Вот, вчерашний локальный продукт захватывает ощутимую долю рынка, аудитория кратно увеличивается и команда сталкивается с проблемами, о которых даже не подозревала. Как-то незаметно у руководителей отделов появляются «приемные часы» и согласование совещаний через почту, заметно разрастается HR-департамент, а времена, когда весь коллектив мог заказать десяток пицц по акции и устроить пятничные посиделки в офисе остались в прошлом. Владелец компании и по совместительству ее директор набирает 15-20 кило лишнего веса, все меньше появляется в коридорах и кабинетах, и все больше времени проводит в своем кабинете куда ему носит кофе личный секретарь, либо вовсе улетает на Кипр.\r\n\r\nВот как раз в этот момент компанию начинают захватывать «эффективные менеджеры». \r\n\r\nКто такие «эффективные менеджеры» и откуда они берутся\r\nДля начала, стоит разобраться с терминологией. «Эффективный менеджер» — это такой коварный паразит, который манипулирует им же и придуманными метриками. Возникают «эффективные менеджеры» в компаниях, которые выросли рывком и не успели (либо не смогли) подготовить руководящие кадры внутри собственной структуры. Да, очень малый процент разработчиков или специалистов в смежных «дисциплинах» способны управлять людьми. На самом деле, это достаточно тяжкий труд и чем выше позиция, тем меньше кандидатов на должность внутри организации. \r\n\r\nВнедрение «эффективного менеджмента» начинается с самого верха и чуть-чуть сбоку — из HR-отдела. Когда у компании появляются деньги на семинары и повышение квалификации сотрудников, толковые разработчики табунами ломятся на митапы, конференции и профильные для себя семинары, дабы совершить обмен знаниями и мнениями с другими профессионалами, а HR, дабы не быть обделенными, отправляются на свои семинары на тему «управления персоналом», прихватывая с собой текущих руководителей компании. В этот момент компания невероятно слаба и все зависит лишь от стойкости и жадности владельцев. Если директора-владельца на семинаре сумею соблазнить идеей о том, что из его детища можно выжать в разы больше денег, он практически лично сдает ключи от организации «эффективным менеджерам», абстрагируясь от всего, что произойдет далее. \r\n\r\nВыражается это в найме нового HR-директора со стороны с внушительным портфолио и страшными словосочетаниями в резюме в разделе «опыт» и «образование», либо через найм «менеджера по оптимизации» или еще какого «специалиста» подобного профиля. \r\n\r\nВторжение началось. \r\n\r\nПервые шаги «эффективного менеджера»\r\nТак как «эффективный менеджер» — по природе своей паразит и редиска, то в первую очередь он начинает строить плацдарм для будущих активностей и последующего найма своих собратьев по цеху. Первое, что делает наш гость — пересматривает метрики по всем направлениям. \r\n\r\nВообще, метрики это забавная вещь. Контроль за разработкой, маркетингом и продажами нужен, но они должны быть обоснованы и ответственность должен нести в первую очередь тот человек, который эти самые метрики выставил. Надо понимать одну простую вещь: если после изменения метрик специалист, который раньше справлялся со своей работой, вдруг стал профнепригоден, то в первую очередь надо спросить с того, кто ему эти новые метрики выставил. Адекватность метрик — это то, что игнорируют эффективные менеджеры, которые, образно говоря, вместо привычных и понятных всем метров и килограммов начинают измерять эффективность компании и отдельных людей в квантово-запутанных попугаях. \r\n\r\nВводятся в обиход организации попугаи с одной простой целью: выдавить из компании людей, которые стояли у истоков и могут оказывать сопротивление и влияние на владельца бизнеса. Такой вот внутренний саботаж. Так как никто толком не понимает, что такое эти самые попугаи, манипулировать новыми метриками и подгонять планку под уровень «не пригоден к несению службы» достаточно просто. Если вы подозреваете в своем коллективе появление «эффективного менеджера», то проверьте одну простую вещь: несет ли он ответственность за провалы своих подчиненных. \r\n\r\nНормальный начальник — одновременно и капитан корабля, и командир батальона, то есть покидает корабль последним, а для коллектива как отец родной. При этом именно он отвечает головой за косяки своих подчиненных, стоит первый в очереди на ковер, а иногда и вовсе — один, прикрывая своей спиной команду. «Эффективный менеджер» же является идеальным стрелочником, спихивая вину за ошибки и косяки на всех вокруг себя, таким образом, будто альфа-самец укрепляя свой авторитет в глазах высшего начальства по принципу «посмотрите, какой я хороший, а все остальные — плохие и тупые». \r\n\r\nОписанные выше процессы протекают в разных организациях с разной скоростью, но итог у них всегда один: первая волна увольнений и изменения в методике найма. В терминальных стадиях это может выражаться в постулате «лучших людей можно и нужно нанять, нам некогда готовить своих». \r\n\r\nМассовое вторжение «эффективных менеджеров»\r\nПосле того, как наш паразит дискредитирует или доводит до увольнения основной костяк компании, который пользовался авторитетом и доверием, он плотно присасывается к мозгам сотрудников HR-департамента и начинает политику «повышения эффективности». \r\n\r\nОчевидно, на предыдущем этапе было выявлено, что новые попугайские метрики старой командой не выполняются. В этот момент владельцы бизнеса начинают, обычно, слегка потеть от волнения, потому что теплый Кипр стал чуть дальше желаемого. Но на помощь нервной системе владельцев приходит «эффективный менеджер» и говорит, что все это легко и просто решается, просто руководители были плохими и структура неправильная. Надо разработать workflow, выстроить жесткую вертикаль, нанять крутых специалистов и все станет шито-крыто. В этот момент в компании происходит реальный передел власти. Разработке очень повезет, если ее руководители объединятся и отвоюют относительную независимость своей части компании от «эффективного менеджмента». В таком случае нашему паразиту достанется все остальное: PR, маркетинг, продажи, HR. Намного хуже, если ресурсов на это уже не осталось и компания капитулирует целиком. \r\n\r\nВ любом случае, в организации начинается волна найма. HR-департамент, будто печатный станок, начинает массово нанимать «специалистов», чаще всего на топ-позиции с делегированием подбора себе подчиненных новоприбывшим. Это та самая активная стадия найма «эффективных менеджеров». Общая черта всех этих людей в том, что они не являются по-настоящему специалистами в области деятельности компании. То есть внутри компании выстраивается еще одна организация, цель которой — имитация бурной деятельности. \r\n\r\n\r\n\r\nЕсли наглядно. До реструктуризации между линейным разработчиком и руководителем IT-департамента было условно, один человек — тимлид. «Эффективный менеджмент» начинает дробить внутреннюю структуру компании на более мелкие части, вводя все больше и больше «управляющих» должностей. Таким образом, вычленяются мелкие, слабые и зависимые «команды», у каждой есть свой начальник, цель которого — писать отчеты. При этом на диагональные контакты вводится жесткое эмбарго: только по вертикали. То есть, если раньше специалисты разных департаментов могли взаимодействовать между собой на уровень выше и ниже по иерархии, то теперь — все только через систему типа «сломанный телефон», то есть через своих начальников «эффективных менеджеров». Конечно же, под все это пишутся попугайские отчеты, которые показывают, насколько сильно выросла производительность труда и как много полезного было сделано за неделю/месяц/квартал. \r\n\r\nИтогом оккупации компании со стороны «эффективных менеджеров» является многократное увеличение административно-бюрократического аппарата компании без кратного роста производительности/доходности компании. Там где раньше хватало 1-2 человек, теперь сидит десяток и пишет отчеты. \r\n\r\nОт подобного саботажа страдают все, кроме, само собой, «эффективных менеджеров» всех уровней. \r\n\r\nКак стоит выстраивать кадровую политику, чтобы не попасть в эту ловушку\r\n\r\nПроще всего было бы сказать «растите своих начальников внутри коллектива» и заканчивать статью, но все мы понимаем, что чаще всего это невозможно. \r\n\r\nКонечно, нанимать людей со стороны можно и нужно. Вопрос в их квалификации. В первую очередь стоит обратить внимание на HR-департамент, так как оккупация «эффективным менеджерами», чаще всего, начинается именно с этого берега. Как бы презрительно разработка не относилась к HR или продажам, но правильные рекрутеры или продажники — друзья девелоперу. К сожалению, в последние годы приставку «IT» опошлили и стали совать везде, где только можно, но IT-рекрутеры или IT-продажники все еще существуют. \r\n\r\nВ первую очередь это люди обладающие достаточной квалификацией и пониманием специфики работы. То есть я говорю об HR, которые ясно осознают, что такое стек технологий, в курсе современных трендов в разработке, не считают LLVM матерной аббревиатурой и не говорят «си с решеточкой». Чаще всего такие люди имеют адекватный бэкграунд в технологиях и даже пробовали себя в IT-специальностях, но по какой-то причине ушли в смежную сферу IT-рекрутинга, за что их не стоит осуждать. \r\n\r\nТоже самое стоит говорить и о руководителях во всех прочих направлениях. Даже завхоз в IT-компании не имеет права быть далеким от технологий, потому что кроме условных закупок туалетной бумаги и прочих активностей по поддержанию жизнедеятельности офиса он еще должен минимум контролировать уборщиц, чтобы они не протирали серверные стойки влажной тряпкой.\r\n\r\nЛучший способ избежать найма эффективного менеджера — искать на должность руководителя технических команд именно технического специалиста. Это снимает как минимум вопросы с адекватностью выставления метрик, понимания процесса разработки и конфликта интересов, когда подчиненные более квалифицированы, чем их новый начальник. \r\n\r\nПример: ваш тимлид и по совместительству Senior имеет стек «A+B» и опыт работы в 10 лет. Человек тяготеет к написанию кода и менторству внутри коллектива и не горит желанием заниматься бумажной работой, этакий Super Star от разработки. Как минимум глупо нанимать ему в руководители человека со стеком «A» и опытом 3-5 лет. Обе эти фигуры должны быть сопоставимы в понимании процесса разработки и технологий, иначе мы получаем ситуацию, когда «хвост виляет собакой». Хватит верить бодрым резюме, горящим глазам и «хорошему впечатлению на собеседовании». Если кандидат не удовлетворяет одному из ключевых требований, в том числе и стажу работы, не стоит рисковать. Конечно, «эффективного менеджера» вы его лице не получите, но компанию таким телодвижением ослабите, то есть приблизите организацию к возможному началу оккупации. \r\n\r\nВот несколько постулатов в найме и управлении которые стоит взять на вооружение хотя бы частично:\r\n\r\n\r\nНе бывает «частичного соответствия» позиции. Кандидат либо подходит, либо нет. Особенно касается руководящих должностей.\r\nВсе руководители должны иметь больший опыт в разработке, нежели их подчиненные. Обычно это разрыв в 3-5 лет между ними. \r\nНельзя пресекать прямые диагональные связи между департаментами. Слишком жесткая «вертикаль» парализует работу.\r\nЗа адекватность и выполнение выставленных метрик в первую очередь всегда отвечает тот менеджер, который их выставил. То есть сначала проверяется и оценивается адекватность новых требований руководителя, а только потом проверяется работник. \r\nНикаких «попугаев». Оценка работы должна проводится по разным параметрам, в том числе и сложности, а не по количеству строк кода.\r\n\r\nВ принципе, этот подход можно экстраполировать на любую IT-компанию. Без управленцев бизнес и конкретно разработка невозможны, это факт. Но в любом случае, остерегайтесь «эффективных менеджеров». Они как тараканы: если пропустили в дом одного, через полгода их будет легион, который выселит вас с вашей же «жилплощади».	https://habr.com/ru/company/crossover/blog/428592/	8363484a-393a-4b59-ba9d-f6f85d884f47
85290233-2b07-40b3-9d0f-5c05bad1dbb7	Откуда появилась практика массовой релокации квалифицированных кадров	Crossover; США; дороги; релокация; переезд; удаленная работа; история; лонгрид; научно-популярное	Сейчас релокацией никого не удивить, особенно специалистов в сфере IT. Тысячи компаний по всему миру приглашают на работу сотрудников из других регионов, чтобы утолить собственный кадровый голод. Если этот голод слишком силен — то организации помогают даже с визами и покрывают расходы на переезд, выдают подъемные на обустройство на новом месте и ищут для нового ценного сотрудника жилье. \r\n\r\nНо откуда у нас вообще появилась практика массовой профессиональной релокации? Ведь еще сто лет назад релокации были подвержены диаметрально противоположные категории работников: это были либо низкоквалифицированные необразованные рабочие, либо «звезды», ученые и изобретатели, которых можно пересчитать по пальцам двух рук. Давайте оглянемся назад и рассмотрим несколько исторических событий, которые сделали массовую релокацию новой профессиональной нормой, причем не только в IT. \r\n\r\nКонвой Эйзенхауэра, Великая депрессия, и стройка Рузвельта\r\n\r\n34 президент США Дуайт Эйзенхауэр во время своей службы в бронетанковом корпусе, 1919 год \r\n\r\nСложно спорить с тем, что культура профессиональной релокации пришла к нам из США. В начале 20 века произошло событие, которое изменило не только историю Соединенных Штатов и, в итоге, сделало их великой державой, но повлияло на профессиональную жизнь всего мира. Речь идет об автомобильном конвое Эйзенхауэра, который стартовал в 1919 году от стен Белого дома с целью пересечь всю страну от Вашингтона до Сан-Франциско. Носит он такое название, так как молодой Эйзенхауэр, которому будет суждено стать 34 президентом США, тоже принимал в нем участие. Цель конвоя была проста: 80 грузовиков, 258 солдат и 24 офицера проедут всю страну, чтобы не только показать простым американцам героев Первой Мировой, но и доказать важность строительства трансконтинентальных шоссе. И конвой справился с последней задачей на «отлично».\r\n\r\nНачавшийся было бодро автопробег по территории США с углублением в территорию страны превратился для его участников из легкой прогулки в форменный кошмар. Если на атлантическом побережье в начале века у Соединенных штатов была достаточно развитая транспортная инфраструктура, то при приближении к пункту назначения дороги становились все хуже и хуже, превращаясь, в итоге, в так знакомые нам «направления». \r\n\r\nКонвой настолько увяз в грязи бездорожья, что автопробег «от края до края» протяженностью чуть менее 5000 километров занял у военных два месяца. То есть можете себе представить: подготовленные, неприхотливые в дороге солдаты на спецтехнике того времени потратили 62 дня на дистанцию, которая сейчас занимает максимум неделю-полторы.\r\n\r\nЧасть маршрута конвоя совпала с современным шоссе 66 — дорогой, объединяющей восток и запад США. Но до 1936 года заасфальтировано было всего 800 из 4000 километров шоссе. В остальном была либо гравийка, либо кирпичная кладка, либо просто «направление», на котором легко увязнуть:\r\n\r\n\r\nФото сделано в 1930-х\r\n\r\nВсе эти приключения оставили у будущего президента США неизгладимые впечатления и показали важность автомобильной связности регионов между собой. Очевидно, так популярной на тот момент в США железной дороги было недостаточно как в военном, так и в гражданском плане.\r\n\r\nС обвалом бирж и наступлением Великой депрессии внутри страны начались миграционные процессы, которые легли в основу современного образа жизни множества американцев. Сотни тысяч людей покидали свои дома в поисках работы, чтобы банально выжить. Масла в огонь подлили пыльные бури 1930-1936 годов, которые вошли в историю как "пыльный котел". В результате этой погодной аномалии почти 2,5 млн жителей штатов, расположенных в прериях, бежали из своих домов в другие, более благополучные регионы страны. \r\n\r\n\r\nТехника, занесенная пыльной бурей, Южная Дакота, 1936 год\r\n\r\nСовокупность этих природных и экономических факторов показала руководству страны важность обеспечения свободного перемещения населения на большие расстояния и с 1936 по 1938 год, под патронажем тогдашнего президента Рузвельта в рамках мер по борьбе с Великой Депрессией, шоссе 66 было полностью заасфальтировано, что положило начало эпохе дорог США в частности и началу свободного перемещения широких слоев работников в целом. \r\n\r\nПрезидентство Эйзенхауэра\r\nПроект, начатый Рузвельтом в виде создания асфальтированной «Route 66», несомненно важен, но полную «дорогофикацию» всей страны, которая изменила экономические предпочтения США и показала миру, что такое гибкость кадрового вопроса, затеял именно Эйзенхауэр. \r\n\r\nВо время своих президентских сроков в период с 1953 по 1961 годы, уже умудренный опытом и прошедший три войны Эйзенхауэр (обе мировые плюс корейская) заявил, что Америке жизненно необходима разветвленная сеть качественных и доступных для населения дорог. Это особенно удивительно на фоне того, что Эйзенхауэр был республиканцем, то есть придерживался мнения, что федеральный бюджет должен нести минимальные издержки на социальное обеспечение. В 1956 году с подачи Эйзенхауэра Соединенные Штаты начали одну из крупнейших строек в истории, по масштабу с которой на тот момент были сравнимы только советские проекты транссиба и массовой электрификации. \r\n\r\nКомандой Эйзенхауэра был разработан, а в 1956 году конгрессом принят законопроект под названием Federal Aid Highway Act, также известный как «Закон о национальных межштатных автомобильных и оборонительных магистралях» (National Interstate and Defense Highways Act), согласно которому в стране началось строительство Системы межштатных автомагистралей США. В пересчете на современные цены на строительство 77 500 километров дорог в США с 1956 по 1992 годы было потрачено 500 млрд долларов. Как итог США получили сеть федеральных бесплатных дорог, которые, по мнению множества экономистов, обеспечили США не только связность регионов, но и немалый экономический подъем за счет мобильности товаров и кадров. \r\n\r\n\r\n\r\nКаким образом президент-республиканец решился на такую колоссальную трату федеральных денег? Сам Эйзенхауэр говорил, что пришел на вершину политики «из вне», что было правдой. Также 34 президент США заявлял, что «ничего не смыслит в экономике». Но у настойчивости Эйзенхауэра в трате федеральных денег было несколько причин. Первая — упоминаемый нами ранее автопробег, который Дуайт вспоминал до самой смерти, в том числе и в своих мемуарах. Второе — опыт Эйзенхауэра во время Второй Мировой в Европе, где он увидел рейхавтобаны и был весьма впечатлен нацисткой концепцией быстрого перемещения сил внутри страны по хорошим дорогам. Ну и третье — корейский опыт командования, который показал Эйзенхауэру важность мобильности войск. Именно благодаря вышеописанным событиям Эйзенхауэр был глубоко убежден в пользе проекта сетей шоссе для экономики и армии, и оказался абсолютно прав. \r\n\r\n\r\nСеть скоростных шоссе США\r\n\r\nПроект оказался настолько громоздким, что его строительство затянулось до 1992 года, при этом часть магистралей так и не была достроена до конца и объединена в единую сеть из-за сопротивления стройке со стороны местных жителей. Однако разветвленная сеть дорог открыла перед жителями новые возможности в плане релокации и трудовой миграции, хотя почти и убила железнодорожную систему страны. Случилось это в первую очередь потому, что почти все железнодорожные магистрали в США находились в частной собственности и не могли конкурировать с бесплатными федеральными дорогами, а массовость автомобилей в США только подстегивала население к отказу от железнодорожного транспорта дальнего следования. \r\n\r\nОпыт Китайской Народной Республики\r\nДоподлинно известно, что Китай с удовольствием берет на вооружение чужие успешные проекты и приспосабливает их под свои нужды. Для выполнения доктрины установления китайского экономического превосходства властям поднебесной пришлось вплотную заняться инфраструктурными вопросами. \r\n\r\nДо конца 1980-х в Китае вообще не было скоростных магистралей. Для достижения «дорожного превосходства» на вооружение был принят опыт Соединенных Штатов и в 1989 году власти КНР начали самый масштабный транспортный проект в истории человечества, который продолжается до сих пор. По статистике в 1988 году в китае было 0 километров скоростных магистралей. В 1989 году было построено всего 147 километров дорог, к 2000 году общая протяженность скоростных магистралей в Китае выросла до чуть более внушительных 11 600 километров. Но это было только начало. За следующие 17 лет, то есть к 2017 году, автомагистральная сеть разрослась до 136 000 километров.\r\n\r\n\r\nСеть Скоростных автотрасс Китайской Народной Республики\r\n\r\nСтроительство дорог в Китае стимулировало урбанизацию страны и миграцию кадров, что дало очередной толчок экономике КНР. При этом строительство скоростных магистралей в Поднебесной продолжается до сих пор и судя по настрою председателя Си Цзиньпина в плане развития страны и повышения качества жизни китайцев, прекращаться не намерено. Цель Китая — для начала объединить все сравнительно крупные населенные пункты (от 100-200 тыс. населения) одной сетью магистралей. \r\n\r\nУдаленная работа как обратная сторона медали релокации\r\nПри всем диктате экономики в плане трудовой миграции и мобильности кадров, у истории со строительством разветвленной сети дорог есть обратная сторона медали — формат удаленной работы, о возникновении которого мы уже рассказывали. По разным данным из года в год количество удаленных и частично удаленных сотрудников, а также фрилансеров, неуклонно растет. Больше всего удаленных работников наблюдается в сфере науки и IT, то есть мы имеем парадоксальную ситуацию: родная нам индустрия бросается в обе крайности, как в плане релокации, так и в плане противоположной ей удаленной работы.\r\n\r\nВ любом случае, глупо отрицать факт того, что удаленная работа уничтожит необходимость релокации сотрудников: слишком многие проекты требуют физического присутствия и постоянного взаимодействия с другими членами команды. Особенно это видно по сегменту энтерпрайз-разработки, который в 99% процентах случаев требует физического нахождения в офисе компании. При этом выстраивание полноценной удаленной системы взаимодействия большой команды разработчиков — нетривиальная задача, о которой мы как минимум рассказывали на примере рабочего дня директора по продуктам Максима Винникова. \r\n\r\nВ любом случае, практике массового переезда квалифицированных кадров ради работы мы обязаны, в первую очередь, скоростным дорогам и другим инфраструктурным проектам 20 века, без которых человечество не смогло бы достигнуть нынешнего уровня развития.	https://habr.com/ru/company/crossover/blog/428219/	8363484a-393a-4b59-ba9d-f6f85d884f47
7b81e336-1a1f-4978-a63e-13c4a58d9d9a	Руководители, хватит сбрасывать пользовательские пароли раз в месяц	пароли; информационная безопасность; руководство; IT-службы; периметр; токены; crossover	День смены паролей, офис в городе Энске, реконструкция, цвет\r\n\r\nЕсли эта статья не проделала брешь в пространственно-временном континууме, то на дворе 2018 год, а в большинстве крупных организаций до сих пор меняют пароли каждые 30-90 дней. Тема того, что принудительная постоянная смена паролей лишь снижает секьюрность, но никак ее не повышает, поднималась на Хабре уже много раз (1, 2, 3), но в них, обычно, обсуждались частные случаи, а в комментариях пользователи активно делились опытом, как они защищают свои собственные учетные записи. \r\n\r\nТо что связка условного KeePass+токен, присыпанная двухфакторной аутентификацией намного надежнее, чем условная смена паролей раз в 30-90 дней, понятно и без объяснений. Но как метко заметил один из комментаторов в прошлых публикациях, зачастую инициатива на подобные «эффективные» меры исходит с самого верха организации, а спорить с генеральным директором без достойных аргументов себе дороже. Поэтому я решил попробовать доступно разложить, откуда растут ноги столь распространенной и одновременно неэффективной практики, какие им существуют альтернативы и с чем они сопряжены. Возможно, после прочтения этой статьи некоторыми руководителями, работать в отдельных компаниях станет немного лучше. \r\n\r\nЧем опасна регулярная смена паролей\r\nПароль сам по себе — средство защиты не слишком стойкое ко взлому. Именно поэтому сейчас на рынке есть многочисленные средства двух или даже трехфакторной аутентификации, различные токены, флешки и прочие ухищрения, которые укрепляют периметр и снижают вероятность взлома и получения доступа к конфиденциальным данным или учетной записи. Одним из пропагандируемых способов «укрепления» этого самого периметра является, якобы, регулярная смена пароля пользователя, которая, по идее, должна уберечь от атаки вследствие слива БД и так далее. Все эти рекомендации упускают, в первую очередь, эффект шаблонизации, который я подробно описывал несколько лет назад.\r\n\r\nЕсли кратко: постоянная принудительная смена паролей приводит к выработке человеком шаблона не только запоминания текущего пароля, но и его генерации, что описали в научной работе исследователи из США еще в 2010 году.\r\n\r\nВместо бесконечного запоминания «стойких паролей с переменным регистром и спецсимволами» пользователи начинают их банально записывать или использовать шаблоны. И приставить к каждому сотруднику надзирателя, который бы проверял уникальность каждого нового пароля невозможно.\r\n\r\nОткуда о смене паролей узнают руководители\r\nЕсли немного помучить поисковик, то можно найти массу публикаций и даже служебных документов на тему информационной безопасности. Некоторые из них пахнут нафталином, другие — чуть более бодрые и рассказывают об опасности «атак изнутри» и социальной инженерии в ходе взлома. Всех их объединяет пункт «периодическая смена пароля», который чаще всего начинается со слов вида «не стоит забывать о таком простом и эффективном способе».\r\n\r\nДля того, чтобы не быть голословным, приведу пару примеров того, как в отечественной литературе (в том числе учебной!) и статьях рекомендуют использовать периодическую смену паролей:\r\n\r\n\r\n\r\nЭто скриншот из УМК по инфобезу 2008 года издания. В нем авторы признают слабость пароля как средства защиты и призывают обеспечивать информационную безопасность через регулярную принудительную их смену и еще ряд менее бесполезных мероприятий, таких как защищенные каналы передачи данных, к примеру. \r\n\r\nТакже в сети предлагается масса платных семинаров и тренингов для «менеджеров и руководителей» по обеспечению информационной безопасности предприятия. Если абстрагироваться от IT-сегмента и представить, что инфобезом озаботился директор или владелец предприятия, производящего, например, газосиликатные блоки или другую промышленную продукцию, то скорее всего, информацию он почерпнет как раз из открытых источников или посетит один из «повышающих квалификацию» семинаров. \r\n\r\nЯ не критикую на корню подобные мероприятия, нет. Конечно, там дается и полезная информация о поведении в сети, ограничении прав доступа, своевременном обновлении систем и администрировании. Возможно, там учат прописывать регламенты и выстраивать простейшие периметры информационной безопасности на базе создания «режима» на объекте. Однако со 100% уверенностью можно констатировать, что нелюбимая нами мантра «заставляйте сотрудников менять пароль раз в 30 дней» звучит на подобных мероприятиях регулярно. \r\n\r\nЕсли задуматься, то можно сделать один простой вывод: ведь подобную политику позволяют проводить средства администрирования Windows. Фактически, регулярная смена паролей в корпоративной сети — это стандарт, созданный много лет назад из лучших побуждений, который продолжает существовать по инерции. Если копнуть чуть глубже, можно увидеть, что регулярную смену паролей широко используют не только для продуктов Microsoft, которые поставляют эту механику «из коробки». Практика смены паролей была успешно экстраполирована на другие продукты, например, на «зоопарк» софта 1C. Фактически, администраторы по всему СНГ уже минимум десятилетие насилуют мозг и себе, и бухгалтерам/продажникам, исполняя наставления руководства по «обеспечению безопасности». \r\n\r\nПри этом специалистов, которые призывают отказаться от регулярной смены паролей и пропаганды невозможных к запоминанию комбинаций, который год успешно игнорируют. Например, около двух лет назад против постоянной смены сложных паролей выступил глава нового центра национальной кибербезопасности при штаб-квартире Соединенного Королевства Мартин Чиаран. Он раскритиковал практику постоянной смены паролей и советы использовать сложные пароли для разных сервисов, сравнив это с ежемесячным запоминанием 600-значного числа. По мнению Чиарана, намного безопаснее использовать либо менеджер паролей, либо единый сложный для взлома, но возможный к запоминанию пароль. \r\n\r\nВозможно ли переубедить руководство?\r\nПутей переубедить руководителя, далекого от современного мира IT в том, что регулярная смена паролей — дикая дичь, не так уж и много. \r\n\r\nСтоит понимать, что данная практика получила столь широкую популярность по двум причинам: \r\n\r\n\r\nЭто дает ложное чувство безопасности и закрывает для руководителя вопрос «защищенности» рабочих станций сотрудников.\r\nЭто относительно быстро и бесплатно.\r\n\r\nЕсли со всех сторон, в прессе, на семинарах и так далее твердят десятилетиями, что смена пароля — хорошая затея, это отложится в памяти руководителя. Вкупе со вторым пунктом, когда все расходы на разверстку «периметра» в виде смены паролей ограничиваются тем, что нужно лишь озадачить этим системного администратора, который все сделает за один день, все становится вдвойне приятнее и проще. \r\n\r\nНи один руководитель компании средней руки не согласится на закупку токенов или других физических средств защиты рабочих станций, когда есть бесплатная альтернатива в виде принудительной смены паролей. Очевидный сценарий в этом случае один: объяснить несостоятельность подобной практики и предложить альтернативу.\r\n\r\nЧем опасна регулярная смена пароля:\r\n\r\n\r\nпароли начинают записывать на бумажках/в ежедневниках/клеить стикеры на монитор;\r\nпароли шаблонизируются (меняется несколько символов в начале или конце пароля);\r\nпароли слишком сильно упрощаются, даже при наличии минимального ограничения по символам.\r\n\r\nМожно почувствовать, что все основные угрозы, создаваемые регулярной сменой пароля относятся к внутреннему нарушению ИБ и периметра, то есть лежат в плоскости социальной инженерии. Удаленный хакер из Нигерии никогда не подсмотрит пароль, который записан на бумажке и спрятан под клавиатуру. А вот случайно зашедший сотрудник конкурента или вредитель из коллектива — запросто. \r\n\r\nЕдинственная реальная альтернатива для обеспечения безопасности внутреннего периметра — использование принципа «одна станция — один человек», оперативное консультирование и поддержка персонала в случае блокировки рабочей станции по таймауту, выстраивание политик доступа внутри самой сети и введение ответственности за разглашение/передачу пароля от учетной записи. Последнее очень красиво вписывается в моду последних лет по любому поводу подписывать с сотрудниками и подрядчиками NDA, так пусть хоть раз это будет оправдано.\r\n\r\nБанковский сектор как пример для подражания\r\nБольшинство руководителей в вопросах информационной безопасности внутри офиса относятся к работникам, как к собственности компании, то есть им, якобы, не нужна поддержка. Однако если рассмотреть структуру внутреннего периметра по примеру обеспечения безопасности данных в виде «Сервис-Клиент» в банковских структурах, то все становится намного понятнее. \r\n\r\nЗадумайтесь: пин-код от банковской карты составляет всего 4 символа, однако никто не кричит о том, что он «слишком короткий» и простой для взлома. Банально потому что для пластиковых карт существует ограничение на количество попыток ввода, плюс клиент может оперативно заблокировать свою карту в случае, если он заподозрил утечку данных (скриммер) или потерял карту. И пользователи активно пользуются этими возможностями, потому что заинтересованы в соблюдении мер безопасности и знают, что смогут оперативно выполнить данные операции. \r\n\r\nТо есть, если ваше руководство озаботилось созданием внутреннего регламента и обеспечением реальной информационной безопасности компании, то до него стоит донести факт того, что все сотрудники в этот момент становятся «клиентами» IT-службы организации, которая будет заниматься их поддержкой. Чаще всего эта роль ложится на системных администраторов, которые и так обеспечивают бесперебойное функционирование IT-систем организации. И чем серьезнее меры безопасности, тем больше расходы на штат и инфраструктуру. Но почему-то об этой простой истине принято умалчивать. \r\n\r\nТак что мне делать?\r\nДо руководства надо донести одну простую мысль: не бывает бесплатной информационной безопасности, бесплатно можно создать только видимость активности в этом направлении. Во всех прочих случаях возрастают расходы либо на штат системных администраторов (если в штате брешь, то вырастут простои на местах), которые будут оперативно реагировать на проблемы пользователей и смогут выстроить грамотную систему прав и доступов, либо требуется закупка токенов, которые выдают временные пароли/по которым происходит доступ к системе. \r\n\r\nОтносительно бесплатной альтернативой вышеупомянутому является только мастер-пароль, который пользователь может запомнить и не имеет права разглашать + использование менеджера паролей для доступа к стратегическому для компании софту и базам данных. \r\n\r\nО чем мы, собственно, уже почти десяток лет и твердим. \r\n\r\n\r\nP.S. Ниже опросы для офисных работников. Фрилансеров и удаленщиков просьба воздержаться по понятным причинам.	https://habr.com/ru/company/crossover/blog/427711/	8363484a-393a-4b59-ba9d-f6f85d884f47
7d51e370-11af-4b66-a9d7-88b94f18ac3e	Геологическое 3D-моделирование, каротаж и технатон от Aramco Innovations	Aramco Innovations; технатон; Saudi Aramco; нефтедобыча; геология; BigData; машинное обучение; ИИ; IT в нефтедобыче	Признайтесь, когда речь заходит о добыче нефти, перед глазами встают техасские пейзажи и механические «качалки» на фоне закатного неба. Кто-то увидит еще трубы-факелы, сжигающие попутные газы, а может еще и буровую платформу где-то на морском шельфе. Само собой, добыча нефти — бизнес тяжелый и сопряженный с определенными рисками. Огромные машины, буровые станки, опасность взрыва и пожара. Нефтедобыча в сознании масс — дело, несомненно, брутальное, для крепких рабочих и почти таких же крепких инженеров.\r\n\r\n\r\n\r\nВсе вы одновременно и правы, и ошибаетесь. Да, нефть добывали и добывают с помощью «качелей», но весь этот образ, который мы получили из кино и сериалов, уже не соответствует полной картине; прогрессивные компании все активнее начинают внедрять последние достижения из области IT. Современные нефтяники одновременно используют последние наработки в обработке BigData, ИИ, машинного обучения и многих других. Ниже, опираясь на опыт компании Aramco Innovations, будет несколько примеров того, насколько глубоко IT-технологии проникли в такой, казалось бы, классический и инертный бизнес, как нефтедобыча.\r\n\r\nСтоит начать с того, о чьих кейсах пойдет речь. Aramco Innovations — российское представительство исследовательской организации, которая входит в структуру национальной нефтедобывающей компании Саудовской Аравии Saudi Aramco. Последняя является крупнейшим нефтедобытчиком на планете и целиком принадлежит Королевству Саудовская Аравия. Конкретно Aramco Innovations занимается для материнской организации исследованиями в области искусственного интеллекта (ИИ), высокопроизводительных вычислительных систем и наноматериалов. Компания недавно открыла офис в Москве, как в одном из наиболее перспективных мест для организации научной работы в сферах ИИ, BigData и машинного обучения.\r\n\r\n Геологическое 3D-моделирование месторождений\r\nЕсли взять в руки толковый словарь и открыть его на «геомоделировании», то мы получим примерно следующее определение: это проектирование и создание картографических изображений на основе визуализации исходных, производных или итоговых данных. Очевидно, что в нефтяной отрасли геомоделирование занимает одно из центральных мест. Значительная часть расходов нефтяных компаний по всему миру (и речь идет не только об Saudi Aramco, а вообще о всех нефтедобытчиках) приходится именно на разведку с последующим моделированием залегания углеводородов. \r\n\r\nСогласно общепринятой концепции геомоделирование можно разложить на следующие этапы: \r\n\r\n\r\nподготовка;\r\nструктурное моделирование;\r\nсоздание трехмерной сетки; \r\nосреднение скважинных данных на ячейки трехмерной сетки;\r\nлитолого-фациальное моделирование;\r\nпетрофизическое моделирование;\r\nмоделирование насыщения;\r\n3D-подсчет запасов. \r\n\r\nФактически, трехмерное моделирование залежей — это многоступенчатый, сложный процесс оценки месторождения по целому ряду признаков, хотя на первый взгляд может показаться, что достаточно лишь определить, «откуда» и «докуда» и залегают углеводороды.\r\n\r\nЗачем вообще нужны геомодели месторождения после старта добычи? Понятно, что классический процесс извлечения углеводородов из недр начинается с непосредственной разведки месторождения. Геологи строят его карту, на основе которой создается полная компьютерная модель всего резервуара. Делается это для того, чтобы выработать стратегию по разработке месторождения, наиболее выгодно размещать нефтяные скважины, минимизировать потери от смещения пластов и избежать аварий в ходе добычи. \r\n\r\n\r\nСхематическая иллюстрация наиболее выгодного расположения нефтяной вышки для добычи нефти\r\n\r\nКак можно понять, четкость подобной модели резервуара с течением времени снижается из-за того, что ни одна модель не может со 100% точностью предсказать все изменения в структуре породы и самого месторождения в процессе добычи нефти. Выше мы привели схематический пример нефтяного месторождения, но в реальности все намного сложнее. К примеру, Saudi Aramco занимается разработкой крупнейшего в мире нефтяного месторождения Гавар, открытого еще в 1948 году. В нем залегает до 10-12 млрд тонн нефти, а общая площадь месторождения составляет ~5300 квадратных километров. \r\n\r\n\r\n\r\nТо есть, мы приходим к тому, что даже разведанные активные месторождения требуют постоянного изучения и моделирования, хотя бы для того, чтобы понимать, где стоит бурить, а где это уже бесполезно либо слишком дорого. При этом нужно помнить, что залегать полезные ископаемые могут на гигантских площадях, то есть бурение и добыча происходят одновременно во множестве точек. Рассчитать и предсказать изменения в структуре месторождения вручную практически невозможно, поэтому задача по моделированию активных месторождений переходит в плоскость разработки IT-систем и обработки больших массивов данных.\r\n\r\nИменно тут начинается работа для IT-специалистов в областях ИИ, BigData и машинного обучения. Примерно с 1960-х нефтяные компании стали собирать массу данных о разрабатываемых месторождениях. С течением времени эта информация превратилась в огромный поток всевозможных данных, получаемых как во время разведки, так и в процессе бурения и добычи. На основании этой информации специалисты хотят обучать нейросети для более быстрого и четкого моделирования поведения разрабатываемых месторождений в ближайшем будущем. \r\n\r\nВ этом направлении было проведено уже достаточно много работы и проведен ряд исследований. Так, в одном из них на вход нейросети подаются следующие типы данных о месторождении:\r\n\r\n\r\nинформация об интенсивности гамма-излучения;\r\nпористость;\r\nплотность;\r\nнасыщенность водой;\r\nи другие.\r\n\r\n\r\n\r\nНа выходе исследователи получают прогнозы по температуре, давлению, структуре и уплотнению породы и даже рекомендованному расстоянию между вышками. Кроме оценки самих месторождений подобные системы можно использовать и для прогнозирования проблем во время бурения и самой добычи, что предвосхищает аварии, поломки и возникновение незапланированных убытков.\r\n\r\nИнтерпретация данных и каротажные кривые\r\nЕсли говорить о бурении, то стоит вспомнить о каротажных кривых и изучении скважин. Каротаж — это метод геофизического исследования скважин. Конечно, наиболее очевидный путь оценки структуры скважины — это подъем керна — выпиливание породы с последующим физическим изучением всего «столба». Однако инженеры-бурильщики не дадут соврать: сам процесс выпиливания и подъема керна стоит чудовищных денег и сопряжен с целым рядом технических трудностей. В первую очередь, это долго. Одно дело — пробурить скважину, поднимая на поверхность измельченную породу в буровом растворе, а другое — вырезать столб и поднять его в том виде, в котором он залегал. По этой причине современный каротаж использует геофизические зонды, которые спускаются в скважину для изучения стенок скважины и околоскважинного пространства и сбора информации «изнутри». \r\n\r\nКаротажные зонды оснащаются целым спектром пассивных и активных датчиков. Пассивные датчики собирают информацию о магнитном и самопроизвольно возникающем электрическом поле, естественном гамма-излучении и так далее. Активные датчики — это приемники и источники искусственно созданных электрических, акустических и других полей и излучений. С помощью каротажного зонда геофизики собирают информацию на некоторых интервалах скважины, которые потом формируются в каротажные кривые.\r\n\r\n\r\nПример построенных каротажных кривых по нескольким параметрам\r\n\r\nСобранные из скважины данные в дальнейшем обрабатываются геологами, и это очень кропотливый и трудоемкий процесс, который зачастую происходит в ручном режиме. \r\n\r\nAramco Innovations работает над созданием систем интерпретации каротажных кривых на базе технологий машинного обучения. Большая часть работы с кривыми — это типичный monkey-job, который сводится к поиску точек зависимостей и различий с уже имеющимися у геологов данными. Машинное обучение как нельзя лучше подходит для выявления этих зависимостей в каротажных кривых с последующим формированием конечного отчета, который анализируется уже специалистом. Такой подход позволяет значительно увеличить эффективность исследований скважин и в разы ускоряет процесс оценки скважины и разведку в целом.\r\n\r\nТакже машинное зрение планируется использовать для анализа структуры глубинных пластов на базе полученных в ходе сейсморазведки изображений. Наибольшую ценность для геологов на них представляют нефтеносные горизонты и трещины в породе, которые могут представлять потенциальную угрозу в ходе добычи полезных ископаемых. Сейчас специалисты Aramco Innovations работают над тем, чтобы делегировать наиболее муторную и однообразную работу машинам, оставив людям лишь функцию итогового анализа и принятия решения. \r\n\r\nТехнатон Aramco Innovations\r\nВыше мы рассказали лишь о нескольких направлениях применения современных достижений IT-сферы в нефтедобыче. Их важность сложно переоценить: мы буквально живем в пластмассовом мире. Практически все предметы, окружающие нас, в той или иной степени были созданы либо из нефти и производных, либо из материалов, полученных за счет сжигания углеродного топлива. \r\n\r\nВ эти выходные, с 26 по 28 октября, Aramco Innovations совместно с Научным парком МГУ проводит в Москве Aramco Upstream Solutions Technathon, мероприятие посвященное применению технологий Искусственного Интеллекта для нефтяной отрасли. \r\n\r\n\r\n\r\nОсновная цель мероприятия — оценить и поощрить научный потенциал в сфере машинного обучения и искусственного интеллекта, а также найти потенциальных кандидатов, желающих присоединиться к команде Aramco Innovations. В первый день, 26 октября, с 12:00 до 16:00 все участники смогут прослушать научно-популярные лекции, посвященные задачам мероприятия. Цель лекций — дать представление о нефтедобыче тем, кто далек от индустрии. Лекции, как и сам технатон, абсолютно бесплатны. \r\n\r\nФинал технатона состоится 28 октября, в его рамках будут награждены 3 команды-победителя, а также будут вручены 2 специальных приза за решения задач, отмеченных судьями. Призовой фонд технатона составляет 7000 долларов США (около 470 000 рублей). Участников ждёт 48 часов кодинга и работа с ведущими экспертами из научного центра Saudi Aramco.\r\n\r\nВ первую очередь к участию приглашаются IT-специалисты в области машинного обучения и ИИ, специалисты технических профессий, геологи и геофизики.\r\n\r\n\r\nПодробнее с регламентом, расписанием и правилами мероприятия вы можете ознакомиться тут. Для участия в технатоне нужно пройти бесплатную регистрацию до 26 октября, 17:50 по МСК. \r\n\r\nЖдем всех заинтересованных специалистов 26 октября, в 18:00 по адресу г. Москва, Научный парк МГУ, ул. Ленинские Горы, 1с77. \r\n\r\nЕсли у вас возникли дополнительные вопросы по мероприятию, пишите на ab@codenrock.com или спрашивайте в Telegram-канале мероприятия.	https://habr.com/ru/post/427289/	8363484a-393a-4b59-ba9d-f6f85d884f47
39e89240-dd01-413a-8ad6-edb105b1fde9	Дорогая, мы убиваем бесплатный текстовый контент	контент; журналистика; адблок; пейволлы; paywall; пора платить; как там блокировка рекламы	Сегодня утром я в очередной раз просматривал иностранную прессу, шагал по ссылкам и читал новости. И в очередной раз я нарвался на требование оформить платную подписку на Wired, чтобы продолжить чтение. А потом на еще одном ресурсе. И на еще одном. Везде ситуация одинакова: у меня закончились бесплатные прочтения в этом месяце, хотя не сказать, чтобы я активно серфил и потреблял иностранные новости. Так, ограничиваюсь каналом addmeto в телеге да еще парой источников, если речь идет о развлечении. \r\n\r\nТри-четыре года назад я постоянно закусывался в комментариях на тогда еще существовавшем GT с сектантами адблока, которые с гордостью вещали «я блочу все, что могу. Ибо нефиг!». Вещали они это громко, с выражением (которое было видно даже в печатном тексте), а таких как я, осторожно спрашивающих «А как будет жить журналистика без рекламодателей?», клеймили «продажными корпоративщиками» и отвечали, что мол-де «качественный контент всегда выплывет на любви аудитории». \r\n\r\nТак вот немного поразмыслив сегодня утром над ситуацией, я осознал, что тот жуткий день, наступление которого я ждал еще с 2013-2014 годов, настал: мы, пользователи, убили бесплатный доступ к качественному контенту. Своими собственными руками. И все стремится к тому, что мы вовсе «пристрелим» концепцию бесплатного интернета. Пост будет небольшим, пятничным и посвященным исключительно тому, что мы натворили. С открытой концовкой, само собой. \r\n\r\nВсе началось лет пять назад, когда на рынке появился AdBlock и его разнообразные форки. Тогда он был уделом кучки «элиты», но информация о чудном блокировщике мерзкой рекламы разносилась по полям и весям со скоростью лесного пожара, причем при помощи этой самой кучки элиты. И в какой-то момент использование блокировщиков рекламы стало повсеместным: любой мало-мальски прошаренный пользователь стал накатывать AdBlock или его вариации на все возможные браузеры и устройства. Следующий шаг — блокировщики для мобильных устройств.\r\n\r\nТогда я работал в редакции этого самого ресурса и постоянно шарился по сети в поисках инфоповодов; еще до занятия позиции новостника мне постоянно приходилось читать Arstechnica, Wired, WSJ, NYT и прочие и прочие издания. \r\n\r\nПервые звоночки стали появляться в 2015, когда по интернету прокатилась волна просьб от издателей добавить их сайты в white-list AdBlock и позволить ресурсу существовать. Фанаты адблока глумились и улюлюкали, радовались наступлению новой эры интернета. «Посмотрите, какие мы сильные! Посмотрите, как мы их прогнули! Ату их! Ату!»\r\n\r\nИ только не надо начинать старую песню о «всплывающих видео» и прочих поп-апах, которые якобы «вынудили» вас использовать адблок с максимальными настройками блокировки. Я очень хорошо помню эти аргументы, а так же уверения в том, что «никто не обеднеет, нас же мало». А потом вас стало более 50% аудитории определенных ресурсов, вам, кстати, в том числе интересных (опять не буду показывать пальцем). Потому что это логика людей, которые сжигают собственный дом, видя в углу паука. \r\n\r\n\r\n\r\nКто-то более вдумчивый говорил, что реклама особо денег не приносила никогда и издатели живут на партнерских материалах и блогах компаний (не буду тыкать пальцем в один всем известный нам ресурс). Но на самом деле, это не так. Мы просто заставили издателей развивать другие, более нативные форматы рекламы вместо того, чтобы крутить баннеры. \r\n\r\nПотом пейволлом закрылся WSJ (если мне не изменяет память), из отечественных изданий — Republic. А следом потянулись и все остальные. Люди, радующиеся бедам «кровавых издателей», которые вызвали блокировщики рекламы, буквально сами себе прищемили дверью гениталии. \r\n\r\nВот вам немного прайсов:\r\n\r\nFull-подписка ArsTech — 50$/год (или урезанная за 25$);\r\nWired — 10$/год (35$/год расширенная версия);\r\nWall Street Journal — 28,99$/месяц (350$/год);\r\nNYT — базовая подписка 1$/неделя (52$/год) или full-подписка за 4,38$/неделя (227$/год);\r\nThe Guardian побирается на донатах (прикрутили сообщение «поддержите нас» к каждой статье с кнопкой оплаты).\r\n\r\nБесплатным остался TechCrunch, но читать там теперь откровенно нечего, ресурс умирает. \r\n\r\nMeduim, как альтернативная площадка, толком не взлетел. У него нет ядра аудитории и весь трафик на популярные материалы там гонят сами авторы из своих социальных сетей. Steemit туда же. Круг замкнулся.\r\n\r\nЭто логичное продолжение «войны блокировщиков», которую издатели проиграли несколько лет назад. Кстати говоря, все, кто молятся на AdBlock и иже с ними должны знать, что на пике «боевых действий» эти святые люди (разработчики) продавали места в white-листах своего детища за неприлично большие бабки. Чтобы вы понимали, что на вас нормально настригли купонов, адепты «чистого веба».\r\n\r\nНезамеченным это прошло для тех, кто сидит в VK, FB и на Пикабу. Для вас ничего не изменилось. А мне теперь придется либо изолироваться от происходящего, либо выкладывать пару сотен баксов в год на всевозможные подписки, чтобы быть в курсе новостей. Это без учета того, что за музыку и так приходится платить (лейблам), а независимых артистов — поддерживать прямыми донатами или через Patreon, чтобы не загнулись с голоду. \r\n\r\nИ я уверен, что все те, кто был за «интернет без баннерной рекламы» ни одной подписки так и не купят. Потому что fair use — не про таких людей, они всегда чем-то недовольны и всегда у них виноват кто-то другой. А платить придется мне и другим потребителям качественного контента, которых блогозаписи в FB и ЖЖ не устраивают как минимум своей ангажированностью и узостью. \r\n\r\nГоспода, мы убили взрослую независимую журналистику, в первую очередь — техническую, потому что именно технические издания пострадали в «войне блокировщиков» сильнее всего. Остались только андердоги и «студенческие» проекты типа «батеньки», но и там люди хотят есть. \r\n\r\nЧто я могу сказать в заключение? Я пойду все же оформлять подписку на Wired и поищу еще пару толковых изданий, потому что пора платить.\r\n\r\nP.S. Всех активно минусующих приглашаю в комментарии, чего вы молчите-то.	https://habr.com/ru/post/427047/	8363484a-393a-4b59-ba9d-f6f85d884f47
a3b9da0d-76f8-4262-a3c8-0b0f2c3c5ff9	Невыдуманные IT-истории о самозванцах и почему появились эти непонятные практики на собеседованиях	Самозванцы; истории; собеседование в IT; управление персоналом; карьера в IT; трудоустройство; большие компании; азиаты; индусы; Crossover	Типичный кандидат по версии излишне рьяных «охотников на самозванцев»\r\n\r\nНесколько дней назад Филипп fillpackart Ранжин выпустил статью под заголовком «Хватит подозревать разрабов в самозванстве. Научитесь лучше собеседовать», в которой поднял очень острую для индустрии проблему неадекватных собеседований. Я ее прочитал, ужаснулся, прочитал еще раз и задумался: «а почему вообще такая фигня происходит?». С этим вопросом я отправился к паре знакомых HR-специалистов и директору Crossover Russia Владимиру vme Еронину (что в итоге вылилось в статью в блоге) и, как оказалось, ноги подобных неприятных и непонятных практик растут, как обычно, не из нашей собственной культуры найма. \r\n\r\nК сожалению, тренд на слепое копирование всего и вся, «чтоб было не хуже, чем на Западе», жив и в 2018 году. И если в иностранных компаниях подобные вещи хоть как-то можно оправдать, закрыв глаза на градус маразма, то для России и стран СНГ множество из выработанных заокеанскими коллегами механизмов вообще неприменимы. Вот только не все HR-специалисты и руководители это понимают. \r\n\r\nНа самом деле в нашем регионе почти нет самозванцев и все, что написал Филипп Ранжин в своей статье справедливо. Не знаю, связано это с культурой или общим уровнем стыдливости, которые присущи нашему обществу, но почти все истории, которые я услышал, были связаны с выходцами из Азии и Индостана.\r\n\r\nТак что, если вы считаете, что самозванцев в IT не существует и никто не будет в здравом уме проходить собеседование на Senior Java, не имея достаточных навыков, то добро пожаловать под кат, я вас удивлю.\r\n\r\nИстория знает примеры уникальных самозванцев, которые выдавали себя за специалистов в какой-либо области, и при этом успешно справлялись с возлагаемыми на себя функциями. Чего только стоит Фердинанд Демара — величайший самозванец в истории. \r\n\r\n\r\n\r\nДумаю, многие слышали об этом персонаже, который через подлог документов, обман и даже инсценировку собственного самоубийства представлялся и в последующем работал инженером-строителем, заместителем шерифа, начальником тюрьмы, доктором психологии, адвокатом, преподавателем и даже хирургом на военном корабле (и провел несколько успешных операций и остановил эпидемию!), не имея при этом даже среднего образования. Список «профессий» Демары крайне обширен. Но история Фердинанда — исключение, в рамках которого самозванец обладал исключительной изворотливостью, феноменальной памятью и, чаще всего, справлялся со своей ролью. \r\n\r\nСовременные самозванцы, в основном, ищут лишь больших и легких денег при минимальных усилиях. И их можно получить в IT, важно лишь продержаться пару недель, особенно, если работа удаленная.\r\n\r\nИстория №1. Конвейер Java-разработчиков\r\n\r\n\r\nВ оффлайне самозванцев все меньше и меньше. Им приходится тратить собственные ресурсы, можно проколоться на собеседовании, а потом нужно и на работу ходить. А если обман вскроется в неудобное время, то можно и в морду получить заработать вполне ощутимые проблемы. Все становится намного проще, если физически присутствовать не надо.\r\n\r\nГерой этой истории родом из Индии. Объективно, европейцам тяжело различать не только китайцев, корейцев, японцев и так далее, но и вообще всех выходцев из юго-восточной и центральной Азии. Мы привыкли обращать внимание на другие особенности внешности, никакого расизма, только факт.\r\n\r\nВ Crossover столкнулись с ситуацией, когда в определенный момент Java-девелоперы разных уровней (вплоть до Senior) начали массово проваливаться еще на первых неделях работы, которые отводятся на так называемый on-board или банальное вникание в проект. Вся магия ситуации заключалась в том, что на этапе-то собеседований все было отлично! И тесты пройдены хорошо, и во время собеседования с непосредственным руководителем кандидат показывал уверенные знания и полную профпригодность! Пришлось разбираться.\r\n\r\nСначала было выявлено, что девелоперы, внезапно забывшие все, что знали о Java и вообще об IT, были родом из Индии. В распоряжении менеджеров были резюме, фотографии и случайные снимки с веб-камер сотрудников. Проверка документов никакого криминала не выявила: вполне реальные люди, с разными фамилиями, возрастом и так далее.\r\n\r\nВскрылся обман достаточно просто. Один из нанимающих менеджеров повнимательнее присмотрелся к своему «разработчику», который внезапно «забыл» все, что знал на собеседовании, и понял, что это не тот человек, с которым он общался перед началом работы, хоть и очень на него похож.\r\n\r\nТесты и собеседования проходил реальный специалист, причем специалист достаточно высокого уровня. Он находил похожих себя соотечественников, после чего от их лица подавал заявки на Java-позиции, которых в Crossover хватает, прикладывал резюме с чужими фото, зная, что в компании много европейцев и американцев, и успешно проходил все собеседования. Так как период онбординга оплачивается 100% с первого дня, дальше дело было за малым: самозванцам нужно было как можно дольше имитировать активность, чтобы к ним не возникало вопросов хотя бы пару недель (оплата происходит еженедельно). Таким образом вполне реальный специалист собрал целую «мини-ОПГ», которая прикидывалась разработчиками, получая за это реальную зарплату. Так было «трудоустроено» около 10 человек. \r\n\r\nСамое печальное в этой ситуации даже не потери финансовые, а потери временные. Сроки разработки, конечно, сорваны не были, но ситуация неприятная. И вскрылась не сразу, просто потому что никому и в голову не могло прийти, что такая схема вообще возможна.\r\n\r\nИстория №2. Трудности перевода\r\n\r\n\r\nСкажите честно, все довольны транслитацией своего имени-фамилии в официальных документах? Я вот постоянно сталкиваюсь с тем, что вместо Aliaksandr (транслит с белорусского) меня норовят обозвать Alexandr, Alexander, Aliaksander и так далее, кто во что горазд. Как-то раз меня даже чуть не пустили на самолет, потому что приглашающая сторона не поверила фотографии разворота паспорта и решила, что пусть я буду «Alexandr», благо, в родной авиакомпании к таким казусам уже привыкли и пустили на борт. А если у вас есть буква «Я» в имени или фамилии, то там вообще творится ад, от банального «Y», до комбинаций «IA», «YA» и даже «JA». \r\n\r\nПодобную лазейку использовал еще один разработчик-самозванец. Ну, самозванцем в полном смысле этого слова он не был, все же человек являлся специалистом, но жажда наживы оказалась сильнее голоса совести.\r\n\r\nОднажды один пакистанец заметил, что у него есть два документа, подтверждающих личность, в которых его имя-фамилия написаны немного по-разному. Обычный человек либо поменял бы один из документов, либо решил никак эту «уязвимость» не эксплуатировать, но не наш герой.\r\n\r\nНаш пакистанец по разным документам подал заявки сразу на две разные позиции. Он успешно прошел тестирование и этап собеседования, после чего приступил к работе на «два фронта». Казуса ситуации добавляет то, что хоть он и устроился в разные команды, но умудрился попасть под начало к одному и тому же руководителю разработки (который курировал сразу несколько команд), что немного ускорило процесс раскрытия махинации.\r\n\r\nВ отличие от менее смышленных читеров, наш пакистанец был в курсе и трекера, и возможности съемки с веб-камеры, поэтому подошел к процессу двойного трудоустройства с умом. На разных позициях он работал в разное время, немного менял внешность через прическу, ставил ноутбук под разными углами для «разработчика №1» и «разработчика №2», чтобы снизить сходство, стабильно переодевался перед стартом работы. \r\n\r\nСгубило его то, что человек физически не способен продуктивно работать 80 часов в неделю (два по 40, само собой). И если его первый «аватар» показывал приемлемый код, то на второго сил уже не хватало. Проработал он в таком режиме чуть больше месяца. Возможно, пакистанец бы сохранил бы одну из своих позиций и попал бы под увольнение только на второй, где были просадки по результатам, но сгубило его то, что, как говорилось ранее, он умудрился попасть под руководство одного человека. Когда руководитель стал анализировать происходящее, заглянул в документы и присмотрелся к двум своим нестабильным новичкам повнимательнее, обман раскрылся. \r\n\r\nИстория №3. Братья-близнецы\r\n\r\n\r\nКаждый в детстве мечтал о брате-близнеце, который бы ходил за него в школу. Есть и истории, когда близнецы эксплуатировали свою схожесть и один из них отдувался за двоих на экзамене или при собеседованиях. Примерно такая же ситуация случилась с двумя братьями-близнецами из уже упоминаемой нами Индии. \r\n\r\nВсе началось вполне буднично. Новый кандидат, тесты, собеседование, успешный старт трудовой деятельности. Однако через несколько недель стало происходить что-то странное: разработчик выключал трекер, возвращался через несколько часов и вместо отличного кода начинал писать какую-то непонятную дичь. Потом этот этап прекращался, трекер выключался, а на следующий цикл возвращался «хороший» разработчик-профессионал.\r\n\r\nК стыду менеджмента, первая мысль была, что парень по-черному пьет, вот прямо бухает. Потом в пьяном виде садится кодить, у него получается что-то совершенно дикое, он идет отсыпаться, после чего на трезвую голову вспоминает все то, что знает о разработке. Причем во время бесед кандидат всячески отрицал факт того, что он периодически впадает в неадекватное состояние, да и созвоны и переписка с ним говорила о том, что версия с алкоголем или другими веществами несостоятельна. \r\n\r\nПосле внимательного разбирательства, анализа переписок и активностей удалось наскрести аргументов в пользу того, что с одного аккаунта работает два разных человека и вывести братьев на чистую воду. На вполне логичный вопрос, зачем это было нужно брату-профессионалу, который был вполне себе неплохим девелопером, последний четкого ответа дать так и не смог. \r\n\r\nВместо морали\r\nВообще на территории СНГ самозванцев исчезающе мало. Есть в нашем обществе «великие комбинаторы», которые, следуя заветам классиков, идут к успеху своим тернистым путями, но их число колеблется на уровне статистической погрешности. Да и других кроме IT сфер для их деятельности более чем достаточно. \r\n\r\nЛично для себя я сделал простой вывод: борьба с самозванцами в IT появилась изначально в крупных компаниях, которые еженедельно собеседуют сотни человек, в том числе и удаленно. Отсюда и тупые вопросы, и несколько этапов, и тестирование. В случае крупных организаций, которые постоянно нуждаются в девелоперах и испытывают кадровый голод, подобный подход частично оправдан: самозванцу намного легче затеряться в плотном потоке кандидатов при собеседовании в крупной международной организации. \r\n\r\nПоэтому когда западные компании вышли на международный удаленный рынок труда, они стали искать способы выявить некомпетентных соискателей и отсечь их еще на этапе собеседования. Вот только проблема в том, что дурной пример заразителен, а реализация, чаще всего, хромает на обе ноги. \r\n\r\nВсе HR, с которыми я беседовал, единогласно утверждают, что многие компании в СНГ откровенно перегибают палку в плане поиска самозванцев. Бесконечные авантюристы характерны для менее благополучных регионов. И если в России вакансия с зарплатной вилкой от 6 до 10 тысяч долларов вызывает настороженность и скепсис, мол, «тут есть подвох! Я его чую!», то в Индии, Пакистане или условном Бангладеш эта же вакансия с такой же вилкой вызывает ажиотаж и элементы массовой истерии. Просто потому что для них недельный чек 1000-2000 долларов равняется заработку за год и ради его получения многие готовы на что угодно. \r\n\r\nСобеседования же в небольших и средних компаниях с наличием физического офиса, которые построены по принципу «мы пытаемся отсеять самозванцев» вообще не имеют никакого смысла, как не имеет смысла и ограничение разработчиков в использовании поисковиков. Девелопер — это человек, который обладает не только большим объемом знаний, но и способностью быстро искать и интерпретировать найденную информацию. Банально потому что языки программирования постоянно развиваются, появляются новые инструменты, фреймворки и практики. Так что если на собеседовании вам задают туповатые, по вашему мнению, вопросы, нужно смотреть на размер компании. \r\n\r\nЕсли компания большая (международная), то, скорее всего, это всеобщий регламент по всем филиалам и, вполне вероятно, даже интервьюер будет не в восторге от происходящего. А вот если компания на международную не тянет, то, к сожалению, вы столкнулись с самодурами, которые посетили пару заокеанских тренингов, прочитали несколько умных книг по найму, но так и не поняли, что все написанное и рассказанное — это не про них. Не доросли еще. Вот от таких нанимателей на самом деле стоит бежать без оглядки.	https://habr.com/ru/company/crossover/blog/424701/	8363484a-393a-4b59-ba9d-f6f85d884f47
13c593d6-4c06-450f-a346-3f9b42e9437a	EA представила на Е3 новую часть C&C. И на это физически больно смотреть	C&C; стратегии; RTS; бабах; пост воскресного вечера; закопайте стюардессу	TL;DR: это C&C для мобилок.\r\n/thread\r\nЕсли вы счастливый человек с личной жизнью и не заходили в сеть на выходных, то, вероятнее всего, вы пропустили коллективный крик тысяч фанатов C&C в частности и жанра RTS в целом, который прокатился по всему земному шару после презентации компании EA на игровой выставке E3. Казалось бы, EA из года в год достигает дна: селфи в Sims, лутбоксы в StarWars, новый политкорректный трейлер BF V. Каждый раз, наблюдая за тем, как компания, которая подарила мне детство, фразу «EA Games, challenge everything» и «Эрон-дон-дон» в NFS Underground, методично, с неистовством копает себе репутационную могилу, мне становится дурно. \r\n\r\nТо, что EA в очередной раз выстрелили себе в ногу подтверждает и реакция публики на трейлер игры на YouTube. На момент написания этого поста соотношение лайков/дизлайков составляет 1,1 тыс. против 21 тыс. Ниже, собственно, сам трейлер. Уберите от экранов беременных женщин, лиц с неустойчивой психикой, детей и собак:\r\n\r\n\r\nУсловно, мой локальный «бабах» можно разделить на две части: «Как обосновывают это сторонники компании» и «почему они не правы». \r\n\r\n#NotMyCNC\r\nНачнем с того, что EA уже похоронили одну легендарную RTS из семейства C&C. Речь идет о серии Red Alert, права на которую были беспощадно проданы китайцам. Последние в лучших традициях запилят версию для Android и iOS с Юрием и донатом, в этом даже не надо сомневаться.\r\n\r\n\r\n\r\nРеакция аудитории на подобное телодвижение была вполне предсказуема: еще невыпущенную игру «распяли», EA пробило очередное дно, а компания Tencent — непосредственный разработчик из Китая — был обвинен в опошлении славного RTS-наследия. Уберегло EA от еще большего гнева только то, что релиз состоится исключительно в Китае, так что эту дичь остальной мир не увидит. А, как известно, что происходит в Китае там же и остается. Как в параллельном мире. \r\n\r\nНо на этом насилие над C&C не прекратилось. Сейчас, спустя несколько месяцев после анонса китайского RA для мобилок, EA со сцены главной игровой выставки планеты презентует мобильную версию C&C под названием «Rivals». Причем в трейлере даже мелькают элементы богомерзкого гексагонального геймплея. «Это фиаско, братан.»\r\n\r\nЛогика компании, впрочем, крайне проста:\r\n\r\n\r\nрынок мобильных игр растет;\r\n«подъем» по баблу там чудовищный;\r\nпипл схавает;\r\nконкурентов на PC нет.\r\n\r\nЭто подтверждают и редкие комментаторы, которые говорят о том, что «стратегии никому не нужны, люди хотят быстрых и простых развлечений». А тут мы перейдем к другой, более приятной публикации. Точнее, я, как старый RTS и TBS-беженец поделюсь своим опытом выживания в современном мире «интерактивных развлечений» с лутбоксами и политкорректностью. Точнее, сейчас я вам докажу, что EA пробили очередное дно, а их маркетологи не способны оценить текущий рынок стратегий, просто открыв Steam.\r\n\r\nПочему рынок стратегий жив\r\nЕсли вы фанат жанра TBS, а конкретно серии RA, то чтение дальше допустимо только при наличии ~150-200 свободных часов в ближайшие пару месяцев. Потому что хуже тяжелых наркотиков. И пока EA и прочие поставщики «геймплейной жвачки» пилят очередной «эксклюзивный опыт в интерактивных развлечениях», любимый нами жанр тихо-тихо поднимает голову. \r\n\r\nИ я даже не буду приводить в пример провальных «Казаков 3», хотя попытка была достойной самим фактом попытки. А расскажу о паре проектов, которые разорвали топы продаж Steam в последние полгода.\r\n\r\nНапример, небольшая студия Numantian Games, которая была основана в 2013 году (штаб-квартира в Испании) и уже в 2014 выпустила свою первую игру Lords of Xulima. Хитом игра не стала, но получила массу теплых отзывов в Steam за приверженность олдскульным традициям и механикам. Об этом говорил, кстати, сам директор и главный гейм-дизайнер студии в одном из своих интервью. \r\n\r\nА вот уже в декабре 2017 состоялся выход в ранний доступ игры, которая доставляет физическую боль: They Are Billions. Фактически, игра крайне похожа на смесь RA и SC в стим-панковском (дизель-панковском) сеттинге зомби-апокалипсиса. \r\n\r\nЗа время зимней распродажи Numantian Games продали полмиллиона копий (от $10 до $25 в зависимости от региона. Для CIS — $14,99, РФ — 699 руб.) и почти все это время провисели в топе Steam. И на секунду: проект находится в активной разработке, есть только один режим «выживание», пока нет сюжетной кампании, мультиплеера или кооператива. Полмиллиона копий игры для мазохистов от никому неизвестной студии. Максимум, что было сделано для продвижения — куплено пару вечеров у популярных стримеров на Twitch, а дальше пошла цепная реакция. Вообще, игра заслуживает отдельного обзора, особенно с учетом добавления новых механик, но стоит отметить, что на базовом уровне очень многое заимствовано из SC, RA и классического уже жанра Tower Defence. Короче, коктейль из того, что по мнению Electronic Arts мертво и чему место только в казуальном сегменте для мобилок. \r\n\r\nЕще можно вспомнить прекрасный релиз от небольшой польской студии игры Frost Punk, которая вышибает слезу своей музыкой, а по визуальному исполнению кажется, переплюнуть ее вообще невозможно. И это вполне себе стратегия с несколькими миссиями, без онлайна, мультиплеера и даже реиграбельности, что приближает ее к новеллам, а не к жанру RTS.\r\n\r\nДа банально вспомнить о том, с какой помпой Blizzard заявила о выпуске ремастеринга StarCraft и сколько хайпа было вокруг этого события (да, мы все еще ждем WC4)\r\n\r\nИ тут задаешься логичным вопросом: Electronic Arts, что с вами не так? Люди покупают сотни тысяч копий стратегий, и речь не о гигантах типа Civilization, Europa или Stellaris, а о совсем камерных проектах. Blizzard выпускает в 2018 году ремастеринг игры двадцатилетней давности, а вы хороните легендарную игровую вселенную и обрекаете ее на прозябание на мобилках? У вас там грибы прокисли или что? Сейчас наиболее активная часть населения представлена людьми 1980-1995 годов рождения. И эти люди выросли на RTS и TBS, на сериях SC, C&C, HoMM и прочих. Почему вы не учитываете этого? \r\n\r\nКонечно, вопросы риторические, но все же. Вообще, публикация писалась не только с целью «погореть» на EA, но и спросить у сообщества: а в каких RTS, TBS или прочих стратегиях вы проводите свободное время? Приходится ютиться на фанатских HD-переизданиях HoMM3 или вы как и я ищите что-то новое в этом бесконечном океане релизов игр с «уникальным опытом»?	https://habr.com/ru/post/413797/	8363484a-393a-4b59-ba9d-f6f85d884f47
1b6f8a3a-2877-4d2c-81fa-44b5f7c9f6a6	Открытое письмо к маркетологам и прочим пиарщикам, причастным к контенту на Хабре и других ресурсах	Хабр; маркетинг; посты; контент; письмо	Короче, настало время. Присаживайтесь поудобнее\r\n\r\nНа площадке я достаточно давно. Кто-то знает меня в лицо, кто-то никогда не видел, а еще у меня есть собственный клуб хейтеров благодаря моей работе в качестве редактора ХХ и ГТ. Сейчас я не буду обсуждать «редакторский» контент, тут много подводных камней, а скажу пару слов о ведении корпоративных блогов и всего, что касается этой темы. Надеюсь на адекватное обсуждение. \r\n\r\nДисклеймер: это не пост хейта или срача на тему «компании — вон с Хабра!», а вполне обоснованный текст на тему того, что стоит делать, чего не стоит делать и как с этим дальше жить. Он зрел в моей голове не один месяц, учитывая, что я уже пятый год зарабатываю на хлеб с маслом написанием постов. Надеюсь, что текст найдет отклик у аудитории и ситуация на платформе немного улучшится. \r\n\r\nЭтим постом я хочу достучаться до многочисленных маркетологов, которые пасутся на моей родной «полянке» и тут же делают не самые приличные вещи, которые, в итоге, бьют и по мне в том числе. А еще я хочу поговорить с аудиторией. \r\n\r\nВсе мы знаем тему с «тремя ссылками на текст» и «индексируемым заголовком». Скажу откровенно, большинство маркетологов, которые гордо в резюме пишут «эксперт в сфере Digital», наступают на эти грабли. Но начнем с того, что такое этот самый «диджитал».\r\n\r\nВики мне говорит, что Digital-маркетинг — это некая совокупность практик по продвижению, рекламе и брендированию в сети. Сейчас можно выделить с пяток основных направлений (плюс-минус, само собой): \r\n\r\n\r\nSMM (социальные сети, твиттеры и все остальное).\r\nКонтекстная реклама/баннеры.\r\nCommunity-менеджмент в тех же соцсетях или телеге. \r\nБогомерзкое SEO.\r\nНе менее богомерзкий SEM (Search engine marketing).\r\n\r\nНу и прочие сомнительные практики. \r\n\r\nСейчас 2018 год на дворе. Где-то уже распускаются вишни, а где-то в лесу медведи срут проснулись. Вне зависимости от географии и региона правила для всех едины. SEO, SEM и кликбейтные заголовки остались в 2010-2013 годах, когда поисковые гиганты убили эту мразь новыми правилами и алгоритмами. Но почему-то на это до сих пор наяривают все новые и новые поколения маркетологов.\r\n\r\nУ меня есть закономерный вопрос: что с вами не так? Ну серьезно. Я пишу с 2013 года. Мой первый пост почил и сгинул на старом аккаунте молодого дурачка с ником keepcalm, который я без зазрения совести удалил после 30+ публикаций и начал все сначала. Но даже мне, юнцу 22 лет тогда, в 2012-2013 хватило мозгов понять одну фундаментальную истину:\r\n\r\nЛЮДИ ПРИХОДЯТ В ИНТЕРНЕТ И КОНКРЕТНО НА ХАБР, ЧТОБЫ РАЗВЛЕЧЬСЯ\r\nЧто, читатель, стало неуютно? Ты не такой? Ты профи, который черпает на Хабре полезную инфу и ничего более? Смею тебя разочаровать: если ты приходишь сюда по прямой ссылке, а не через выдачу гугла\\яндекса\\дакдакго\\поисковик по вкусу, то ты приходишь сюда развлечься. \r\n\r\nЭту фразу стоит повторять как мантру всем, кто хочет построить образ своего бренда. Вы не поверите, но эту мантру прекрасно знают маркетологи mail.ru Group или Яндекса, именно поэтому они работают в этих компаниях и получают в месяц больше, чем любой из нас. Этот принцип прекрасно эксплуатирует уже который год товарищ milfgard, когда пишет о МосИгре. Да блин, я сам хотел прикупить у них пару настолок благодаря его текстам! Ни один текст Милфгарда не пиарит МосИгру напрямую: он лишь развлекает аудиторию, а аудитория отвечает ему своей лояльностью. \r\n\r\nЕСЛИ ВЫ ХОТИТЕ ЧТО-ТО ПОЛУЧИТЬ ОТ ПУБЛИКИ, ДАЙТЕ ЕЙ ЧТО-НИБУДЬ ВЗАМЕН\r\nВам нужна конверсия? напишите интересный пост. \r\n\r\nВам нужны новые работники? Напишите интересный пост. \r\n\r\nВам нужны продажи? Напишите интересный пост. \r\n\r\nПросто, да? \r\n\r\nВот только в сознании стандартного маркетолога и такого же стандартного клиента интересный пост для него и интересный пост для аудитории — это диаметрально противоположные вещи. \r\n\r\nАгрессивное «впихивание невпихуемого» в текст. Впаривание. Самые худшие практики из области рекламы. Англоязычные кальки. Неверная оценка потребностей ЦА. \r\n\r\nВсе это дерьмо сейчас правит бал и это приводит к тому, что нам с вами приходится морщиться, будто бы от зубной боли. \r\n\r\nВместо создания персонального бренд-спейса в интернете большинство компаний идет по пути моментальной конверсии и виноваты в этом многочисленные менеджеры. Им надо оправдать расходы на блог, на мои или любого другого автора гонорары, на собственное содержание. И поэтому все они бегут, будто бы слепые в сторону пропасти, по пути моментальной конверсии.\r\n\r\n«Мы запускаем блог и нам надо показать, что это делается не просто так. Нам нужны переходы на сайт». Вы даже представить не можете, сколько раз я читал подобные сообщения во время рабочей переписки с представителями заказчика. Моментальная конверсия, погоня за сиюминутной прибылью — это бич не только Хабра, но всего современного интернета.\r\n\r\nКто-то называет мою работу копирайтингом и это не далеко от истины, с другой стороны это можно охарактеризовать редким понятием «бренд-журналистика». Все так или иначе крутится вокруг создания позитивного образа компании, как ни крути. Без стабильного «белого» образа дружелюбной к сообществу структуры добиться приемлемых результатов невозможно.\r\n\r\nМаркетинговый инструментарий безнадежно застрял в прошлом. «Старый конь борозды не портит», твердят себе маркетологи, которые о чем-то догадываются, применяя вновь и вновь свои токсичные для бизнеса практики. «Меня так научили, значит это правильно», вторят в унисон вчерашние студентки и слушательницы курсов по digital-маркетингу, которые читают для них люди, не продавшие в интернете за последний год даже шариковой ручки. \r\n\r\nВся эта шобла занимается постоянным самообманом, пытается «выплыть» на горбу практик, которые перестали работать минимум пять лет назад. Что сейчас есть брендирование в сети? У широких масс? Если мы говорим о людях, отличных от сферических «мамаш в декрете»? Мы говорим об индустрии развлечений.\r\n\r\nВедь это так просто: написать пост интересный, мягкий, которым бы хотелось поделиться с товарищем за соседним столом, который бы не вызывал отторжения. Это на самом деле просто: достаточно засунуть в жопу собственные амбиции в плане конверсии и моментальных продаж и приготовиться работать 2, 3, 6 месяцев в одном высоком темпе. Писать, переводить, искать интересные и полезные аудитории темы, работать на одной площадке. \r\n\r\nСейчас маркетологи сжигают тысячи долларов, устраивая «ковровое бомбометание» по всем площадкам, до которых могут дотянуться, вместо того, чтобы банально привести в порядок собственный сайт и завести колонку о разработке продукта. Я вообще удивляюсь, как эти люди не забывают надевать по утрам штаны, учитывая очевидность данного решения.\r\n\r\nНа самом деле я далеко не шагающий по воде Иисус. В моей практике были и тексты и целые клиенты, которыми не стоит гордиться. Я продавался за 30 серебренников, писал паршивые тексты с тремя ссылками на пост, агрессивной рекламой и прочим буллшитом. При этом я крепко сплю и не мучаюсь угрызениями совести, потому что я всегда пытался переубедить моих клиентов, доказать, что они творят откровенную… фигню. К сожалению, только один из десятка, в лучшем случае, прислушается к мнению наемного копирайтера. Потому что то, что я говорю им, идет вразрез со всем тем, что они до сих пор знали о маркетинге и продвижении. Вот такой вот договор с собственной совестью, сорян.\r\n\r\nКак это? Мы напишем пост без единой ссылки в тексте?\r\n\r\nЗачем нам запускать цикл постов о разработке на Хабре? Давайте пропиарим наш HR-ивент!\r\n\r\nУ нас крайне ограниченный бюджет.\r\n\r\nМы считаем, что вы неправы. \r\n\r\nВообще, подготовка любого контента для компаний — это как попасть в зазеркалье. Тебе платят солидные деньги за то, чтобы ты сделал свою работу, но при этом в итоге ты делаешь так, как нравится дяде в малиновом пиджаке. Нет на российском рынке людей, которые бы могли признать, что кто-то может лучше разбираться в рекламе и маркетинге, чем они. Ведь это презренная профессия — пиарщик. В сознании масс руководителей, это профессия для тех, кто умеет просто громко кричать.\r\n\r\nВсем срать на психологию масс, личности, отдельных социальных групп. Сверху можно посыпать всю эту историю игнорированием норм русского языка (который намного сложнее, чем кажется) и откровенным непониманием, что такого в «этих ваших текстах». \r\n\r\nВлияние западных коллег\r\nВот эту телегу я вообще вынесу в отдельный раздел, потому что от него просто горит. Скажите честно: вы знаете русский язык? Ну вот, мол, целиком? Со всеми его нюансами, приемами, подводными камнями? Да банально чем он отличается от английского? \r\n\r\nЛично мне кажется, что русский до конца я не постигну и до конца своей жизни. Без шуток. На изучение языка требуется отдать годы жизни, и еще столько же — чтобы научиться им достойно пользоваться. И я невероятно бомблю от англоязычных «best practice» которые отечественные маркетологи пытаются экстраполировать на русскоязычный контент. \r\n\r\nБесконечное дробление на более мелкие абзацы, паршивые конструкции, односложные предложения. Не знаю как вы, а я за километр вижу неприглядный перевод с английского, хоть сам говорю на «всемирном» еле-еле и с большим усилием. Сам русский язык сопротивляется инородным элементам и практикам, выработанным для языка английского, немецкого, французского. Можете почитать о том, что такое синтетические и аналитические языки, поймете, о чем я. И в этом абзаце нет ни грамма «ваты» или «духовности», просто констатация факта, что мы говорим на совершенно ином по структуре, форме и природе языке, чем половина мира.\r\n\r\nВ жопу ритм. В жопу слог. В жопу динамичную, ликвидную размерность фраз и предложений. В жопу сложные конструкции, ведь они так утомительны для «аудитории». (Вы устали? Не думаю.) Вон, у наших коллег из чикагского офиса этот пост прокатил, значит, что и у нас прокатит. \r\n\r\nНЕ ПРОКАТИТ\r\nОтдельно стоит поговорить о лонгридах. «700 слов текст». «Не больше двух страниц 14 кеглем». «5000 знаков на статью». Алло, ребята! Тут уже написано 10 тысяч знаков и я уверен, что большинство продолжает читать этот пост! \r\n\r\nСейчас лонгрид — это самый популярный формат контента на западе, просто маркетологи боятся в этом признаться. Вообще, большие и обстоятельные тексты всегда пользовались успехом, потому что на «полотнище» успеваешь обсудить с читателем все, что хотелось бы обсудить. \r\n\r\nОдин из самых успешных переводов в моей практике — это чудовищный по размерам перевод поста одного швейцарца, который я делал нон-стоп более 14 часов, не вставая со стула. Многие наверняка поняли, о каком посте я говорю. И оригинал, и многочисленные переводы этого поста, в том числе и мой, заняли достойное место как в топах на момент публикации, так и в истории. Откуда эта боязнь обширных текстов? Почему маркетологи стремятся впихнуть в что-то размером с новостную заметку десяток тезисов и пяток ссылок на свой продукт?\r\n\r\nДля меня это загадка, честно. \r\n\r\nПостскриптум\r\nЗачем я написал этот пост? А не знаю, задница горит, наверное. Отчетливо я понимаю одно: будто бы со страниц трудов Ницше в сферу рано или поздно придет сверхмаркетолог, который начнет делать контент для публики, а не для своего работодателя. И практики его будут услышаны и приняты на вооружение многочисленными амбициозными девочками-пиарщицами. И возникнет новый род пиарщиков и новая парадигма контентного продвижения, где реклама будет на самом деле нативной, брендирование — эффективным, а посты — интересными. И в этот момент небеса разверзнутся и начнется второе пришествие произойдет революция в контентном маркетинге, он станет ближе к журналистике и творчеству. И революция эта изменит нашу сетевую жизнь к лучшему, радикально уменьшит количество буллшита в лентах и позволит черпать полезную и интересную информацию не ютясь, будто прокаженный, на двух с половиной ресурсах, разгребая кучи навоза в поисках текстовых бриллиантов. \r\n\r\nЕдинственное, чего я искренне хочу — это дожить до этого момента.	https://habr.com/ru/post/354982/	8363484a-393a-4b59-ba9d-f6f85d884f47
3a9e7f2d-f770-42f8-97bf-58a11607ec62	19 лет на одном языке. История о том, как олимпиадник из Беларуси стал C++ Chief Software Architect	Разработка; фриланс; crossover; Hiring Tournament; турнир; ивент; Беларусь; C++; плюсы; алгоритмы; алгоритмические задачи; программирование; олимпиада; олимпиадное программирование	Кажется, у компании Crossover становится традицией анонсировать свои карьерные турниры, рассказывая о людях, уже работающих по специализации, на которую пойдёт отбор. Но сегодняшний случай особенный: хотя «примерка» на роль Chief Software Architect 7 апреля проходит в Москве, наш «Chief Software Architect дня» живёт даже не в России, а в соседней для дефолтной хабранации республике. Видимо, поэтому Crossover предложил мне взять у него интервью — может, они надеялись на какую-то особую белорусскую перспективу в разговоре двух белорусов, двух минчан и двух фрилансеров?\r\n\r\nВпрочем, это сейчас Сергей rserge Рогач живёт и работает в Минске. Будущий Chief Software Architect компании родился в городке-десятитысячнике Глубокое Витебской губернии, в подбрюшье Браславских озёр — и эта череда топонимов словно сама уносит дальше, куда-то в сторону леса Фангорн, лежащего в отрогах Мглистых гор…\r\n\r\n\r\nПоднимите руки, кто на Браславские озёра хочет больше, чем в Чикаго?\r\n\r\n…только Сергей после девятого класса поступил в лицей при БГУ — одну из самых престижных школ Беларуси при главном университете страны. Учиться там в 2001–2003 годах было никому не скучно: аббревиатура БГУ грохотала как название одной из самых смешных команд КВН в истории, а Сергей два года подряд попадал в четвёрку старшеклассников, представлявших Беларусь на международной олимпиаде по программированию.\r\n\r\n«Я в принципе не считаю, что сильный программист обязательно должен быть сильным математиком».\r\n«В 2002 году мы летали в Корею, в 2003 — в США. Группой по четверо — но мы не были командой. Командами выступают в университете. На школьных олимпиадах обычно каждый сам за себя». \r\n\r\nОба раза программа олимпиады была классической: выбранным языком программирования надо было максимально быстро и эффективно решить поставленную алгоритмическую задачу. \r\n\r\n«Многие участники тогда использовали паскаль, но я предпочитал C++, с которым познакомился еще в 1999 году и на котором, кстати, пишу до сих пор», — говорит C++ Chief Software Architect компании Versata Сергей Рогач «Я выбрал для себя пару С/С++ еще в школьные годы, причем сознательно. Распространенный тогда паскаль был значительно медленнее и менее распространён в производственной среде».\r\n \r\nИз обеих поездок он привёз бронзовые медали, но не за третье место:\r\n\r\n«Они раздавались всем, кто вошёл по баллам в первые 50% участников. В моём случае это было сотое место в Корее и сто двадцать восьмое — в США», — даже не думает привирать Сергей, показывая свою «бронзу».\r\n\r\n\r\nВпрочем, это тот случай, когда олимпийский принцип «главное — участие» — не просто слова. Сергей отмечает, какие «повадки олимпиадника», наработанные тогда в школе, он ценит до сих пор: во-первых, привито умение быстро решать задачи. Во-вторых, получен навык писать чистый и аккуратный код, без которого «ловить» на олимпиадах уровня выше района нечего.\r\n\r\n«Олимпиады — как вид обучающей деятельности отлично развивают полезные навыки. Я говорю не о конкретных знаниях о языках программирования или каких-то «фишках», а об общей дисциплине: все олимпиадные задания требуют от тебя выжимать «максимум» как из кода, так и из собственных мозгов. С одной стороны, даже если твоя программа будет верной, но работает медленнее, ты проиграешь. С другой — на долгие раздумья нет ресурсов. Ты должен знать, как ты будешь реализовывать собственное решение «здесь и сейчас». Это отличный опыт, хоть и пятнадцатилетней давности, закалка, которая не имеет срока годности».\r\n\r\nВыбор между карьерой и наукой \r\nКазалось бы, какой там выбор: после лицея БГУ программиста-олимпиадника мог ждать только факультет прикладной математики и информатики БГУ.\r\n\r\nСейчас, в 2018 году, сильные кафедры есть и в БГУИР (бывший Минский РТИ, думаю, эта аббревиатура будет более понятна не-белорусам), но в 2003–2004 годах ФПМИ «пылесосил» всех потенциальных программистов и сильных математиков. Впрочем, математиков он «пылесосит» до сих пор — только не все выдерживают учёбу на этом факультете.\r\n \r\n«Но я никогда не был сильным математиком — многие ребята на моём фоне были монстрами науки. Я в принципе не считаю, что сильный программист обязательно должен быть сильным математиком. Наука? Вполне возможно, варианты и выходы, как у «олимпиадника» у меня были. Но трудность быть учёным в том, что они не сами себе создают условия, а работают в созданных. И они должны быть достойными, что на ставку научного работника в Беларуси невозможно. Так что ещё на втором курсе БГУ я начал работать, а в конце четвёртого и вовсе его бросил».\r\n\r\nЗа те несколько лет Сергей успел потрудиться и набраться опыта сразу в двух крупных международных аутсорсинговых компаниях — Itransition и EPAM — которые ещё в начале нулевых открыли офисы в Минске. Впрочем, эти названия могут оказаться знакомы многим: у EPAM есть большой офис в Новосибирске, да и у «Итры» география не самая скромная.\r\n\r\nВеликое посольство в Голландию\r\nОт аутсорса до фриланса — один шаг, который Сергей сделал в 2008 году, поступив в Амстердамский университет и уехав жить в Нидерланды, чтобы завершить своё образование. Не без ностальгии, конечно же: \r\n\r\n«Дома, в БГУ, были одни преподаватели, у которых реально «горели глаза», и которые были невероятно сильны как в своем предмете, так и в научном плане. И были другие, которым было откровенно плевать: читают себе с бумажки лекции, «часы» отрабатывая. В Амстердаме же всё было «ровно». Я не повстречал каких-то преподавателей-звёзд, за которыми студенты бегали табунами, но и не увидел тех, кто «отбывал», а не работал. Зато, как мне кажется, белорусская школа может вырастить учёных-звёзд. А голландская — обеспечить стабильный уровень массового образования. У обеих систем есть свои плюсы и минусы».\r\n \r\n\r\nКогда ты в Голландию поехал ума-разума набираться да обучение завершать\r\n\r\nЗакончив университет в 2010 году со степенью магистра по специальности «Искусственный интеллект», Сергей снова должен был принимать решение. Необходимость учить новый, не самый распространённый и потому не самый универсальный язык, непривычное устройство государственно-бюрократических реалий и дороговизна жизни (а Амстердам — один из самых дорогих городов Европы!) — это всё попадало на минусы. \r\n\r\nПопытки слезть\r\n«Честно говоря, по возвращении домой я думал фриланс сменить на «нормальную» офисную работу. Но каждый раз, как я закрывал очередной крупный проект и приступал к поискам постоянного места, подворачивался заказ, который был «вкуснее», чем бейджик, чай-кофе и общение с коллегами. В общем, так я на фрилансе и остался, набрав «стаж» уже около семи лет: новые клиенты, заказы, ведение ИП, бухгалтерии и прочее. Вообще, сейчас жизнь в этом плане стала намного проще, во всяком случае, в Беларуси; раньше надо было каждый квартал кататься в налоговую и подавать декларацию на бумаге. Последние несколько лет внедрили систему электронного декларирования, что заметно упростило жизнь. Впрочем, даже упростившаяся бюрократия, напрягает меня самим своим фактом до сих пор. Но что поделаешь — подавать декларации надо.\r\n\r\nСложнее всего было в однокомнатной квартире с маленьким ребенком. Дочери надо спать, а мне — работать. Но, в результате, именно благодаря моей работе нам больше не приходится стоять перед подобным выбором».\r\n \r\nИ переход Сергея на работу в группу компаний ESW Capital, получился, наверное, самым ровным среди прочих из историй в этом блоге: уже на фрилансе, уже со своей бухгалтерией и проживая в Беларуси, где очных турниров Crossover пока не проводил, Сергей попал на «витрину» Crossover в очередной период поиска клиента в качестве потенциального С++ Chief Software Architect буквально не вставая с кресла. Тут выстрелили все ружья на стене: пригодились и алгоритмические задачи, на которые его натаскали ещё в школе, и многолетний опыт удалённой работы. В итоге Сергей стал работать для компании Versata.\r\n \r\n«В числе прочего, я занимался приложением, которое оптимизирует работу сети, потом балансировщиком баз данных, сейчас оптимизирую Cypher запросы и Neo4j базу данных для поиска анти-паттернов. Работа над этими проектами дала мне более глубокие знания Linux».\r\n \r\nНаука же его похоже потеряла. И не только белорусская: \r\n\r\n«Мы думали с женой об иммиграции, но пока действительно стоящих предложений не поступало. Да и даже „там“, на Западе, чтобы комфортно себя чувствовать и не ломать голову над месячным бюджетом, надо иметь степень не ниже PhD, которую ещё нужно получить. Дело не в деньгах как таковых. А в возможности устроить свою жизнь по самым базовым критериям достаточно комфортно, чтобы о комфорте больше не думать. Я уважаю выбор тех, кто готов бороться и заниматься наукой «за идею». Но свой выбор в пользу коммерческой разработки я сделал уже давно. \r\n\r\nСейчас, спустя более пятнадцати лет работы, я тружусь на позиции С++ Chief Software Architect. Если надоест, я всегда могу вернуться к классическому фрилансу — мой опыт позволит найти крупный проект на полгода-год».\r\n \r\nИ это, кстати, логично: часто эмиграция перестаёт быть фетишем, когда ты в состоянии и дома себя достойно прокормить. В XXI веке «где родился — там и пригодился» не безнадёжный фатализм, а свободный выбор счастливых людей.\r\n\r\nИ если вы на этих выходных в Москве — можете попробовать сделать свой выбор на «Кадровом турнире» по отбору профессионалов, способных претендовать на контракт Chief Software Architect или Software Engineering Manager. Оценить свои силы и уровень можно уже в эту субботу.	https://habr.com/ru/company/crossover/blog/352832/	8363484a-393a-4b59-ba9d-f6f85d884f47
744be885-bd56-486b-afc2-5ad071a26fa8	Вышел перевод книги Нила Стивенсона «Семиевие»	Семиевие; научная фантастика; книги; читальный зал; пятница; обсуждение.	В свободной продаже (как в бумаге, так и электронные версии), появилась новая научно-фантастическая книга популярного американского писателя Нила Стивенсона «Семиевие». Переводом и издательством книги занимались ребята из FanZon. Книга, как и сам автор, обласкана множественными восторженными отзывами критиков и прочими литературными премиями, которые даются современным фантастам. \r\n\r\nМногие поклонники жанра с нетерпением ждали перевод, а кто-то и вовсе читал в оригинале. Спойлерить сильно не буду, скажу одно: книга про космос. Кто хочет сформировать собственное представление о новом труде Стивенсона, который, конечно, знает, как надо писать книги — под кат не ходите. Все остальные могут ознакомиться с моей позицией, почему я осилил только половину бесплатного превью с месяц назад и книгу покупать не намерен. И не потому, что я жлоб или пират, а потому что местами все прямо вот очень плохо даже в начале. \r\n\r\nПонимаю, тема токсичная, но давайте обсудим, что с ней, книгой, не так. Все что написано дальше — субъективизм чистой воды. Я предупреждал. \r\n\r\nСлог\r\nКто читал мои статьи знает: я тяготею к массивным, сложным, даже иногда тяжелым для восприятия с первого раза конструкциями. По опыту перевода с английского могу сказать, что и на этом языке можно строить поистине виртуозные фразы. \r\n\r\nСлог «Семиевия» банален. Кажется, целевая аудитория книги — люди образованные или, минимум, тяготеющие к знаниям, но то, как написана книга не впечатляет. Простые односложные конструкции, достаточно примитивный язык, который то тут, то там перемежается технической терминологией. Неизвестно, виной тому сам автор, редакторы в издательстве, которые захотели «хапнуть» аудиторию пошире (да кому я вру, конечно хотели), или наши не слишком изобретательные переводчики. Я придерживаюсь мнения, что сыграли все три фактора, потому что как рукопись не насилуй, но что-то же в ней должно было остаться от оригинального слога, если он там был. \r\n\r\nВ случае с «Семиевием» чуда не получилось. Чтение эстетического наслаждения не доставляет. Возможно, я предвзят, но если у вас нет проблем с языком Достоевского, Толкиена или Драйзера, и вам даже нравилось, то в «Семиевии» вы этого удовольствия не получите. Для примера, я говорю о вот таких конструкциях, которые сплошь и рядом у того же Достоевского, чтобы не ходить далеко:\r\n\r\nГенерал чуть-чуть было усмехнулся, но подумал и приостановился; потом еще подумал, прищурился, оглядел еще раз своего гостя с ног до головы, затем быстро указал ему стул, сам сел несколько наискось и в нетерпеливом ожидании повернулся к князю. \r\nЕсть вопросы и к структуре повествования, за которым просто сложно следить, так как многое остается «за кадром». \r\n\r\nТехническая часть и все остальное\r\nСам Стивенсон, кстати, инженер. По этой причине его миры вполне реалистичны и проработаны, что постоянно отмечается в рецензиях на его книги. Я — не инженер, но у меня есть гугл, калькулятор, кое-какие знания механики и здравый смысл.\r\n\r\nОткрывая файл с огрызком-превью «Семиевия» я ожидал почувствовать всю мощь инженерных знаний Стивенсона, логику, здравый смысл, визионерство в плане технологий, ведь дело происходит в недалеком будущем (речь о паре десятилетий вперед). Взамен этому я получил вращающийся (банальный и по многим параметрам неэффективный) пончик-тор диаметром 40 (сорок) метров. То, как его заперли на орбиту, смонтировали и присобачили к МКС Стивенсон тактично умалчивает. Далее автор описывает, что Тор дает вполне комфортную «легкую» искусственную гравитацию которая слегка притягивает к полу и на дает предметам «взмыть со стола или скатиться с его поверхности». Кстати, по описанию автора, большой стол «визуально уходил бы в потолок, если стоять с края комнаты». Интерпретация описания вольная, но, думаю, понятно. Проведя легкие расчеты я получил вполне реальные цифры периода обращения Тора на уровне 39 секунд для создания 0,1g. Все бы хорошо, но почему-то Стивенсон не учел реакцию вестибулярного аппарата и вообще организма при нахождении в таком торе и разницу ускорений для условных пяток и макушки члена экипажа. Также с описанием стола вылазит проблема понимания размеров самого тора.\r\n\r\nДля того, чтобы описанный оптический эффект «ухода стола в потолок» имел место быть, этот стол должен быть длинной не меньше 8 метров, как и само помещение. Вы представляете себе десятиметровый зал для совещаний на орбите? Я нет. Причем, это грубые расчеты «от края до края» по прямой, поверхность стола из-за изгиба тора будет еще больше, собственно, как и комната. И чем внимательнее мы смотрим на наш сорокаметровый тор, тем хуже нам становится.\r\n\r\nЕсли представить, что его внутреннее полезное сечение составляет всего 2,5 метра ( то есть мы говорим об обитаемой части, «трубе», где тусит экипаж), то для тора диаметром 40 метров мы получаем трубу примерным объемом почти 2200 кубометров. Чтобы вы понимали, это комната размером 60х18х2 или почти 1\\4 стандартного (международного) футбольного поля. При этом автор говорит, что даже при наличии 14 человек на станции (а там есть еще модули кроме тора), становится тесновато. Я не исключаю факта, что где-то мог ошибиться с запятой, но, вроде как, не ошибся. \r\n\r\nНу и конечно же, клюква. В книге Стивенсона Роскосмос — это сексистская контора без женщин-космонавтов, которая легко отправляет свои экипажи на смерть, выдавая им «билет в один конец». Немного статистики:\r\n\r\nЕсли залезть в википедию, то мы увидим, что Советы за все время потеряли только 5 космонавтов (последний случай произошел в 1971 году). НАСА же потеряло 19 (!) человек (последний раз в 2003 году, все мы помним), отказалось от шатлов и теперь все смирно летают на страшных русских «Союзах». Кстати, Роскосмос за 25 лет своей истории в составе современной России, вроде как, вообще не нес потерь. Поправьте меня, если это не так. \r\n\r\nНу и конечно же, куда же без русской женщины-персонажа с таким популярным у нас именем как Фёкла. \r\n\r\nИтого\r\nВместо твердой научной фантастики (к которой относят «Семиевие») лично я получил посредственный слог, проблемы с пространственным мышлением у автора, куцые описания «куда, как, чего» и дозу «клюквы» с политкорректностью. Потому что командир на МКС, как и ее помощник — женщины. Да и вообще половина станции — женщины, правда, непонятно, почему, ведь реальная статистика совершенно иная и я не вижу ничего плохого в том, что такой опасной работой занимаются, в основном, мужчины. Я бы даже сказал, это предсказуемо. \r\n\r\nВсе это я «хапнул» при прочтении, примерно, 60-70 страниц превью. Возможно, дальше будет лучше, но весь восторг и желание читать отбили вышеописанные вещи. \r\n\r\nЯ не говорю, что претензии у меня только к тору и женщинам, далеко нет. Это просто самые яркие, так сказать «эталонные» примеры. Проблем у «Семиевия» хватает. Мне кажется, Стивенсон мог бы и лучше, серьезно.	https://habr.com/ru/post/373961/	8363484a-393a-4b59-ba9d-f6f85d884f47
78c8718e-a017-466a-ae8a-d2f2bd75ca9c	Ванечка	ванечка; рассказ; антиутопия; 1984; РПЦ; церковь; наука; мракобесие; ст 148 УК РФ; оскорбление чувств верующих	Привет. Это — очередная фантазия на тему нашего не самого светлого будущего.\r\n\r\nЕсли два года назад актуальной темой была блокировка торрент-трекеров, то теперь проблемой стала ст. 148 УК РФ. \r\n\r\nЭтот тест носит художественный характер и не ставит целью оскорбить чьи-либо чувства.\r\n\r\nПосвящается здравому смыслу.\r\n\r\n\r\nВанечка проснулся рано. Пока окружающие пребывали в сладком плену дремоты, мальчик успел помолиться не только за свое, но и за здоровье патриарха, его помощников и вообще всех служителей церкви, президента, правительства и матери. Именно в таком порядке. После, с чувством выполненного долга, мальчишка включил свой маленький, в корпусе из серого, дешевого пластика безымянный планшет и погрузился в просмотр мультиков по единственно доступному ему детскому каналу. \r\n\r\nНа экране давно знакомый персонаж – монах Феофан, старик с длинной бородой, посохом и огромным золотым крестом на груди, поучал хулиганов, помогал животным и хвалил послушных детей за добрые поступки. В этой серии Феофан объяснял, как важно при посещении церкви рассказывать священникам о плохих книгах, которые могут прятать у себя родители. Например, мультяшный герой утверждал, что не только за чтение, но просто за хранение трудов по физике, биологии или, не приведи Господь, философии, вся семья будет гореть в Геенне Огненной, что подкреплялось язычками пламени за спиной монаха. Ваня любил этот мультик, за его просмотром время летело незаметно. Он слышал, что у других детей есть доступ и к другим каналам, но сам он в это не верил, да и свой планшет показывать кому-то из сверстников служители церкви строго-настрого запрещали. Ваня был послушным мальчиком и верил священнослужителям. \r\n\r\n — Ваня! — Мать позвала мальчика с общей кухни. \r\n\r\nТам, в небольшом помещении четыре на четыре метра, под ее ногами крутилось еще с десяток сорванцов в возрасте от трех до семи лет. Все грязные, чумазые, они орали и так и норовили опрокинуть одну из кастрюль с плиты.\r\n\r\n — Ванюша! — Повторила свой клич мать, в невероятном и противоречащем законам физики движении удерживая в руках кастрюлю с кипятком, — вставай! Мы скоро идем в церковь!\r\n\r\nПока мать звала его, мальчик уже успел натянуть простенькие брюки темно-синего цвета из грубой шерсти, рубашку и пиджачок, который был ему на два размера больше, чем нужно. Но ему еще повезло. Мать смогла отоварить свои последние трудокарты с завидным успехом, и совсем недавно у мальчишки появился не только этот грубый и великоватый ему пиджачок, но и новые туфли. \r\n\r\nНа улице было многолюдно. Целые семейства спешили на воскресную службу, о которой предусмотрительно оповещали работники церкви через громкоговорители, медленно разъезжая по нешироким улочкам рабочего района на покрашенных в черный цвет «Вепрях» с золотыми крестами на бортах. Ваня наблюдал, как их соседи, тетя Агата и дядя Николай, ведут под руки своих четырех детей, с которыми Ваня, правда, был не особо дружен. Ему вообще было сложно найти друзей.\r\n\r\nОн не раз уже слышал, как соседки, будто бы его рядом и нет, особо не стесняясь в выражениях, обсуждали его мать – «еще ту прохвостку»: от мужа ушла, больше рожать не хочет, в церковь ходит неохотно. Мальчик не до конца понимал смысла слова «прохвостка», но подозревал, что маме бы это слово не очень понравилось, поэтому благоразумно помалкивал и лишних вопросов не задавал: мать на оплеухи не скупилась, как и любой встреченный им за недолгую жизнь взрослый. \r\n\r\nТе семьи, что были побогаче — где взрослые работали в полиции, церкви или на иной госслужбе — пошли на автобусную остановку, остальные же нестройными рядами двинулись по пыльным тротуарам в сторону местного прихода, чьи золотые купола монументально возвышались над тридцатиэтажными «столбиками-человейниками» жилых домов. Из любой точки города открывался вид минимум на одну церковь; они, блестя золотом, будто гигантские маяки для верующих, возвышались над прочими строениями и служили немым напоминанием всем жителям о том, кого следует благодарить за их жизнь и здоровье. \r\n\r\nВаня уже всерьез погрузился в размышления на тему предстоящего долгого пути, как вдруг где-то впереди поднялись крики:\r\n\r\n — Богохульник! Богохульник! Держите еретика! \r\n\r\nСпустя пять минут, когда мальчик с матерью подошли поближе, глазам Ванечки открылась уже привычная любому жителю Москвы картина: истово верующие и почитающие законы церкви и государства, выламывали руки щуплому старичку в потертом клетчатом пиджаке.\r\n\r\n — Я точно видел, как он вчера с книгами ночью шел! Точно видел! – Верещал мужичок, что, однако, не мешало ему выкручивать старику руки за спиной. \r\n\r\n — Божечки, да что же это творится, все не угомонятся, нехристи, — запричитала стоящая рядом с Ваней бесформенная женщина неопределенного возраста. Ей с одинаковым успехом могло быть как и тридцать, так и все шестьдесят лет, но тяжелый физический труд, постоянное обстирывание прорвы детей и готовка высосали из нее последние соки, оставив лишь бесформенную расплывчатую оболочку благомысленной прихожанки. \r\n\r\n — Где книги?! Где книги, старый черт?! – Продолжал тем временем верещать обличитель. — Мы их найдем! Слышишь?! Найдем и ты ответишь! \r\n\r\nКто-то останавливался понаблюдать, чем же закончится обличение старика, другие – кто дорожил своим временем, обходили место задержания стороной, но не слишком быстро: не дай Бог кто подумает, что они сбегают с места богоугодного деяния. \r\n\r\nПочти сразу же после очередной реплики бдительного прихожанина из-за угла появился церковный «Вепрь» и, сжигая резину, помчался прямиком к ним. \r\n\r\n — Смотрите, батюшка! Опасного еретика задержал! – Сразу же захорохорился мужичок при виде выходящего из люка необъятного попа в бронежилете и с крестом на груди. – Клянусь вам, батюшка, видел вчера этого старика со старыми книгами в руках! \r\n\r\nПоп окинул мужичка солоноватым взглядом, будто все это время дремал в кузове, удостоил взглядом толпу, а только потом посмотрел на нарушителя. \r\n\r\n — А… — Протянул поп, глядя на старика в потертом пиджаке. – Что, Пачин, снова ты? \r\n\r\nСтарик ничего не ответил и только мельком, исподлобья, посмотрел на попа. \r\n\r\n — Отпустите его, — сказал поп, обращаясь уже к мужичку, — это блаженный местный, Сашка Пачин. Господь разум у него еще по молодости забрал, вот, сейчас ходит, книжки свои таскает. Да, Сашка?\r\n\r\nСтарик вновь воздержался от ответа, будто не услышал попа. Но если Ванечка что и понимал в людях – а понимал, по его собственному мнению, он немало – этот дед был далеко не блаженным. \r\n\r\nПоп уже было начал разворачиваться обратно к машине, но тут его взгляд за что-то уцепился и он, будто бывалый карманник, выбросил вперед руку – старику за пазуху – откуда из потайного кармана вытянул маленькую потрепанную книжечку. \r\n\r\n — Ах ты Иуды сын… — Начал, но не закончил поп, наотмашь ударив старика по лицу, от чего тот повалился на пыльный тротуар. — Медицинский справочник?! Опять?! Русскому человеку не нужна эта ересь, его молитва исцеляет! \r\n\r\nПоп перекрестился, а следом за ним и вся толпа вокруг. Мужичок, что задержал блаженного, чуть замешкался, от чего крестился с удвоенным рвением — Ванечка насчитал минимум четыре, а то и пять раз. \r\n\r\n — Согласно законам Божьим и Российской Федерации я конфискую эту богомерзкую книгу! Именем церкви и Господа нашего Иисуса! – Поп почти сорвался на крик. – А ты, Сашка, берегись! Владыка все прощает, но не церковь!\r\n\r\nТолпа стала потихоньку разбредаться – смотреть было уже не на что. Поп еще постоял у машины, наблюдая, чтобы никто не вздумал учинить самосуд над Пачиным – глаза у народа так и горели – а блаженный старик, тяжело поднявшись на ноги и сплевывая кровь, побрел в сторону, прочь с главной улицы и глаз соотечественников. \r\n\r\nВанечка задумчиво посмотрел сгорбленной фигуре вслед. Ему хотелось задать маме, которая все это время молча стояла рядом, уйму вопросов, но он понимал, что сейчас не место и не время. И вряд ли это самое «время» когда-нибудь настанет. \r\n\r\nДальше была молитва, целование распятия в руках местного священника и обязательные добровольные пожертвования на строительство нового храма. Этот воскресный день не отличался бы ни чем от любого другого воскресного дня, если бы не сцена с блаженным стариком. \r\n\r\nУже вечером, перед сном, молясь за здоровье патриарха, его помощников и вообще всех служителей церкви, президента, правительства и матери, Ванечка чуть было не включил в свое обращение к Господу и блаженного старика Сашку Пачина, но остановился. Не потому, что он – еретик. Мальчик решил, что старик бы и сам не обрадовался тому, что за него молятся. Это было видно по обреченному взгляду исподлобья, который заметил Ванечка, там, на тротуаре. Но не злому. Старик будто бы жалел их всех: попа, мужичка, что выкручивал ему руки, да и зрителей, в том числе и его – Ванечку. \r\n\r\nМальчик решил, что во время очередной прогулки обязательно разыщет блаженного и спросит, почему он всех их так жалеет.\r\n\r\nА еще он обязательно спросит, что такое «медицинский справочник».	https://habr.com/ru/post/405389/	8363484a-393a-4b59-ba9d-f6f85d884f47
1de8c558-5f54-4961-9094-2dd8a7ebafbb	Слух: Google планирует добавить в Chrome встроенный блокировщик рекламы	Google; Chrome; adblock; блокировка рекламы; доходы; финансы; навязчивая реклама; встроенный блокировщик	Интернет-гигант Google рассматривает возможность добавления встроенного и по умолчанию включенного блокировщика рекламы в свой браузер Google Chrome, пишет WSJ и ряд других СМИ. На первый взгляд кажется, что Google противоречит сама себе: львиная доля прибыли компании приходится на рекламу, которая показывается в поисковой выдаче, на Gmail и YouTube.\r\n\r\nЕсли встроенный блокировщик и будет создан, то работать он будет не по модели AdBlock или других расширений, которые «режут» все подряд. Инструмент Google будет направлен против наиболее раздражающей пользователей рекламы, прародителями которой являются поп-апы и мигающие баннеры из девяностых. Например, блокировщик Chrome будет отсекать все те же всплывающие окна, самовоспроизводящиеся аудио и видеозаписи. \r\n\r\nВ действиях интернет-гиганта прослеживается определенная логика: не можешь победить — возглавь (с некоторыми оговорками). Так, Google крайне не любит договариваться с посредниками в лице авторов AdBlock или uBlock. При этом большая часть размещаемой на страницах рекламы является не такой уж и навязчивой — пользователи ищут у блокировщиков защиты именно от агрессивной и потенциально опасной рекламы, на которую можно натолкнуться во время серфинга отдаленных уголков сети. \r\n\r\nВ издании WSJ считают, что создание встроенного блокировщика для одного из самых популярных браузеров планеты может создать рекламные стандарты и правила для баннеров и их содержания, которые диктовать будет уже не посредник в лице авторов расширения, а сам интернет-гигант. Так, в будущем соблюдение норм верстки страниц и размещения баннеров позволит в автоматическом режиме «обходить» встроенный блокировщик Chrome.\r\n\r\nНа столь решительные меры Google может пойти не от хорошей жизни: количество пользователей, использующих блокировщики рекламы, постоянно растет и интернет-гиганту уже пришлось договариваться о внесении «приемлемой рекламы» в white-лист AdBlock Plus с его создателями. Подобное положение дел, с точки зрения огромной компании, не только неприемлемо, но и унизительно. \r\n\r\nБлокировка абсолютно всей рекламы стала проблемой не только для Google, который все равно заработал за 2016 год свои $60 млрд, но и для интернет-издателей, которым приходится вводить модель pay-wall для выживания собственных ресурсов: в некоторых случаях более 50% аудитории пользуется блокировщиками рекламы. И даже предлагаемый White-лист AdBlock Plus и других блокировщиков не является панацеей: многие пользователи принудительно режут абсолютно всю рекламу, а сам процесс согласования баннеров и их содержимого может затянуться на не один месяц. Кроме этого, владельцы AdBlock требуют немалые отступные за внесение страниц ресурса в белый список. \r\n\r\nСам факт создания блокировщиков и набора ими популярности развязали своеобразную «гонку вооружений». Вместо ненавязчивой контекстной рекламы, которая стала набирать обороты в начале десятилетия, сейчас мы наблюдаем борьбу за тех, кто остался «без защиты». Рекламодатели становятся все менее и менее разборчивы в своих методах ради привлечения внимания потенциальных потребителей, что в свою очередь вызывает очередной прирост в рядах тех, кто пользуется блокировщиками рекламы и «режет» абсолютно все объявления. \r\n\r\nВ первую очередь блокировщик будет создан (если вообще будет) для десктопной версии Chrome — при всей популярности мобильных платформ, они генерируют только около четверти рекламной прибыли компании. Вся остальная часть рекламного дохода приходится именно на персональные компьютеры.\r\n\r\nЕсли Google сможет взять под контроль эту ситуацию, то в перспективе, от подобного подхода выиграет весь веб, а не только интернет-гигант: добропорядочным ресурсам не придется беспокоиться о том, как заработать на рекламе, рекламодателями — где и как размещаться, а пользователям — что делать с навязчивой рекламой. Единственное, что тревожит — Google уже давно перестала быть «Корпорацией Добра» и неизвестно, как компания поведет себя по отношению к сторонним ресурсам, если сможет изжить прочие блокировщики. Вполне вероятно, что создание встроенного блокировщика в Chrome, который сейчас занимает 47,5% рынка браузеров — это первый шаг к установлению «рекламной диктатуры» Google. Ведь известно, что компания ведет весьма жесткую политику в этом направлении.	https://habr.com/ru/post/403353/	8363484a-393a-4b59-ba9d-f6f85d884f47
9fc8372d-03e6-466c-97df-10a63c294824	Роскомнадзор планирует бороться со способами обхода блокировки сайтов	Роскомнадзор; регулирование интернета; законотворчество	Чиновники из Роскомнадзора разработали законопроект, который поможет ведомству в борьбе со способами обхода блокировок сайтов, сообщают «Ведомости» со ссылкой на источники в интернет-компаниях. По другим данным над текстом документа работали представители Медиа-коммуникационного союза, которые ранее отметились одобренным в январе законопроектом о регулировании аудио-визуальных сервисов. Суть документа от этого не меняется и заключается в том, что в случае его принятия Роскомнадзор сможет оказывать давление на VPN-сервисы, поисковики и анонимайзеры. Последние будут обязаны ограничивать доступ к ресурсам, внесенным в реестр запрещенных сайтов под угрозой санкций со стороны регулирующих органов. \r\n\r\nДокумент подразумевает внесение поправок в закон об информации и КоАП. В поясняющей записке к документу говорится, что авторы признают текущую систему ограничения доступа к контенту неэффективными и меры, предлагаемые в поправках, призваны закрыть эти «дыры». При этом часть вины возлагается на поисковые системы, предоставляющие ссылки на запрещенные ресурсы в поисковой выдаче, а также на сами технологии, позволяющие обойти топорную блокировку, считают авторы документа.\r\n\r\nТак, в законопроекте отмечается, что практика блокировок сайтов является неэффективной из-за существования и самих механизмов работы VPN-сервисов, прокси-серверов, анонимайзеров и т.д. В тоже время перенаправление трафика через эти инструменты признается легальным и общеприменимым, однако не в случае обхода блокировок. \r\n\r\nПредполагается, что по требованию Роскомнадзора владельцы VPN-сервисов и других инструментов по пренаправлению трафика будут добровольно вносить заблокированные ресурсы в собственные блек-листы для ограничения к ним доступа клиентов из Российской Федерации. Также предлагается обязать владельцев поисковых систем фильтровать выдачу и не отображать в результатах поиска заблокированные ресурсы. В противном случае авторы законопроекта предлагают штрафовать поисковики на сумму до 700 000 рублей. \r\n\r\n«Естественно, мы против распространения незаконного контента, но при этом законодательно не должно нарушать права и свободы гражданина на доступ к информации», -сказал директор Регионального общественного центра интернет технологий (РОЦИТ) Сергей Гребенников. «Да, «серые» зоны используют для совершения незаконных действий и распространения запрещённого контента с использованием анонимайзеров, но это совершенно не означает, что добросовестные пользователи должны страдать. Также важно отметить, чтобы законопроекты не нарушали права пользователей, которые выбирают безопасное использование интернета, например, используя VPN-соединение», — заключил он.\r\n\r\nФактически, с одной стороны регулирующие органы и приближенные к ним структуры пытаются оправдать введение практики блокировки сайтов, которая оказалась неэффективной (о чем их предупреждали еще до создания реестра запрещенных сайтов и начала блокировок), еще больше «затягивая гайки». С другой же — пытаются сохранить лицо, говоря о соблюдении интересов и прав сферического пользователя, «который не должен страдать».\r\n\r\nВ Минкомсвязи никак не прокомментировали инициативу и заявили, что подобные документы к ним не поступали. Однако если законопроект будет принят, то VPN-соединение — инструмент, популярный, в первую очередь, в корпоративном сегменте для обеспечения удаленного доступа к внутренней инфраструктуре для сотрудников, может в итоге оказаться вне закона.	https://habr.com/ru/post/356142/	8363484a-393a-4b59-ba9d-f6f85d884f47
98da6d74-f4fc-4f46-86c5-d6dc3202d2ee	Джефф Безос тратит на развитие Blue Origin $1 млрд в год	New Glenn; New Shepard; Безос Джефф; Илон Маск; SpaceX; Blue Origin; космический туризм.	К 2017 году коммерческие космические полеты стали реальностью. Сейчас впереди находится Илон Маск со своим SpaceX, однако и у «Тони Старка» реального мира есть свои конкуренты.\r\n\r\nТак, основатель и глава проекта Blue Origin Джефф Безос на космическом симпозиуме в Колорадо-Спрингс заявил, что ежегодно продает своих акций Amazon на сумму $1 млрд и вкладывает вырученные средства в собственный космический проект. В отличие от Маска с его контрактами НАСА и поддержкой инвесторов, проект Безоса во многом существует за деньги самого миллиардера. При этом Безосу не приходится изгаляться перед «денежными мешками» в надежде получить очередной раунд инвестиций: состояние миллиардера оценивается в $72 млрд (2017 год), так что при нынешних расходах Blue Origin продолжит развиваться пока бизнесмен будет жив или не откажется от этой затеи. \r\n\r\nДжефф Безос — глава и основатель одной из самых успешных торговых интернет-площадок современности — Amazon. Фактически, он является одним из богатейших людей планеты, уступая по этому показателю только Биллу Гейтсу с его рекордными $90 млрд и некоторым бизнесменам из реального и финансового секторов экономики. \r\n\r\nПроект Blue Origin был запущен в уже далеком 2000 году. Фактически, Безос стал первым миллиардером, обратившим свой взор в сторону космоса, причем не с целью запуска коммерческих спутников, а желанием упростить и удешевить полеты, что позволит человечеству стать ближе к звездам. Первоначальная концепция Blue Origin подразумевала коммерческие пуски с целью космического туризма по более адекватным, нежели у НАСА, ценам. В 2002 году к «клубу» Безоса присоединился Илон Маск, основав SpaceX, а уже в 2004 за коммерческие полеты в космос взялся бизнесмен Ричард Бренсон. \r\n\r\nВ отличие от Маска, который выбрал путь симбиоза с НАСА, Безос предпочел развивать Blue Origin по мере собственных сил и возможностей. В какой-то момент бизнесмен признал подход Маска в плане повторного использования первых ступеней ракет эффективным и также начал работу в данном направлении. \r\n\r\n«Если мы сможем значительно удешевить полеты в космос, то это развяжет руки множеству предпринимателей. Вы увидите созидание, вы увидите динамику и творчество, вы увидите все то, чему я был свидетелем в Интернете последние 20 лет», — сказал Безос на космическом симпозиуме в Колорадо-Спрингс.\r\n\r\nГлавной причиной, по которой Маск, а не Безос, всегда был на слуху со своими запусками — это реальные пуски ракет. Илону и SpaceX необходимо выполнять контракты с НАСА и другие заказы, для того, чтобы удержаться на плаву и продолжить свое существование. Blue Origin под крылом Безоса избежала подобного давления, поэтому инженеры работают над созданием ракет и делают экспериментальные пуски без лишнего шума.\r\n\r\nВ сентябре 2016 года Blue Origin официально представила публике одну из своих разработок — двухступенчатую ракету New Glenn, которая должна составить конкуренцию «Соколам» SpaceX в коммерческих доставках грузов. \r\n\r\nBlue Origin’s next step…meet New Glenn #NewGlenn #GradatimFerociter pic.twitter.com/p4gICKZRfi— Jeff Bezos (@JeffBezos) September 12, 2016\n\r\nОднако, New Glenn не перечеркнул более ранний проект Blue Origin по космическому туризму под названием New Shepard. Например, в октябре 2016 года инженеры провели весьма зрелищные испытания системы спасения экипажа во время пуска. В ракете спроектирована система спасения головной капсулы, в которой по задумке будут размещаться экипаж и пассажиры. После искусственного создания «аварийной» ситуации на высоте около 5000 метров, головная часть-капсула отстрелилась от ракеты-носителя и с ускорением ушла от нее по другой траектории. \r\n\r\nНеобходимо отметить тот факт, что в отличие от возвращенных ступеней SpaceX, которые стали летать повторно буквально на днях, ступень New Shepard, которая принимала участие в симуляции аварийной ситуации с отстрелом капсулы, стартовала на тот момент уже в пятый раз. По словам Безоса, после проведения испытаний ступень была отправлена на пенсию, хотя в теории, после обслуживания, ее можно было бы использовать вновь. \r\n\r\nПри этом сравнивать Falcon 9 и New Shepard некорректно. Перед ракетой Маска стоят совершенно иные задачи. Взять хотя бы удельный импульс, который необходим полезной нагрузке Falcon 9 для вывода груза на орбиту, когда как туристический проект Blue Origin пока ограничивается 10-11 минутным суборбитальным полетом. New Shepard оснащен шестью посадочными местами для туристов и по мнению Безоса первые полеты могут состояться уже в 2018 году. \r\n\r\nСогласно девизу компании — «Gradatim ferociter», что с латыни можно перевести как «шаг за шагом, неизбежно», Джефф Безос придерживается тактики размеренной, пошаговой экспансии. По мнению бизнесмена, массовые суборбитальные полеты — это первый шаг, ключ к выводу на орбиту миллионов людей для жизни и работы в космосе. Космический туризм по адекватной цене имеет в глазах Безоса сразу несколько преимуществ. Главное же — получение бесценного опыта по посадке первой ступени New Shepard, который в дальнейшем Blue Origin сможет применить на ракете New Glenn. Окончательная стоимость билета на 10-минутный суборбитальный полет пока неизвестна, но, вероятно, она будет находиться около отметки в $250 000 — именно за столько Ричард Бренсон продавал места на своем проблемном аппарате Virgin Galactic. \r\n\r\nДевиз компании Безоса, однако, не мешает Blue Origin перераспределять усилия. Уникальный опыт от запусков и возврата ступеней New Shepard — это хорошо, но на развитие ракеты-носителя New Glenn в ближайшие годы потребуется, по оценкам, $2,5 млрд. В первую очередь Джефф бизнесмен, поэтому у его ракеты уже есть коммерческий клиент по доставке грузов — телекоммуникационная компания Eutelsat, для которой New Glenn выведет на орбиту спутники. Этот контракт позволит покрыть часть расходов на разработку и строительство летательных аппаратов и ускорит развитие отрасли. Ожидается, что первые коммерческие пуски New Glenn состоятся через два года после старта туристических запусков New Shepard — в 2020 году.	https://habr.com/ru/post/402947/	8363484a-393a-4b59-ba9d-f6f85d884f47
0a73bc69-e607-4c8c-b85b-e8db64e2ec9a	Акционеры Tele2 рассматривают переход оператора под контроль «Ростелекома»	Tele2; Ростелеком; оператор связи; сотовый оператор; сотовая связь; государство; взаимодействие; конкуренция	Акционеры сотового оператора Tele2 рассматривают возможность перехода компании под контроль «Ростелекома» через продажу части акций, сообщают «Ведомости» со ссылкой на первого заместителя председателя правления Банка ВТБ Юрия Соловьева. С его слов ВТБ не намерен полностью продавать Tele2, но рассматривает варианты об изменении своей доли в операторе.\r\n\r\nСейчас сотовый оператор Tele2 на 45% принадлежит «Ростелекому». Держателем остальной части бумаг компании является Russia Holding AB, в котором состоит ВТБ. Самому банку принадлежит половина бумаг Tele2 холдинга.\r\n\r\nАкционеры надеются, что смена правления на «Ростелеком» позволит Tele2 реализовать кросс-предложения, на которые изначально делалась ставка. Именно поэтому оператор связи и был привлечен в качестве собственника и партнера.\r\n\r\nПроблема заключается в том, что в нынешнем своем виде Tele2 сложно конкурировать с операторами большой тройки, а различное правление в сотовом операторе и операторе связи снижает эффективность взаимодействия между компаниями. Акционеры планируют, что под управлением «Ростелекома» у Tele2 больше перспектив за счет более мощной поддержки оператора связи. \r\n\r\n«Мы прошли самое тяжелое время, самые высокие процентные ставки, самый большой CAPEX в тяжелейшей конкурентной борьбе… Когда мы обменялись мобильными активами с «Ростелекомом», у нас была надежда на то, что компании смогут работать эффективно. К сожалению, структура акционеров не позволяет нам реализовать эту синергию полностью», – приводит слова Соловьева «Интерфакс».\r\n\r\nНе последнюю роль играет и то, что с продажей части акций «Ростелекому», государство в его лице получит актив виде сотового оператора, который с политической и практической точек зрения необходим. \r\n\r\nРанее ВТБ отрицал ведение переговоров о продаже доли Tele2 и уверял, что изменять свою долю в сотовом операторе не планирует.	https://habr.com/ru/post/402749/	8363484a-393a-4b59-ba9d-f6f85d884f47
b654d64b-4180-4031-ab5a-f8861272ca17	НАСА опубликовало собственный архив фотографий, видео и аудиозаписей	космос; НАСА; фотографии; архив; изображения; популяризация космоса	НАСА опубликовало свой архив аудиовизуальных материалов, связанных с исследованием космоса. Об этом сообщается на официальном портале агенства. Все опубликованные материалы доступны на отдельном ресурсе https://images.nasa.gov. \r\n\r\nВ общей сложности достоянием общественности стали более 140 000 фотографий и изображений, сделанные спутниками и обработанные специалистами агенства. Также были опубликованы видео и аудиозаписи, сделанные в ходе различных космических миссий НАСА. Всего архив состоит из 60 различных медиатек. \r\n\r\nВ агентстве знают о любви многих пользователей интернета использовать изображения, связанные с космосом, в качестве заставок для рабочего стола и популярности мобильных устройств. Поэтому на ресурсе реализован не только поиск по метаданным, но и система автоматического масштабирования изображений под разрешение экранов, в том числе мобильных телефонов и планшетов. \r\n\r\nЭтот шаг значительно упростит пользователям процесс ознакомления с архивом. Система масштабирования, однако, не ограничивает пользователей в их тяге к прекрасному и позволяет открывать и скачивать все изображения в высоком разрешении. Правда, многие кадры выложены не в оригинале и за экстремально большими изображениями созвездий и галактик придется обращаться на порталы самих телескопов, например, на сайт «Хаббла». Кроме этого, все видеоматериалы сопровождаются английскими субтитрами для людей с нарушениями слуха. \r\n\r\nК новому порталу также был прикручен API для энтузиастов, которые желают автоматизировать выгрузку свежих материалов, которыми в дальнейшем будет пополняться библиотека. \r\n\r\nВ НАСА признают, что опубликованные материалы — это далеко не все, чем располагает агентство. По мнению специалистов НАСА, они сумели отобрать лучшие материалы, которые будут интересны людям.	https://habr.com/ru/post/370317/	8363484a-393a-4b59-ba9d-f6f85d884f47
bae01c93-e6df-410d-bd28-7483db4307d1	Заблокированная соцсеть LinkedIn встала на налоговый учет в ФНС	LinkedIn; РКН; регулирование интернета; блокировки; Роскомнадзор; социальная сеть; налог на Google	Социальная сеть LinkedIn после недавнего демарша своего руководства и публичного отказа от выполнения норм российского законодательства пошла на попятную и встала на учет в Федеральной налоговой службе для уплаты «налога на Google», сообщают «Известия». LinkedIn станет одной из 128 зарубежных компаний, которые начнут платить налоги с 25 апреля этого года. \r\n\r\nФакт постановки компании на учет не отменяет блокировки социальной сети Роскомнадзором за неисполнение требований законодательства о нормах хранения и обработки персональных данных россиян. Ранее вице-президент LinkedIn направил регулятору письмо, в котором сообщил, что его компания не готова исполнять подобные требования.\r\n\r\nВопреки официальной блокировке на территории РФ и позиции отдельных членов руководства компании, LinkedIn предпринимает шаги по восстановлению полной работоспособности сервиса в РФ. Так, в пресс-службе социальной сети сообщили, что «LinkedIn будет по-прежнему доступна на русском языке, и мы надеемся, что сможем восстановить сервис в России в будущем».\r\n\r\nИстория с блокировкой профессиональной соцсети началась еще в середине 2016 года. Тогда Роскомнадзор подал на LinkedIn в суд за нарушение законодательства в области сбора, хранения и обработки персональных данных россиян. Регулятора не смутил тот факт, что юридически социальная сеть не присутствовала в российском правовом поле — для работы в РФ, по мнению РКН, достаточно и русскоязычной версии сайта. С точки зрения юристов LinkedIn слушания были проведены с нарушениями, но социальная сеть все равно была заблокирована, а апелляция результатов не принесла. \r\n\r\nДо отправки в Роскомнадзор письма с сообщением о «неготовности исполнять нормы российского законодательства», представители LinkedIn вели с Роскомнадзором переговоры, которые окончились безрезультатно. \r\n\r\n«Мы встречались с Роскомнадзором в декабре, чтобы обсудить требования закона к локализации. Несмотря на наши переговоры, мы до сих пор не нашли понимания с Роскомнадзором, которое привело бы к разблокировке LinkedIn и позволило бы нам снова предоставлять сервис пользователям из России. Это означает, что LinkedIn по-прежнему будет заблокирован в РФ», — заявил вице-президент LinkedIn Эриэл Экстин.\r\n\r\nТехнически, LinkedIn может и не платить в российскую казну. Юридически соцсеть все еще не ведет дел на территории РФ, так что компания сможет подать так называемую «нулевую отчетность». Даже если первые отчеты и будут пустыми, взаимодействие с российскими властями продолжится: LinkedIn принадлежит софтверному гиганту Microsoft, который долгие годы успешно и легально работает на рынке РФ. \r\n\r\nПостановка LinkedIn на налоговый учет — первый шаг по восстановлению легальной работы сервиса в РФ. Многое сейчас зависит и от принципиальности Роскомнадзора: требования по хранению персональных данных до сих пор не выполняют многие крупные иностранные компании, но под удар в качестве «пробы сил» попал именно LinkedIn — не слишком популярный в массах, узкоспециализированный сервис.	https://habr.com/ru/post/402705/	8363484a-393a-4b59-ba9d-f6f85d884f47
865f560a-88bb-4cb8-9c3c-642a305c0779	Илон Маск создает компанию Neuralink для разработки нейроинтерфейсов	Маск; мозг; мозговые импланты; нейроинтерфейс; проект; исследования мозга; киберпанк	Фото: Джонас Фредуолл Карлссон\r\n\r\nОснователь компаний SpaceX и Tesla Motors Илон Маск набирает сотрудников в свою новую компанию Neuralink, которая займется разработкой нейроинтерфейса — технологии, позволяющей считывать информацию из головного мозга человека и записывать ее на цифровые носители, сообщает Reuters.\r\n\r\nПредполагается, что для создания подобной технологии Neuralink разработает множественные мозговые импланты, которые будут считывать электронные сигналы и интерпретировать их в понятную нам информацию.\r\n\r\nМаск пока не представил свой проект публике и никак не комментировал деятельность своей новой компании. \r\n\r\nВ июле прошлого года в Калифорнии была зарегистрирована компания Neuralink, цель которой, согласно документам, — исследования в области медицины. Теперь компания начала набор сотрудников. Так, уже были наняты несколько ведущих ученых в области исследований мозга. В их числе Ванесса Толос, инженер и специалист по гибким электродам из Ливерморской национальной лаборатории Лоуренса, Филип Сабес, профессор Калифорнийского университета в Сан-Франциско, изучающий контроль мозгом движений человека и Тимоти Гарднер, профессор Бостонского университета который известен своими операциями по имплантации электродов в мозг вьюрков для изучения пения птиц.\r\n\r\nДомен Neuralink уже занят, но на сайте стоит заглушка с логотипом компании и адресом отдела кадров jobs@neuralink.com.\r\n\r\nЕще в прошлом году на конференции StartmeupHK 2016 Маск говорил о необходимости создания технологии нейроинтерфейса, которая позволит соединить мозг человека и компьютер. По задумке бизнесмена, это позволило бы взаимодействовать с машиной напрямую, без задержек и проблем с пропускной способностью таких устройств как мышь, клавиатура и прочая периферия. \r\n\r\nИсследования в области создания и вживления мозговых имплантов ведутся давно, но имеют более прозаичную цель. В первую очередь они используются для лечения эпилепсии и других заболеваний, вызванных некорректной работой головного мозга. \r\n\r\nВ США уже существуют схожие проекты. Так, стартап KerNEL работает над созданием коммерческих мозговых имплантов для стимуляции головного мозга и улучшения памяти. Его основал Брайан Джонсон, в прошлом, как и Маск, владелец части PayPal, которую он продал за $800 млн в 2013 году. \r\n\r\nПри этом KerNEL ставит перед собой менее футуристичные цели: основатель стартапа признает, что целевой аудиторией его имплантов будут пожилые люди и страдающие от болезни Альцгеймера. Слова Джонсона о его проекте чем-то напоминают романтические высказывания Маска касательно освоения космоса. «Человеческий разум заперт в теле и это приводит к деградации мозга», — говорил предприниматель.\r\n\r\nЕсли Маск решит лично контролировать компанию по созданию нейроинтерфейсов, возникнет интересная ситуация. Бизнесмен уже ведёт много футуристичных проектов, которые далеки от завершения. В их числе — надежные электрокары Tesla с системой полного автопилота, ракеты и корабли SpaceX, колонизация Марса, проект скоростных поездов Hyperloop и система подземных тоннелей, проект по созданию промышленных и бытовых систем аккумулирования и сохранения энергии PowerWall вкупе с «солнечной крышей» Solar Roof, бурение тоннелей The Boring Company, глобальный доступ в Интернет на 4 тыс. спутников, удешевление стоимости запуска груза на орбиту Земли за счёт повторного использования частей ракет и прочие.\r\n\r\nУже сейчас этот список значительно превышает возможности даже такого выдающегося бизнесмена как Маск. Если к нему добавится Neuralink и, возможно, что-то еще, то логического завершения и создания хотя бы половины из запланированного мы можем и не дождаться.	https://habr.com/ru/post/402655/	8363484a-393a-4b59-ba9d-f6f85d884f47
a7e21e83-0504-4e6f-8944-a608a3af7fb5	Uber возобновил тестирование своих робомобилей через три дня после аварии	uber; авария; возобновление тестов; спешка	Сервис Uber возобновил тестирование беспилотных автомобилей собственной разработки спустя три дня, после аварии, сообщает Engadget.\r\n\r\nАвария произошла в городе Темпе в штате Аризона. Робомобиль столкнулся с другим автомобилем и перевернулся. В салоне находился только водитель, никто не пострадал. \r\n\r\nПредварительной причиной ДТП полиция называет человеческий фактор: другая машина под управлением живого человека не пропустила робомобиль Uber, что привело к столкновению. Сообщалось, что тестирование робомобилей будет приостановлено на время разбирательства причин аварии.\r\n\r\nОднако, Uber заявил о возобновлении испытаний до окончания официального расследования аварии в Темпе. Сервис стремится как можно скорее выпустить рабочий вариант робомобиля, чтобы сократить собственные издержки: с момента своего основания Uber убыточен и уже много лет «проедает» деньги инвесторов. Основная статья расходов сервиса — компенсация затрат водителей, так как тарифы Uber демпингуют рынок пассажирских грузоперевозок по всему миру и далеки от рентабельности. \r\n\r\nЭто далеко не первое происшествие с участием автономных транспортных средств. В прошлом году автопилот Tesla завел машину на полной скорости под фуру. В результате погиб водитель электрокара — известный энтузиаст автономного транспорта и друг компании Tesla Джошуа Браун.	https://habr.com/ru/post/370311/	8363484a-393a-4b59-ba9d-f6f85d884f47
c0e82ea8-e30d-4702-abed-ea28bd77e13f	МТС упразднил тарифы с безлимитным мобильным интернетом	МТС; мобильная связь; безлимитище; ограничение по трафику; мобильный интернет; деньги; финансы	«Безлимитище» всё.\r\n\r\nМТС первым из крупных операторов связи отказался от предоставления мобильного безлимитного доступа к сети Интернет, сообщают «Ведомости». \r\n\r\nПод сокращение попал тарифный план «Безлимитище». Теперь всем абонентам, подключившимся на данный тарифный план 27 марта 2017 года и позже, будет предоставляться 10 ГБ входящего трафика вместо безлимитного доступа в Сеть. Стоимость пакета составляет 550 рублей.\r\n\r\nПо информации «Ведомостей», другие тарифы оператора Smart+, Smart Top и Smart ULTRA также имеют ограничения по трафику (7, 15 и 20 ГБ соответственно), однако на официальном сайте МТС тариф Smart+ все еще значится как пакет с безлимитным интернетом.\r\n\r\nПредставители МТС утверждают, что проанализировали потребление трафика пользователями и пришли к выводу, что абоненты с безлимитным доступом, в основной своей массе, потребляют не более 5-6 ГБ трафика в месяц. Соответственно, из этих цифр и была скорректирована тарифная сетка компании, которая покроет нужды подавляющего большинства клиентов. \r\n\r\nДля тех же, кому необходимы большие объемы, МТС предлагает выбрать более дорогой, чем «Безлимитище», тарифный план.\r\n\r\nРазговоры об отказе сотовых операторов от безлимитных тарифов начались еще в 2016 году. В декабре гендиректор «Вымпелкома» Шелль Мортен Йонсен сказал, что отказ от «безлимитов» не ударит по рядовым пользователям и коснется только некоторых клиентов.\r\n\r\n«Вы увидите пошагово, что индустрия постепенно уйдет от безлимитных тарифов. Пользователи с нормальным потреблением данных не увидят изменений, но это дисциплинирует людей, которые используют экстремально большое количество данных», — сказал тогда Йонсен. \r\n\r\nГендиректор «Вымпелкома» так же отметил, что единолично его компания не сможет принимать подобных решений, так что отказ от безлимитных тарифных планов доступа в Интернет, если он произойдет, будет повсеместным, у всех крупных операторов связи в РФ. Первый шаг сделал МТС.\r\n\r\nРанее МТС пытался бороться с клиентами, выкачивающими сотни гигабайт при помощи мобильного интернета. Так, одной из мер в мае 2016 года стало закрепление за компанией права ограничивать скорость доступа к сети в одностороннем порядке. Применялась данная практика к клиентам с «аномально высоким потреблением». \r\n\r\nС момента появления безлимитных тарифов операторы боролись с пользователями, использующими одну сим-карту в качестве шлюза для «раздачи интернета» множеству потребителей. Немаловажную роль играет и то, что в крупных городах 3G и LTE-сети достигают своего насыщения, а строительство 5G-сетей еще даже не началось. При этом предоставление мобильного доступа к Сети более затратно для операторов, чем их классическая сфера — предоставление услуг голосовой связи. \r\n\r\nОтталкиваясь от слов гендиректора «Вымпелкома», в ближайшие месяцы стоит ожидать упразднения безлимитных тарифных планов мобильного интернета и у других крупных операторов сотовой связи в РФ.	https://habr.com/ru/post/402657/	8363484a-393a-4b59-ba9d-f6f85d884f47
b4247ac5-28ff-4f17-9d01-a1aeed088bdd	Правительство легализовало экспертные комиссии при Роскомнадзоре	Регулирование интернета; РКН; Роскомнадзор; железный занавес; экспертная комиссия	Роскомнадзор опубликовал уточнения к правилам ведения реестра запрещенных сайтов. По информации на странице ведомства, теперь к блокировке ресурсов будет официально привлекаться специальная экспертная комиссия, которая по запросу РКН сможет вынести решение о добавлении сайта или страницы в сети Интернет в реестр запрещенной информации. Экспертные комиссии от МВД, медиков, Роспотребнадзора и ФНС и ранее участвовали в оценке противоправности той, или иной информации, но их деятельность не была официально прописана.\r\n\r\nУточнения зафиксированы в постановлении правительства от 21 марта 2017 года №320 «О внесении изменений в Постановление Правительства Российской Федерации от 26 октября 2012 г. N 1101». Документ доступен для ознакомления на сайте правительства РФ. \r\n\r\nСогласно уточнениям к документу 2012 года, Роскомнадзор сможет на законных основаниях привлекать экспертную комиссию для оценки противоправности размещенной в Сети информации. \r\n\r\n«… для принятия решения об отнесении информации к категории запрещенной в особо сложных случаях будет создаваться специальная межведомственная экспертная комиссия, состав и порядок деятельности которой утверждаются Роскомнадзором», — говорится на сайте регулятора. \r\n\r\nЗачастую, комиссии формируются из представителей заинтересованных ведомств. Представители Роскомнадзора также могут быть ее участниками. \r\n\r\nОсобой пикантности ситуации добавляет то, что теперь, когда деятельность комиссий официально прописана в документах, непонятно, что имеет большую юридическую силу: пакет необходимых для блокировки документов и свидетельств от инициирующего внесение сайта в реестр органа, либо же решение «экспертной комиссии». \r\n\r\nВ редакции постановления правительства от 2012 года перечисляется перечень документов, требуемых для легальной блокировки сайта. В случае недостатка этих сведений (подписанный приказ от надзорного органа, страница с противоправной информацией с ЭЦП чиновника, скриншоты и прочие свидетельства), по нормам 2012 года РКН обязано было возвращать запрос на уточнение. То есть это был единственный законный путь заблокировать ресурс в Сети.\r\n\r\nВ постановлении от 2012 года пункт 10 документа был изложен в следующей редакции: \r\n\r\nВ случае если в решении уполномоченного органа содержится не вся информация, необходимая для внесения в единый реестр реестровой записи, Федеральная служба по надзору в сфере связи, в течение суток направляют в уполномоченный орган запрос о предоставлении недостающей информации. Информация по такому запросу должна быть предоставлена уполномоченным органом в течение суток. До получения указанной информации доменное имя и (или) указатель страницы сайта в сети «Интернет» в единый реестр не включаются.\r\nВ редакции от 21 марта 2017 года этот пункт получил дополнение, которое, в теории, позволяет Роскомнадзору законно привлекать экспертную комиссию для вынесения решения по имеющимся данным в «особо сложных случаях»:\r\n\r\nУполномоченные органы могут вынести обсуждение вопроса о признании информации запрещенной к распространению на территории Российской Федерации на заседание экспертной комиссии… В случае вынесения вопроса о признании информации запрещенной к распространению на территории Российской Федерации на заседание экспертной комиссии срок принятия соответствующего решения уполномоченным органом увеличивается до 7 суток.\r\nВремя реагирования на постановление экспертной комиссии для самого Роскомнадзора было увеличено с одних суток до более комфортных семи. С какой целью это было сделано, в ведомстве не уточняют.	https://habr.com/ru/post/356126/	8363484a-393a-4b59-ba9d-f6f85d884f47
\.
